INSERT INTO `t_programas` VALUES (1,'2016-04-05 06:38:39','3001','doctoradoetsa@us.es','http://doctoradoarquitectura.us.es/','Arquitectura','2011','ARQUITECTURA Y CONSTRUCCIÓN','ARQUITECTURA Y URBANISMO','no','<h3>Perfil de Ingreso Recomendado</h3> <ul> <li> <p>Arquitectura</p> </li> <li> <p>Ingenier&iacute;as</p> </li> <li> <p>Matem&aacute;ticas, F&iacute;sica, Qu&iacute;mica, Ecolog&iacute;a, Ciencias Ambientales</p> </li> <li> <p>Historia del Arte, Arqueolog&iacute;a</p> </li> <li> <p>Bellas Artes</p> </li> <li> <p>Geograf&iacute;a</p> </li> <li> <p>Filosof&iacute;a</p> </li> <li> <p>Psicolog&iacute;a social, Sociolog&iacute;a, Antropolog&iacute;a</p> </li> <li> <p>Comunicaci&oacute;n audiovisual</p> </li> <li> <p>Derecho y Econom&iacute;a</p> </li> </ul> <br /> <h3>Requisitos y Criterios de Admisi&oacute;n</h3> <p>Como criterio general, de acuerdo a los perfiles de ingreso recomendados, se establecer&aacute; que la l&iacute;nea de investigaci&oacute;n recomendada ser&aacute; la m&aacute;s pr&oacute;xima de las recogidas en el Programa de Doctorado a aquella en la que ha realizado su Trabajo Fin de M&aacute;ster.</p> <br /> <p>Para aquellos estudiantes procedentes del EEES o fuera de &eacute;ste, la Comisi&oacute;n Acad&eacute;mica del Programa realizar&aacute; una valoraci&oacute;n de la formaci&oacute;n adquirida por el estudiante en su pa&iacute;s de origen, as&iacute; como de su experiencia curricular y profesional para poder asignarle la l&iacute;nea de investigaci&oacute;n que sea m&aacute;s af&iacute;n al perfil que presente.</p> <br /> <p>En cualquier caso, la recomendaci&oacute;n finalmente la har&aacute; la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado, una vez conozca no solo su perfil de ingreso sino tambi&eacute;n todo su curr&iacute;culum vitae, y haber tenido la entrevista personal con los solicitantes contemplada en los criterios de admisi&oacute;n.</p> <br /> <p>Criterios de admisi&oacute;n para cuando la demanda supere a la oferta:</p> <ul> <li> <p>Expediente acad&eacute;mico x coeficiente de afinidad: 35%: (Grado o equivalente, ponderado en funci&oacute;n del percentil de la titulaci&oacute;n: 25%; M&aacute;ster oficial o equivalente: 10%).</p> </li> <li> <p>Estancias internacionales de al menos tres meses para realizar estudios de m&aacute;ster, as&iacute; como conocimiento de idiomas (con preferencia ingl&eacute;s): 15%;</p> </li> <li> <p>Curr&iacute;culum vitae: 25%</p> </li> <li> <p>Documento de motivaci&oacute;n y entrevista personal con la comisi&oacute;n de admisi&oacute;n: 25%</p> </li> </ul> <br /> <p>Coeficiente de afinidad:</p> <ul> <li> <p>Titulaci&oacute;n de Arquitecto o de M&aacute;ster en Arquitectura, o bien otras titulaciones de los perfiles de ingreso recomendados que hayan realizado los m&aacute;steres oficiales vinculados a la ETS de Arquitectura de la Universidad de Sevilla (los cinco actuales m&aacute;s aquellos que puedan ser verificados en un futuro) y a la antigua Escuela Universitaria de Arquitectura T&eacute;cnica (los dos actuales m&aacute;s aquellos que puedan ser verificados en el futuro): 1,00</p> </li> <li> <p>Otras titulaciones que figuren en los perfiles de ingreso recomendados: 0,80</p> </li> </ul> <br /> <p>Estos coeficientes de afinidad (1,00 o 0,80) se aplicar&aacute;n a la puntuaci&oacute;n obtenida del expediente acad&eacute;mico.</p> <br /> <h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3> <p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p> <ul> <li> <p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</p> </li> <li> <p>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</p> </li> </ul> <br /> <h3>Complementos de Formaci&oacute;n</h3> <p>La Comisi&oacute;n Acad&eacute;mica del programa podr&aacute; establecer complementos de formaci&oacute;n que ser&aacute;n realizados en alguno de los siguientes m&aacute;steres oficiales de la Universidad de Sevilla:</p> <br /> <p>M&aacute;ster Universitario en Arquitectura y Patrimonio Hist&oacute;rico (MARPH) &ndash; m&aacute;ximo 15 ECTS</p> <p>M&aacute;ster Universitario en Ciudad y Arquitectura Sostenibles (MCAS) &ndash; m&aacute;ximo 15 ECTS</p> <br /> <p>Seg&uacute;n la l&iacute;nea recomendada de acuerdo al perfil de ingreso y por afinidad a la l&iacute;nea de investigaci&oacute;n que vaya a ser desarrollada en el programa de doctorado, el estudiante optar&aacute; por realizar los complementos formativos en uno u otro m&aacute;ster.</p> <br /> <!-- /.blog-post -->','{\"administrativo\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954555917\",\"nombre\":\"Olga Pérez Martagón\",\"email\":\"doctoradoetsa@us.es\"},\r\n	{\"direccion\":\"\",\"telefono\":\"954551630\",\"nombre\":\"Laura Vega Ruiz\",\"email\":\"iuccsecret@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"95.455.65.95\",\"nombre\":\"Juan José Sendra Salas\",\"email\":\"\"}\r\n	]}}'),(2,'2014-03-31 12:17:40','3002','arteypatrimonio@us.es','http://institucional.us.es/arteypatrimonio/','Arte y patrimonio','2011','BELLAS ARTES','','no','<h3>Perfil de Ingreso Recomendado</h3><h4>Descripci&oacute;n de capacidades.</h4><p>Incluye las competencias generales y espec&iacute;ficas que se deben haber adquirido en el m&aacute;ster o m&aacute;steres previos realizados. Para el acceso al programa de doctorado, la Comisi&oacute;n Acad&eacute;mica podr&aacute; determinar el grado de obtenci&oacute;n de las mismas, o de otras que puedan ser consideradas equivalentes, en la valoraci&oacute;n final realizada mediante el baremo de ponderaci&oacute;n recogido m&aacute;s adelante.</p><br /><h5>Competencias generales:</h5><ul><li><p>Aplicaci&oacute;n de los conocimientos adquiridos y su capacidad de resoluci&oacute;n de problemas en entornos nuevos o poco conocidos dentro de contextos m&aacute;s amplios (o multidisciplinares) relacionados con la creaci&oacute;n art&iacute;stica.</p></li><li><p>Integraci&oacute;n de los conocimientos y capacidad de enfrentarse a la complejidad de formular juicios a partir de una informaci&oacute;n que, siendo incompleta o limitada, incluya reflexiones sobre las responsabilidades sociales y &eacute;ticas vinculadas a la aplicaci&oacute;n de sus conocimientos y juicios.</p></li><li><p>Capacidad para comunicar conclusiones (y los conocimientos y razones &uacute;ltimas que las sustentan) a p&uacute;blicos especializados y no especializados de un modo claro y sin ambig&uuml;edades.</p></li><li><p>Posesi&oacute;n de las habilidades de aprendizaje que permitan continuar estudiando de un modo que habr&aacute; de ser en gran medida autodirigido o aut&oacute;nomo.</p></li><li><p>Capacidad para la reflexi&oacute;n y el trabajo en equipo, contribuyendo a constituir un espacio de investigaci&oacute;n, intercomunicaci&oacute;n, experimentaci&oacute;n y enriquecimiento en torno al discurso art&iacute;stico contempor&aacute;neo y a las consiguientes pr&aacute;cticas art&iacute;sticas, del Patrimonio Cultural y/o a la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>Adquisici&oacute;n de una formaci&oacute;n avanzada, de car&aacute;cter multidisciplinar e intermedial, en el &aacute;mbito de la creaci&oacute;n art&iacute;stica, del Patrimonio Cultural y/o de la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>Capacidad para el debate y la aportaci&oacute;n creativa en torno a aspectos art&iacute;sticos, t&eacute;cnicos y conceptuales, del Patrimonio Cultural y/o la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>Capacidad intelectual y t&eacute;cnica para el desarrollo de un proyecto art&iacute;stico, aplicado al Patrimonio Cultural y/o a la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales debidamente fundamentados.</p></li></ul><br /><h5>Competencias espec&iacute;ficas:</h5><ul><li><p>Conocimiento y aplicaci&oacute;n al &aacute;mbito art&iacute;stico, al Patrimonio Cultural y/o a la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales, de sistemas metodol&oacute;gicos de investigaci&oacute;n e innovaci&oacute;n.</p></li><li><p>Capacidad para aplicar Tecnolog&iacute;as de la informaci&oacute;n y la Comunicaci&oacute;n TIC al trabajo de investigaci&oacute;n.</p></li><li><p>Integraci&oacute;n de los conocimientos human&iacute;sticos, metodol&oacute;gicos e instrumentales necesarios para el desarrollo de un proyecto de investigaci&oacute;n dirigido a la creaci&oacute;n art&iacute;stica, al Patrimonio Cultural y/o a la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>Capacidad de interrelaci&oacute;n de las estrategias art&iacute;sticas y/o de conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales del pasado con la pr&aacute;ctica art&iacute;stica y el discurso est&eacute;tico contempor&aacute;neo, el Patrimonio Cultural y/o la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>Capacidad para generar y organizar informaci&oacute;n y documentaci&oacute;n gr&aacute;fica relevante para su aplicaci&oacute;n a la creaci&oacute;n art&iacute;stica, al Patrimonio Cultural y/o a la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>En el &aacute;mbito de las bellas artes, capacidad de an&aacute;lisis de la representaci&oacute;n art&iacute;stica de la figura humana as&iacute; como de las funciones de la imagen del cuerpo en los procesos de creaci&oacute;n de identidad.</p></li><li><p>Conocimiento y an&aacute;lisis de la relaci&oacute;n del arte, la cultura, el Patrimonio Cultural y/o la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales con las problem&aacute;ticas y cuestionamientos sociales contempor&aacute;neos.</p></li><li><p>Desarrollo de la percepci&oacute;n y an&aacute;lisis del espacio/entorno en sus m&uacute;ltiples acepciones en relaci&oacute;n a las &uacute;ltimas tendencias del arte, del Patrimonio Cultural y/o la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>Estudio de las estrategias de producci&oacute;n, de las obras contempor&aacute;neas de acci&oacute;n, intervenci&oacute;n y transformaci&oacute;n espacial, del Patrimonio Cultural y/o de proyectos de conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li><li><p>Capacidad para la producci&oacute;n, de obras a partir de ideas art&iacute;sticas y a trav&eacute;s de la adecuada utilizaci&oacute;n de diversos lenguajes y procedimientos t&eacute;cnicos y/o de proyectos vinculados al Patrimonio Cultural y/o a la conservaci&oacute;n y/o restauraci&oacute;n de bienes culturales.</p></li></ul><br /><h5>Conocimientos previos</h5><p>Adem&aacute;s de las competencias anteriormente mencionadas, el doctorando de nuevo ingreso debe poseer una serie de capacidades propias de un m&aacute;ster, que en este caso consisten en poseer un conocimiento, habilidades y capacidades espec&iacute;ficas en el &aacute;mbito de la creaci&oacute;n art&iacute;stica-pl&aacute;stica y la conservaci&oacute;n y restauraci&oacute;n de bienes culturales y especialmente en el &aacute;mbito de las tres l&iacute;neas de investigaci&oacute;n de este programa:</p><ul><li><p>Teor&iacute;a, an&aacute;lisis, conceptos, cr&iacute;tica y difusi&oacute;n en la creaci&oacute;n art&iacute;stica y del Patrimonio Cultural</p></li><li><p>Investigaci&oacute;n experimental de los diversos lenguajes art&iacute;sticos y sus tecnolog&iacute;as aplicadas, materiales, procedimientos y t&eacute;cnicas</p></li><li><p>Investigaci&oacute;n experimental de los diversos m&eacute;todos y t&eacute;cnicas de an&aacute;lisis, diagn&oacute;stico e intervenci&oacute;n en la conservaci&oacute;n y restauraci&oacute;n y sus tecnolog&iacute;as aplicadas.</p></li></ul><br /><h5>Lenguas de uso y nivel exigido</h5><p>La lengua ser&aacute; el Castellano. El alumnado no hispanoparlante deber&aacute; acreditar como m&iacute;nimo el nivel B1 de castellano del Marco Com&uacute;n Europeo de Referencia para las Lenguas (MCERL) que corresponde al nivel de usuario independiente, o equivalente seg&uacute;n lo recogido en la Resoluci&oacute;n Rectoral de la Universidad de Sevilla de 22 de febrero de 2013, reguladora de los procedimientos de adquisici&oacute;n y acreditaci&oacute;n de las competencias ling&uuml;&iacute;sticas exigidas en los estudios de Grado y M&aacute;ster Universitario. Se podr&aacute;n realizar algunas de las acciones formativas en ingl&eacute;s, franc&eacute;s e italiano que requerir&aacute;n un nivel m&iacute;nimo de conocimiento de idioma B1 o equivalente.</p><br /><h3>Requisitos y Criterios de Admisi&oacute;n</h3><p>El programa de doctorado est&aacute; dirigido a estudiantes que tengan formaci&oacute;n superior en materia art&iacute;stica y conservaci&oacute;n y restauraci&oacute;n de Bienes Culturales, contempl&aacute;ndose la posibilidad de admisi&oacute;n de titulados que no provengan de Facultades de Bellas Artes. El acceso a las titulaciones impartidas en la Facultad de Bellas Artes se rige por las directrices marcadas por la Universidad de Sevilla y las normativas vigentes de rango superior.</p><br /><p>Los criterios de admisi&oacute;n ser&aacute;n claros, ecu&aacute;nimes y p&uacute;blicos para el estudiante. Los criterios son de aplicaci&oacute;n general, adscribi&eacute;ndose los doctorandos a las l&iacute;neas y perfiles que la Comisi&oacute;n Acad&eacute;mica considere m&aacute;s vinculadas al m&aacute;ster realizado y/o a la memoria o proyecto de tesis.</p><br /><h4>Criterio 1. M&aacute;ster.</h4><h5>a. M&aacute;ster con admisi&oacute;n directa:</h5><p>M&aacute;steres de la Facultad de Bellas Artes de la Universidad de Sevilla, m&aacute;steres de la Universidad de Sevilla relacionados con el PD y otros m&aacute;steres relacionados valorados por la Comisi&oacute;n Acad&eacute;mica.</p><br /><p>Los siguientes m&aacute;steres de la Universidad de Sevilla ser&aacute;n valorados especialmente para cada una de las siguientes l&iacute;neas del programa de doctorado (n&uacute;mero de la l&iacute;nea entre par&eacute;ntesis):</p><br /><p><em>L&iacute;nea 1: Teor&iacute;a, an&aacute;lisis, conceptos, cr&iacute;tica y difusi&oacute;n en la creaci&oacute;n art&iacute;stica y del Patrimonio Cultural</em></p><p><em>L&iacute;nea 2: Investigaci&oacute;n experimental de los diversos lenguajes art&iacute;sticos y sus tecnolog&iacute;as aplicadas. Materiales, procedimientos y t&eacute;cnicas.</em></p><p><em>L&iacute;nea 3: Investigaci&oacute;n experimental de los diversos m&eacute;todos y t&eacute;cnicas de an&aacute;lisis, diagn&oacute;stico e intervenci&oacute;n en la conservaci&oacute;n y restauraci&oacute;n y sus tecnolog&iacute;as aplicadas.</em></p><br /><ul><li><p>M&aacute;ster Universitario en Filosof&iacute;a y Cultura Moderna (1)</p></li><li><p>M&aacute;ster Universitario en Patrimonio Art&iacute;stico Andaluz y su Proyecci&oacute;n Iberoamericana (1 y 3)</p></li><li><p>M&aacute;ster Universitario en Comunicaci&oacute;n y Cultura (1 y 2)</p></li><li><p>M&aacute;ster Universitario en Guion, Narrativa y Creatividad Audiovisual (1)</p></li><li><p>M&aacute;ster Universitario en Arquitectura y Patrimonio Hist&oacute;rico (1, 2 y 3)</p></li><li><p>M&aacute;ster Universitario en Innovaci&oacute;n en Arquitectura: Tecnolog&iacute;a y Dise&ntilde;o (1 y 2)</p></li><li><p>M&aacute;ster Universitario en Instalaciones y Dise&ntilde;o de Productos (1 y 2)</p></li><li><p>M&aacute;ster en gesti&oacute;n de la diversidad cultural, el patrimonio y el desarrollo (1, 2 y 3)</p></li><li><p>M&aacute;ster en arquitectura y patrimonio hist&oacute;rico (MARPH) (1, 2 y 3)</p></li><li><p>M&aacute;ster del Profesorado de Educaci&oacute;n Secundaria Obligatoria y Bachillerato, Formaci&oacute;n Profesional y Ense&ntilde;anzas de Idiomas (1, 2 y 3)</p></li></ul><p>M&aacute;steres de otras universidades que participan y que permitir&aacute;n el acceso al PD:</p><br /><p><strong>Universidad Polit&eacute;cnica de Valencia:</strong> M&aacute;ster Universitario en Conservaci&oacute;n y Restauraci&oacute;n de Bienes Culturales, M&aacute;ster Universitario en Gesti&oacute;n Cultural, M&aacute;ster Universitario en Conservaci&oacute;n del Patrimonio Arquitect&oacute;nico, M&aacute;ster Universitario en Artes Visuales y Multimedia, M&aacute;ster Universitario en Producci&oacute;n Art&iacute;stica.</p><br /><p><strong>Universidad Complutense. Madrid:</strong>M&aacute;ster Universitario en Conservaci&oacute;n del Patrimonio Cultural, M&aacute;ster Universitario en Estudios Avanzados de Museos y de Patrimonio Hist&oacute;rico-Art&iacute;stico, M&aacute;ster Universitario en Estudios Avanzados en Historia del Arte Espa&ntilde;ol, M&aacute;ster Universitario en Historia del Arte Contempor&aacute;neo y Cultura Visual (t&iacute;tulo conjunto de las Universidades Aut&oacute;noma de Madrid y Complutense. Coordina la Universidad Aut&oacute;noma), M&aacute;ster Universitario en Investigaci&oacute;n en Arte y Creaci&oacute;n.</p><br /><p><strong>Universidad de Ja&eacute;n:</strong> M&aacute;ster Universitario en Estudios Avanzados en Patrimonio Cultural: Historia, Arte y Territorio, M&aacute;ster Universitario en Investigaci&oacute;n en Artes, M&uacute;sica y Educaci&oacute;n Est&eacute;tica, M&aacute;ster Universitario en Turismo, Arqueolog&iacute;a y Naturaleza</p><br /><p><strong>Universidade de Vigo:</strong> M&aacute;ster en Tecnolox&iacute;as para a Protecci&oacute;n do Patrimonio Cultural Inmoble, M&aacute;ster en Direcci&oacute;n de Arte en Publicidade, M&aacute;ster en Historia, Territorio e Recursos Patrimoniais, M&aacute;ster en Arte Contempor&aacute;nea: Creaci&oacute;n e Investigaci&oacute;n, M&aacute;ster en Libro Ilustrado e Animaci&oacute;n Audiovisual.</p><br /><p><strong>Faculdade de Ciencias e Tecnolog&iacute;a. Universidade Nova de Lisboa (Portugal):</strong> Mestrado em Ci&ecirc;ncias da Conserva&ccedil;&atilde;o, Arte e Ci&ecirc;ncia do Vidro, Conserva&ccedil;&atilde;o e Restauro</p><br /><p><strong>Faculdade de Belas-Artes. Universidade de Lisboa (Portugal):</strong> Mestrados en Anatomia art&iacute;stica, Arte e Ci&ecirc;ncia do vidro, Arte multim&eacute;dia, Ci&ecirc;ncias da arte e do patrimonio, Ci&ecirc;ncias da conserva&ccedil;&atilde;o, restauro e prod. De arte contempor&acirc;nea, Desenho, Design de comunica&ccedil;&atilde;o e novos media, Design de equipamento, Educa&ccedil;&atilde;o art&iacute;stica, Escultura, estudos curatoriais, Museologia e museograf&iacute;a, Pintura, Patrim&oacute;nio p&uacute;blico, arte e museolog&iacute;a</p><br /><p>M&aacute;ster de otras universidades que imparten t&iacute;tulos similares:</p><p>M&aacute;steres afines que se ofertan en diversas <strong>universidades del Distrito &Uacute;nico de Andaluc&iacute;a</strong>: U. C&aacute;diz: Patrimonio Hist&oacute;rico-Arqueol&oacute;gico; U. C&oacute;rdoba: Gesti&oacute;n del Patrimonio desde el Municipio; U. Granada: Ciencia y Tecnolog&iacute;a en Patrimonio Arquitect&oacute;nico, Producci&oacute;n e Investigaci&oacute;n en Arte, Historia del Arte: Conocimiento y Tutela del Patrimonio Hist&oacute;rico; U. Pablo de Olavide: Arte, Museos y Gesti&oacute;n del Patrimonio Hist&oacute;rico; U. Huelva: Patrimonio Hist&oacute;rico y Natural, U. M&aacute;laga: M&aacute;ster Universitario en Desarrollos Sociales de la Cultura Art&iacute;stica.</p><br /><p>M&aacute;steres de otras universidades espa&ntilde;olas: U. de La Laguna: Creaci&oacute;n pl&aacute;stica y dise&ntilde;o ULL, UAB - Universitat Aut&ograve;noma de Barcelona: Gram&aacute;ticas del Arte Contempor&aacute;neo, UB - Universitat de Barcelona: M&aacute;ster de Creaci&oacute;n Art&iacute;stica: Realismos y Entornos y M&aacute;ster de Direcci&oacute;n de Proyectos de Conservaci&oacute;n-Restauraci&oacute;n: Colecciones y Conjuntos Patrimoniales, Universidad de Deusto-Instituto de Estudios Vascos: Arte Contempor&aacute;neo Vasco, U. Salamanca: M&aacute;ster en Evaluaci&oacute;n y Gesti&oacute;n Del Patrimonio Hist&oacute;rico Art&iacute;stico, EHU - Universidad del Pa&iacute;s Vasco: M&aacute;ster Universitario en Conservaci&oacute;n y Exhibici&oacute;n de Arte Contempor&aacute;neo, Universidad Carlos III de Madrid: M&aacute;ster en Teor&iacute;a y Cr&iacute;tica de la Cultura, Universidad de Valladolid: M&aacute;ster Universitario en Museolog&iacute;a.</p><br /><p>Tendr&aacute;n posibilidad de acceso estudiantes que hayan realizado otros m&aacute;steres con contenidos formativos similares en particular en metodolog&iacute;as de investigaci&oacute;n en el &aacute;rea, seg&uacute;n determine la Comisi&oacute;n Acad&eacute;mica.</p><br /><h5>b. M&aacute;ster con admisi&oacute;n condicionada a cursar complementos de formaci&oacute;n; m&aacute;ster de la US y de otras universidades:</h5><p>M&aacute;ster de la <strong>Universidad de Sevilla</strong>: M&aacute;ster Universitario en Arqueolog&iacute;a, M&aacute;ster Universitario en Artes del Espect&aacute;culo Vivo, M&aacute;ster Universitario en Documentos y Libros. Archivos y Bibliotecas.</p><br /><p>M&aacute;steres afines que se ofertan en diversas universidades del Distrito &Uacute;nico de Andaluc&iacute;a: U. Internacional de Andaluc&iacute;a: Patrimonio Musical; U. M&aacute;laga: Gesti&oacute;n del Patrimonio Literario y Ling&uuml;&iacute;stico Espa&ntilde;ol.</p><p>Tendr&aacute;n posibilidad de acceso estudiantes que hayan realizado otros m&aacute;steres con contenidos formativos similares en particular en metodolog&iacute;as de investigaci&oacute;n en el &aacute;rea, seg&uacute;n determine la Comisi&oacute;n Acad&eacute;mica.</p><br /><h5>c. M&aacute;ster de otros pa&iacute;ses del EEES y de fuera del EEES.</h5><p>Requisito previo: el alumnado no hispanoparlante, deber&aacute; acreditar como m&iacute;nimo el nivel B1 de castellano del Marco Com&uacute;n Europeo de Referencia para las Lenguas (MCERL) que corresponde al nivel de usuario independiente, o equivalente seg&uacute;n lo recogido en la Resoluci&oacute;n Rectoral de la Universidad de Sevilla de 22 de febrero de 2013 reguladora de los procedimientos de adquisici&oacute;n y acreditaci&oacute;n de las competencias ling&uuml;&iacute;sticas exigidas en los estudios de Grado y M&aacute;ster Universitario. Algunos estudiantes podr&iacute;an estar condicionados a cursar complementos de formaci&oacute;n seg&uacute;n determine la Comisi&oacute;n Acad&eacute;mica.</p><br /><p>A nivel internacional, se pueden destacar los siguientes:</p><p>Italia: M&aacute;ster World Heritage at Work, Universit&agrave; degli Studi di Torino &ndash; Facolt&agrave; di Scienze Politiche, Politecnico di Torino, in collaborazione con il Centro Conservazione e Restauro &ldquo;La Venaria Reale&rdquo;; UNESCO - World Heritage Centre; International Training Centre of the ILO (ITC-ILO), Torino; SiTI (Istituto Superiore sui Sistemi Territoriali per l&rsquo;Innovazione), Torino; ICCROM (International Centre for the Study of the Preservation and Restoration of Cultural Property). Promosso e sostenuto dalla Fondazione per l&rsquo;Arte della Compagnia di San Paolo. web: www.centrorestaurovenaria.it. Master Professionisti del Patrimonio Culturale, Universit&agrave; degli Studi di Torino - Facolt&agrave; di Scienze Politiche, in collaborazione con il Centro Conservazione e Restauro &ldquo;La Venaria Reale&rdquo;. Promosso e sostenuto dalla Fondazione per l&rsquo;Arte della Compagnia di San Paolo. Web www.centrorestaurovenaria.it. Master \'Cultural Projects for Development\', International Training Centre of the ILO, Torino. Doppio Master in Management dei Beni e delle Attivit&agrave; Culturali \'\'Venezia, Parigi\'\' &ndash; MaBAC, Universit&agrave; Ca\' Foscari Venezia &ndash; Venezia; Master Economia e Management dell\'Arte e dei Beni Culturali - Business School del Sole 24 Ore &ndash; Milano; Master Economia e Management dell\'Arte e dei Beni Culturali - Business School del Sole 24 Ore &ndash; Roma; Master in Formazione, Gestione e Conservazione di Archivi Digitali in Ambito Pubblico e Privato, Universit&agrave; degli Studi di Macerata; Master in Gestione delle Imprese Turistiche - Tourism Management (V edizione Campania-Napoli) C&amp;G Group &ndash; Napoli; Master in Management delle Risorse Artistiche e Culturali &ndash; MaRAC IULM - Libera Universit&agrave; di Lingue e Comunicazione &ndash; Roma; Master in Manager dell\'Arte &ndash; Firenze, IED - Istituto Europeo di Design &ndash; Firenze; Master in Manager dell\'Arte &ndash; Roma IED - Istituto Europeo di Design &ndash; Roma; Master in Restauro, IED - Istituto Europeo di Design &ndash; Venezia; Master in Tutela e Valorizzazione del Patrimonio Culturale Italiano all\'Estero, Universit&agrave; degli Studi di Parma &ndash; Pisa; Master in World Natural Heritage Management - Master per la Gestione dei Beni Naturali Iscritti nella Lista del Patrimonio Mondiale dell\'Umanit&agrave; step - Scuola per il Governo del Territorio e del Paesaggio - Trento. web: http://zope0.itcilo.org/masters/cultural</p><p>En Latinoam&eacute;rica: Master en Evaluaci&oacute;n y Gesti&oacute;n del Patrimonio Hist&oacute;rico Art&iacute;stico, USAL - Facultad de Geograf&iacute;a e Historia (Ciudad De M&eacute;xico)</p><br /><p>Tendr&aacute;n posibilidad de acceso estudiantes que hayan realizado otros m&aacute;steres con contenidos formativos similares en particular en metodolog&iacute;as de investigaci&oacute;n en el &aacute;rea, seg&uacute;n determine la Comisi&oacute;n Acad&eacute;mica.</p><br /><p>Para aquellos m&aacute;steres no incluidos en los apartados anteriores, la Comisi&oacute;n Acad&eacute;mica har&aacute; una valoraci&oacute;n de la formaci&oacute;n adquirida por el estudiante en dicho m&aacute;ster para ser admitido al programa, estableci&eacute;ndose tambi&eacute;n complementos de formaci&oacute;n si fuese preciso.</p><br /><h4>Criterio 2. Baremo de ponderaci&oacute;n.</h4><p>En el caso de que el n&uacute;mero de candidatos sea mayor al de plazas disponibles, se tendr&aacute; en cuenta el baremo de ponderaci&oacute;n cuyos criterios se especifican y se enumeran por orden de prioridad a continuaci&oacute;n. La valoraci&oacute;n se realizar&aacute; por la Comisi&oacute;n Acad&eacute;mica siempre considerando que no representar&aacute; m&aacute;s de los porcentajes determinados para la valoraci&oacute;n final del candidato.&acute;</p><br /><h4>Baremo de ponderaci&oacute;n</h4><ul><li><p>M&aacute;steres de la Facultad de Bellas Artes de la Universidad de Sevilla 25%</p></li><li><p>Nota media y curr&iacute;culum acad&eacute;mico 20%</p></li><li><p>M&aacute;ster de la Universidad de Sevilla relacionados con el PD 15%</p></li><li><p>Otros M&aacute;ster relacionados 10%</p></li><li><p>Vinculaci&oacute;n o adecuaci&oacute;n de su l&iacute;nea curricular 10%</p></li><li><p>Memoria o proyecto de tesis 10%</p></li><li><p>Curr&iacute;culum vitae y profesional 5%</p></li><li><p>Carta de aceptaci&oacute;n 5%</p></li></ul><br /><p>En base a los documentos presentados se tendr&aacute;n en cuenta de forma expresa la formaci&oacute;n previa del solicitante, en especial, las competencias adquiridas en el periodo de formaci&oacute;n de posgrado. Se evaluar&aacute; adem&aacute;s en el apartado curr&iacute;culum: el nivel de conocimiento de idiomas acreditados, la experiencia profesional, las aportaciones o publicaciones acreditadas.</p><p>La carta/s de aceptaci&oacute;n podr&aacute; incluir las de referencia de profesores e investigadores especialistas en la materia que avalen su solicitud, los intereses investigadores declarados por el solicitante y la viabilidad e inter&eacute;s cient&iacute;fico del proyecto de tesis presentado. Se podr&aacute; requerir la realizaci&oacute;n de una entrevista personal.</p><br /><p>Si hubiera m&aacute;s demanda que plazas ofertadas, dicha Comisi&oacute;n Acad&eacute;mica publicar&aacute; un listado enumerado de los candidatos en funci&oacute;n de la valoraci&oacute;n de los documentos presentados y la idoneidad del perfil de ingreso.</p><br /><p>La admisi&oacute;n en caso de tener m&aacute;s solicitudes que plazas ofertadas, de conflicto num&eacute;rico o en casos de discrepancia con el doctorando, se resolver&aacute; teniendo en cuenta el acceso preferente y directo al programa los estudiantes procedentes del M&aacute;ster en Arte: Idea y Producci&oacute;n y aquellos que procedan de otros t&iacute;tulos de m&aacute;ster que se pudieran implantar en la Facultad de Bellas Artes de Sevilla, en segundo lugar de M&aacute;steres de la Universidad de Sevilla y en tercer lugar del Distrito &Uacute;nico de Andaluc&iacute;a frente al resto de candidatos.</p><br /><p>Respecto a los estudios de Grado previo, tambi&eacute;n ser&aacute;n preferentes en caso de empate o discrepancia los alumnos que hayan desarrollado sus estudios en la Facultad de Bellas Artes de Sevilla, en segundo lugar en otras facultades de Bellas Artes de Andaluc&iacute;a y en tercer lugar en otras del Distrito &Uacute;nico de Andaluc&iacute;a frente al resto de candidatos.</p><br /><p>Tendr&aacute;n acceso al Programa de Doctorado otro alumnado que cumpla con los requisitos de acceso que recoge la Normativa de la Universidad de Sevilla (Acuerdo 7.2/CG 17-6-11, por el que se aplica el RD 99/2011), seg&uacute;n el orden de prioridad siguiente:</p><br /><ul><li><p>Alumnado procedente de anteriores programas de doctorado de los Departamentos de la Facultad de Bellas Artes de Sevilla.</p></li><li><p>Alumnado que proceda de instituciones colaboradoras con este Programa de Doctorado, tanto nacionales como internacionales.</p></li><li><p>Alumnado procedente de t&iacute;tulos superiores de Bellas Artes y/o Conservaci&oacute;n y Restauraci&oacute;n de Bienes Culturales que hayan cursado un m&aacute;ster oficial.</p></li><li><p>Alumnado procedente de anteriores programas de doctorado de otras titulaciones de la Rama de Humanidades de la Universidad de Sevilla, del Distrito &Uacute;nico de Andaluc&iacute;a y finalmente de otras instituciones superiores nacionales o internacionales.</p></li><li><p>Alumnado procedente de otras titulaciones de la Rama de Humanidades con un m&aacute;ster oficial en arte y/o patrimonio.</p></li></ul><p>Otro alumnado cuya propuesta de investigaci&oacute;n sea evaluada adecuada por la Comisi&oacute;n Acad&eacute;mica para su acceso al presente Programa de Doctorado</p><br /> <br /><h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3><p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p><ul><li><p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</p></li><li><p>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito</p></li><li><p>Memoria o proyecto de tesis.</p></li><li><p>Carta de aceptaci&oacute;n.</p></li></ul><br /><h3>Complementos de Formaci&oacute;n</h3><p>La Comisi&oacute;n Acad&eacute;mica del programa, estudiar&aacute; el curr&iacute;culum del doctorando y teniendo en cuenta el perfil de ingreso, decidir&aacute; acerca de la pertinencia de que realice complementos de formaci&oacute;n para el adecuado desarrollo de su labor investigadora. En caso que se considere que el alumno debe realizar complementos de formaci&oacute;n, la Comisi&oacute;n Acad&eacute;mica materializar&aacute; para cada doctorando un documento de actividades personalizado a efectos de registro individual, de seguimiento y control; en dicho documento se indicar&aacute;n todas las actividades formativas de inter&eacute;s para el desarrollo del doctorando y ser&aacute; regularmente revisado por el tutor y/o el director de tesis y evaluado por la Comisi&oacute;n Acad&eacute;mica.</p><br /><p>Estos complementos, por un m&aacute;ximo de 18 cr&eacute;ditos ECTS de investigaci&oacute;n (excepcionalmente 24 ECTS), estar&aacute;n vinculados a determinadas materias asociadas a <strong>m&aacute;steres universitarios oficiales de la Universidad de Sevilla.</strong></p><br />','{\r\n	\"administrativo\": {\r\n		\"contactos\": [{\r\n			\"direccion\": \"Secretaría de la Facultad (calle Laraña, 3, Primera Planta)\",\r\n			\"telefono\": \"\",\r\n			\"nombre\": \"\",\r\n			\"email\": \"\"\r\n		}]\r\n	},\r\n\r\n	\"academico\": {\r\n		\"contactos\": [{\r\n			\"direccion\": \"\",\r\n			\"telefono\": \"954488192\",\r\n			\"nombre\": \"Juan Francisco Cárceles Pascual\",\r\n			\"email\": \"arteypatrimonio@us.es\"\r\n		}]\r\n	}\r\n}'),(3,'2014-04-09 09:17:53','3003','secre_biointegrada@us.es','http://institucional.us.es/bioint/','Biología Integrada','2011','BIOLOGÍA Y BIOQUÍMICA','CIENCIAS DEL MEDIO AMBIENTE','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Se establecen tres perfiles de acceso al programa:</p>\r\n<ol>\r\n<li>\r\n<p>Estudiantes que cumplan los requisitos establecidos en el RD 99/2011, de 28 de enero con m&aacute;steres oficiales sobre &ldquo;Biolog&iacute;a&rdquo; o afines (&ldquo;Ciencias Ambientales&rdquo;, &ldquo;Medicina&rdquo;, &ldquo;Farmacia&rdquo;, &ldquo;Medio Ambiente&rdquo;, &ldquo;Veterinaria&rdquo;, &ldquo;Biotecnolog&iacute;a&rdquo;, &ldquo;Ingenier&iacute;a Agron&oacute;mica&rdquo;, &ldquo;Ingenier&iacute;a Forestal&rdquo;, &ldquo;Psicolog&iacute;a&rdquo;) en cualquier Universidad del EEES.</p>\r\n</li>\r\n<li>\r\n<p>Estudiantes que hayan terminado m&aacute;steres reconocidos oficialmente en pa&iacute;ses de la OCDE (http://www.oecd.org/about/membersandpartners/), pero sin sistema de cr&eacute;ditos equivalente al EEES. Previa consulta de la documentaci&oacute;n aportada, podr&aacute;n recibir unos complementos de formaci&oacute;n espec&iacute;ficos, para cubrir las posibles deficiencias encontradas.</p>\r\n</li>\r\n<li>\r\n<p>Estudiantes que hayan terminado m&aacute;steres en otros pa&iacute;ses no mencionados anteriormente (puntos 1 y 2), o que hayan cursado m&aacute;steres oficiales en el EEES o pa&iacute;ses de la OCDE en disciplinas no mencionadas en el punto 1.</p>\r\n</li>\r\n</ol><br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h5>Criterios de selecci&oacute;n de candidatos</h5>\r\n<p>La selecci&oacute;n de los candidatos se realizar&aacute; por la Comisi&oacute;n Acad&eacute;mica, con asesoramiento de las comisiones de seguimiento de las &aacute;reas establecidas, teniendo en cuenta los siguientes elementos por orden de importancia decreciente:</p>\r\n<br /><ol>\r\n<li>\r\n<p>Historial acad&eacute;mico contrastable mediante certificados oficiales</p>\r\n</li>\r\n<li>\r\n<p>Capacidad investigadora acreditada mediante publicaciones y participaciones en proyectos.</p>\r\n</li>\r\n<li>\r\n<p>Nivel de conocimiento de idiomas.</p>\r\n</li>\r\n<li>\r\n<p>Cartas de presentaci&oacute;n por cient&iacute;ficos acreditados.</p>\r\n</li>\r\n</ol><br />\r\n<p>Dado que en los &uacute;ltimos a&ntilde;os han ido desapareciendo muchos programas de doctorado sujetos a normativas anteriores, existe un n&uacute;mero elevado de doctorandos que no est&aacute;n inscritos en programa alguno o que est&aacute;n en programas que no son los m&aacute;s adecuados de acuerdo con sus tem&aacute;ticas de proyecto de Tesis Doctoral. Por ello, durante el primer a&ntilde;o se habilitar&aacute; un procedimiento especial de admisi&oacute;n para los estudiantes que acrediten documentalmente tal situaci&oacute;n, por ejemplo mediante credencial de becario pre-doctoral y que, a juicio de la Comisi&oacute;n Acad&eacute;mica, hayan realizado actividades que sean equiparables, sin ser necesariamente id&eacute;nticas, a las actividades formativas que se piden para los estudiantes futuros. Para ello no ser&aacute; necesario esperar a la convocatoria anual de incorporaci&oacute;n al Programa de Doctorado que se realice cada a&ntilde;o, sino que este informe se emitir&aacute; seg&uacute;n se reciban tales solicitudes. Todo ello sin menoscabo de los plazos de solicitud de ingreso que establezca el Vicerrectorado de Investigaci&oacute;n, per&iacute;odo en el que se formaliza la inscripci&oacute;n.</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>\r\n<p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</p>\r\n</li>\r\n<li>\r\n<p>Propuesta de proyecto:</p>\r\n<ul>\r\n<li>\r\n<p>T&iacute;tulo del proyecto de tesis</p>\r\n</li>\r\n<li>\r\n<p>L&iacute;nea de investigaci&oacute;n a la que se adscribe el doctorando.</p>\r\n</li>\r\n<li>\r\n<p>Breve descripci&oacute;n del proyecto (m&aacute;x. 500 palabras).</p>\r\n</li>\r\n<li>\r\n<p>Valoraci&oacute;n y aval del director y/o tutor que se propone sobre el proyecto.</p>\r\n</li>\r\n<li>\r\n<p>Carta de presentaci&oacute;n del estudiante por cient&iacute;ficos acreditados (puede servir el aval del Director o Tutor o la carta de cualquier otro investigador que haya tenido relaci&oacute;n profesional con el solicitante)</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>La Comisi&oacute;n Acad&eacute;mica, asesorada por las Comisiones de Seguimiento, formular&aacute; para cada candidato la necesidad de complementos de formaci&oacute;n en funci&oacute;n de su perfil de ingreso:</p>\r\n<ul>\r\n<li>\r\n<p>Perfil 1: Estos alumnos no necesitar&aacute;n complementos de formaci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<p>Perfil 2: Previa consulta de la documentaci&oacute;n aportada, podr&aacute;n recibir unos complementos de formaci&oacute;n espec&iacute;ficos, para cubrir las posibles deficiencias encontradas. Estos complementos ser&aacute;n espec&iacute;ficamente asignaturas troncales u obligatorias (hasta un m&aacute;ximo de 18 ECTS) de los m&aacute;steres oficiales de la Universidad de Sevilla relacionados con la Biolog&iacute;a que en ese momento se oferten.</p>\r\n</li>\r\n<li>\r\n<p>Perfil 3: Deber&aacute;n realizar 18 ECTS (en casos excepcionales hasta 24 ECTS) de la parte troncal u obligatoria de un m&aacute;ster oficial de la Universidad de Sevilla, relacionado con la Biolog&iacute;a, de entre los ofertados en ese momento</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>Estos complementos estar&aacute;n vinculados a determinadas asignaturas de cualquiera de los m&aacute;steres relacionados con las distintas &aacute;reas de cient&iacute;ficas (Ciencias y Ciencias de la Salud) y tecnol&oacute;gicas disponibles, o en el cat&aacute;logo de los m&aacute;steres ofertados en el contexto de la Universidad de Sevilla cada curso acad&eacute;mico.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaria del Dpto. de Biología Vegetal y Ecología (Área Botánica), 2º planta, Fac. Biología\",\"telefono\":\"\",\"nombre\":\"Rosa Cabrera\",\"email\":\"secre_biointegrada@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Juan Arroyo Marín\",\"email\":\"doct_biologia_integrada@us.es\"}\r\n	]}}'),(4,'2014-04-09 09:18:55','3004','doctoradobmb@us.es','http://institucional.us.es/bmbic/index.html','Biología Molecular, Biomedicina e Investigación Clínica','2011','BIOLOGÍA Y BIOQUÍMICA','MEDICINA','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El perfil del estudiante de doctorado tiene que tener la capacidad de adecuarse en sus conocimientos a las l&iacute;neas de investigaci&oacute;n del programa por lo que deber&aacute;n tener posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol o de otro pa&iacute;s integrante del EEES, que habilite para el acceso a M&aacute;ster y haber superado un m&iacute;nimo de 300 cr&eacute;ditos ECTS en el conjunto de estudios Universitarios Oficiales.</p>\r\n<br />\r\n<p>En este apartado y de forma espec&iacute;fica tenemos entre otros los siguientes:</p>\r\n<ul>\r\n<li>\r\n<p>Grados: Biolog&iacute;a, Ciencias Ambientales, Biotecnolog&iacute;a, Bioqu&iacute;mica, Biomedicina, Fisioterapia, Enfermer&iacute;a, Tecnolog&iacute;a del Alimento, Psicolog&iacute;a, Qu&iacute;mica, F&iacute;sica, y dem&aacute;s grados afines</p>\r\n</li>\r\n<li>\r\n<p>Alumnos en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Grado, que sea de al menos 300 ECTS (Grados de Medicina, Farmacia, Veterinario, Odontolog&iacute;a y grados afines).</p>\r\n</li>\r\n<li>\r\n<p>Titulados universitarios que, previamente han obtenido una plaza de formaci&oacute;n sanitaria especializada o que hayan superado con evaluaci&oacute;n positiva al menos dos a&ntilde;os de formaci&oacute;n para la obtenci&oacute;n del t&iacute;tulo oficial de alguna de las especialidades de Ciencia de la Salud.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros que faculta para el acceso a estudios de doctorado.</p>\r\n</li>\r\n<li>\r\n<p>Se admitir&aacute;n aquellos alumnos cuyos estudios est&eacute;n directamente relacionados o sean afines a las l&iacute;neas de investigaci&oacute;n del Programa de Doctorado.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>Todos los alumnos deben de dominar el castellano y ser eficientes en otra lengua, como m&iacute;nimo el ingl&eacute;s, capaces al menos de leer y escribir art&iacute;culos cient&iacute;ficos.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h5>A) Para acceder al programa de doctorado regulado por el R.D. 99/2011 ser&aacute; necesario, con car&aacute;cter general:</h5>\r\n<ol>\r\n<li>\r\n<p>Estar en posesi&oacute;n de los t&iacute;tulos oficiales espa&ntilde;oles de Grado, o equivalente, y de M&aacute;ster Universitario. Tambi&eacute;n podr&aacute;n acceder a un programa de doctorado quienes se encuentren en alguno de los siguientes supuestos</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo universitario oficial que habilite para el acceso a M&aacute;ster y haber superado un m&iacute;nimo de 300 cr&eacute;ditos ECTS, de los que al menos 60 deben de ser de nivel de M&aacute;ster. M&aacute;s informaci&oacute;n: Resoluci&oacute;n rectoral por la que se establecen equivalencias de cr&eacute;ditos y valoraci&oacute;n de nivel de m&aacute;ster</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Graduado/a, de al menos 300 ECTS y cursar complementos de formaci&oacute;n, salvo que el plan de estudios cursado incluyera cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n equivalentes a los de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Los titulados universitarios que, previa obtenci&oacute;n de plaza en formaci&oacute;n sanitaria especializada, hayan superado con evaluaci&oacute;n positiva al menos dos a&ntilde;os de formaci&oacute;n en el programa.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologaci&oacute;n, previa comprobaci&oacute;n por la universidad de que &eacute;ste acredita un nivel de formaci&oacute;n equivalente a la del t&iacute;tulo oficial espa&ntilde;ol de M&aacute;ster Universitario y que faculta en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a estudios de doctorado. Esta admisi&oacute;n no implicar&aacute; la homologaci&oacute;n del t&iacute;tulo previo ni su reconocimiento a otros efectos.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor.</p>\r\n</li>\r\n<li>\r\n<p>Ser estudiante de doctorado conforme a anteriores ordenaciones universitarias previa admisi&oacute;n de la universidad correspondiente, de acuerdo con lo establecido en el RD 99/2011 y en la normativa de la propia universidad.</p>\r\n</li>\r\n<li>\r\n<p>Licenciados, Arquitectos o Ingenieros que estuvieran en posesi&oacute;n del Diploma de Estudios Avanzados obtenido de acuerdo con lo dispuesto en el R.D. 778/1998 o hubieran alcanzado la suficiencia investigadora regulada en el R.D. 185/1985.</p>\r\n</li>\r\n</ol>\r\n<h5>B) La admisi&oacute;n al Programa de Doctorado a trav&eacute;s de la Comisi&oacute;n Acad&eacute;mica establece los siguientes requisitos y criterios adicionales para la selecci&oacute;n y admisi&oacute;n de los estudiantes:</h5>\r\n<ol>\r\n<li>\r\n<p>Los propios de la normativa de la Universidad de Sevilla, apartado A.</p>\r\n</li>\r\n<li>\r\n<p>Los propios para los estudiantes con necesidades educativas especiales se relacionan en el apartado espec&iacute;fico de la normativa de la Universidad de Sevilla. (Apartado 1.2.)</p>\r\n</li>\r\n<li>\r\n<p>Que los t&iacute;tulos que dan acceso a los estudios del Programa de Doctorado est&eacute;n directamente relacionados con las l&iacute;neas de investigaci&oacute;n que se proponen, t&eacute;rmino que ser&aacute; demostrado por la formaci&oacute;n adquirida por el alumno en el Grado correspondiente y en el Master que haya realizado.La comisi&oacute;n valorara positivamente todos los estudios adicionales que pudiese poseer el alumno.</p>\r\n</li>\r\n<li>\r\n<p>Tendr&aacute;n acceso directo los alumnos que hayan realizado cualquier de los Masteres Universitarios de la Universidad de Sevilla espec&iacute;ficos reconocidos por el Programa de Doctorado, tales como</p>\r\n<ol type=\"i\">\r\n<li>\r\n<p>Gen&eacute;tica Molecular y Biotecnolog&iacute;a,</p>\r\n</li>\r\n<li>\r\n<p>Fisiolog&iacute;a y Neurociencia,</p>\r\n</li>\r\n<li>\r\n<p>Investigaci&oacute;n Biom&eacute;dica y</p>\r\n</li>\r\n<li>\r\n<p>Investigaci&oacute;n M&eacute;dica: cl&iacute;nica y experimental</p>\r\n</li>\r\n</ol></li>\r\n<li>\r\n<p>Tendr&aacute;n acceso directo las los alumnos del apartado A2 de acceso, siempre y cuando cumplan el requisito de adecuaci&oacute;n a la l&iacute;nea de investigaci&oacute;n adecuada en el programa de Doctorado.</p>\r\n</li>\r\n<li>\r\n<p>En el resto de los Master que legalmente den acceso se estudiar&aacute; por la Comisi&oacute;n Acad&eacute;mica la adecuaci&oacute;n del alumno al Programa y podr&aacute; rechazar o admitir con necesidad de formaci&oacute;n complementaria que sea necesaria.</p>\r\n</li>\r\n<li>\r\n<p>Se requiere un conocimiento m&iacute;nimo en el idioma cient&iacute;fico Ingl&eacute;s que ser&aacute; evaluado por la Comisi&oacute;n Acad&eacute;mica.</p>\r\n</li>\r\n<li>\r\n<p>Al momento de solicitar la admisi&oacute;n, el estudiante deber&aacute; presentar un escrito firmado por el Director, un tutor acad&eacute;mico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigaci&oacute;n. En dicho escrito se describir&aacute; la existencia de los medios materiales y financiaci&oacute;n necesarios para la realizaci&oacute;n del trabajo.</p>\r\n</li>\r\n<li>\r\n<p>Criterios de valoraci&oacute;n cuando se supere el n&uacute;mero de plazas ofertadas y se deba realizar una selecci&oacute;n:</p>\r\n<ol type=\"i\">\r\n<li>\r\n<p>Expediente acad&eacute;mico ponderado (Grado + Master) equivalente a un 35% del total.</p>\r\n</li>\r\n<li>\r\n<p>Estancias internacionales de al menos tres meses o superior durante el periodo de realizaci&oacute;n del Grado o el Master equivalente a un 15% del total.</p>\r\n</li>\r\n<li>\r\n<p>Curriculum vitae. Equivalente a un 25% del total.</p>\r\n</li>\r\n<li>\r\n<p>Documento de motivaci&oacute;n y, en caso de ser necesario, entrevista personal por la Comisi&oacute;n Acad&eacute;mica equivalente al 25%.</p>\r\n</li>\r\n</ol></li>\r\n<li>\r\n<p>Los alumnos que est&eacute;n en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Grado, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 cr&eacute;ditos ECTS y los titulados universitarios que, previamente han obtenido una plaza de formaci&oacute;n sanitaria especializada o que hayan superado con evaluaci&oacute;n positiva al menos dos a&ntilde;os de formaci&oacute;n de un programa ,para la obtenci&oacute;n del t&iacute;tulo oficial de alguna de las especialidades de Ciencia de la Salud, deber&aacute;n realizar complementos de formaci&oacute;n espec&iacute;fica y la Comisi&oacute;n Acad&eacute;mica especificar&aacute; en cada caso la necesidad de cursarlos.</p>\r\n</li>\r\n</ol><br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato, estancias, idiomas, etc.</p>\r\n</li>\r\n<li>\r\n<p>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</p>\r\n</li>\r\n<li>\r\n<p>Al momento de solicitar la admisi&oacute;n, el estudiante deber&aacute; presentar un escrito firmado por el Director, un tutor acad&eacute;mico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigaci&oacute;n. En dicho escrito se describir&aacute; la existencia de los medios materiales y financiaci&oacute;n necesarios para la realizaci&oacute;n del trabajo.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p><strong>Nota:</strong><span style=\"text-decoration: underline;\">El/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deber&aacute;n incorporar expresamente la nota media num&eacute;rica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).</span></p>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>De acuerdo con lo establecido en art. 6.2.b del Real Decreto 99/2011 del 28 de Enero se exigir&aacute;n los complementos de formaci&oacute;n con car&aacute;cter obligatorio en el siguiente caso:</p>\r\n<br />\r\n<p>1) Para los alumnos que est&eacute;n en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Grado, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 cr&eacute;ditos ECTS. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio complementos de formaci&oacute;n, salvo que el plan de estudios del correspondiente t&iacute;tulo de grado incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudio de Master.</p>\r\n<br />\r\n<p>Por lo tanto, los alumnos procedentes de Grados de Medicina, Farmacia, Veterinario, Odontolog&iacute;a y grados afines.</p>\r\n<br />\r\n<p>No obstante, se podr&aacute;n asignar complementos de formaci&oacute;n siempre y cuando la titulaci&oacute;n previa no incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudio de Master en los siguientes casos:</p>\r\n<br />\r\n<p>2) Para los que est&eacute;n en posesi&oacute;n de un t&iacute;tulo universitarios oficial que habilite para el acceso a M&aacute;ster y hayan superado un m&iacute;nimo de 300 ECTS, de los que al menos 60 ECTS deben ser de nivel de m&aacute;ster (Acceso a trav&eacute;s de Resoluci&oacute;n Rectoral por la que se establecen equivalencias de cr&eacute;ditos y valoraci&oacute;n de nivel de m&aacute;ster).</p>\r\n<br />\r\n<p>3) Para los titulados universitarios que previamente han obtenido una plaza de formaci&oacute;n sanitaria especializada o que hayan superado con evaluaci&oacute;n positiva al menos dos a&ntilde;os de formaci&oacute;n de un programa para la obtenci&oacute;n del t&iacute;tulo oficial de alguna de las especialidades de Ciencia de la Salud y que no acrediten experiencia investigadora equivalente a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudio de Master.</p>\r\n<br />\r\n<p>4) En aquellos perfiles de Grado con M&aacute;ster Universitario de acceso no directo que sean afines al &aacute;rea de conocimiento del programa (240 + 60 cr&eacute;ditos ECTS). Teniendo en cuenta que el programa de Doctorado est&aacute; respaldado por cuatro Masteres oficiales de la Universidad de Sevilla, consideramos que el complemento de Formaci&oacute;n puede asociarse a la docencia impartida en cada uno de ellos, en base al perfil del estudiante. El complemento de formaci&oacute;n no exceder&aacute; los 18 cr&eacute;ditos ECTS.</p>\r\n<br />\r\n<p>Los complementos formativos deber&aacute;n realizarse y aprobarse en el primer curso acad&eacute;mico de la tutela de doctorado, conforme a lo dispuesto en la normativa propia de estudios de doctorado de la Universidad de Sevilla y dem&aacute;s normas que sean de aplicaci&oacute;n.</p>\r\n<br />\r\n<p>Este requisito de complementos de formaci&oacute;n ser&aacute;n aplicados tanto a alumnos con dedicaci&oacute;n a tiempo completo como los alumnos con dedicaci&oacute;n a tiempo parcial en igualdad de condiciones.</p>','{\"administrativo\": {\"contactos\":[ {\"direccion\":\"Servicio de Doctorado. Pabellón de México. Paseo de las Delicilas, esquina Avda. Eritaña, 41013 - Sevilla\",\"telefono\":\"954.487.392\",\"nombre\":\"\",\"email\":\"doctoradobmb@us.es\"} ]}, \"academico\":{\"contactos\":[ {\"direccion\":\"\",\"telefono\":\"954.550.149\",\"nombre\":\"Ángel Pastor\",\"email\":\"doctoradobmb@us.es\"} ]}}'),(5,'2014-04-09 09:19:12','3007','doctorado_cytnm@us.es','http://ctnm.us.es/','Ciencia y Tecnología de Nuevos Materiales','2011','CIENCIAS FÍSICAS, QUÍMICAS, GEOLÓGICAS','AINGENIERÍA Y PROFESIONES AFINES','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Alumnos que han cursado el M&aacute;ster en \"Ciencia y Tecnolog&iacute;a de Nuevos Materiales\" u otro t&iacute;tulo de M&aacute;ster con una formaci&oacute;n equivalente o af&iacute;n a la l&iacute;nea de investigaci&oacute;n en la que se realizar&aacute; la tesis doctoral. Estar en posesi&oacute;n del nivel B1 o superior de lengua inglesa.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Cualquiera de las posibles v&iacute;as de acceso y admisi&oacute;n al Programa de Doctorado establecidas en la normativa vigente, establecidos en el RD99/2011, ser&aacute; de aplicaci&oacute;n.</p>\r\n<br />\r\n<p>Se incluyen, de modo espec&iacute;fico, el t&iacute;tulo de M&aacute;ster Universitario en Ciencia y Tecnolog&iacute;a de Nuevos Materiales de la Universidad de Sevilla, o cualquier otro T&iacute;tulo Oficial de M&aacute;ster impartido en la Universidad de Sevilla o la Universidad de Extremadura que tenga por objeto algunos de los sujetos de la Ciencia y Tecnolog&iacute;a de Materiales (materiales met&aacute;licos, cer&aacute;micos, polim&eacute;ricos y/o funcionales) u otro del mismo nivel expedido por una instituci&oacute;n de educaci&oacute;n superior del EEES o t&iacute;tulos obtenidos conforme a sistemas educativos ajenos al EEES.</p>\r\n<br /><ol>\r\n<li>\r\n<p>Con car&aacute;cter general, para el acceso a un programa oficial de doctorado ser&aacute; necesario estar en posesi&oacute;n de los t&iacute;tulos oficiales espa&ntilde;oles de Grado, o equivalente, y de M&aacute;ster Universitario.</p>\r\n</li>\r\n<li>\r\n<p>Asimismo podr&aacute;n acceder quienes se encuentren en alguno de los siguientes supuestos:</p>\r\n<ol type=\"a\">\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol, o de otro pa&iacute;s integrante del Espacio Europeo de Educaci&oacute;n Superior, que habilite para el acceso a M&aacute;ster de acuerdo con lo establecido en el art&iacute;culo 16 del Real Decreto 1393/2007, de 29 de octubre y haber superado un m&iacute;nimo de 300 cr&eacute;ditos ECTS en el conjunto de estudios universitarios oficiales, de los que, al menos 60, habr&aacute;n de ser de nivel de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Graduado o Graduada, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 cr&eacute;ditos ECTS. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n a que se refiere el art&iacute;culo 7.2 de esta norma, salvo que el plan de estudios del correspondiente t&iacute;tulo de grado incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudios de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologaci&oacute;n, previa comprobaci&oacute;n por la universidad de que &eacute;ste acredita un nivel de formaci&oacute;n equivalente a la del t&iacute;tulo oficial espa&ntilde;ol de M&aacute;ster Universitario y que faculta en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a estudios de doctorado. Esta admisi&oacute;n no implicar&aacute;, en ning&uacute;n caso, la homologaci&oacute;n del t&iacute;tulo previo del que est&eacute; en posesi&oacute;n el interesado ni su reconocimiento a otros efectos que el del acceso a ense&ntilde;anzas de Doctorado</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor obtenido conforme a anteriores ordenaciones universitarias.</p>\r\n</li>\r\n</ol></li>\r\n</ol>\r\n<h4>Criterios de admisi&oacute;n</h4>\r\n<p>Se establecen los siguientes perfiles de ingreso al Doctorado en Ciencia y Tecnolog&iacute;a de Nuevos Materiales por la Universidad de Sevilla:</p>\r\n<ol>\r\n<li>\r\n<p>Estar en posesi&oacute;n del t&iacute;tulo de M&aacute;ster en \"Ciencia y Tecnolog&iacute;a de Nuevos Materiales\" por la Universidad de Sevilla.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo de M&aacute;ster del EEES, o de otros sistemas universitarios que den acceso a la formaci&oacute;n doctoral en el pa&iacute;s de origen, con una formaci&oacute;n equivalente al M&aacute;ster en \"Ciencia y Tecnolog&iacute;a de Nuevos Materiales\" por la Universidad de Sevilla.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo en &aacute;reas afines que de acceso al programa de doctorado, que incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n o equivalente y haber realizado un trabajo fin de m&aacute;ster, grado o equivalente con orientaci&oacute;n investigadora.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo en &aacute;reas afines que de acceso al programa de doctorado que no est&eacute; contemplado en el punto 3. La comisi&oacute;n acad&eacute;mica del programa de doctorado ser&aacute; la encargada de establecer los t&iacute;tulos que se consideran dentro de los apartados 2, 3 y 4</p>\r\n</li>\r\n</ol>\r\n<p>Se recomienda el siguiente <strong>perfil de ingreso</strong>:</p>\r\n<p>Alumnos que han cursado el M&aacute;ster en \"Ciencia y Tecnolog&iacute;a de Nuevos Materiales\" u otro t&iacute;tulo de M&aacute;ster con una formaci&oacute;n equivalente o af&iacute;n a la l&iacute;nea de investigaci&oacute;n en la que se realizar&aacute; la tesis doctoral.</p>\r\n<br />\r\n<p>No se establece la realizaci&oacute;n de pruebas de acceso espec&iacute;ficas. En el caso de que el n&uacute;mero de solicitantes supere al de plazas ofertadas, la comisi&oacute;n acad&eacute;mica del programa de doctorado utilizar&aacute; los siguientes criterios para la selecci&oacute;n:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>Criterio 1: Adecuaci&oacute;n del t&iacute;tulo de acceso al programa de doctorado, de acuerdo a los perfiles de ingreso establecidos</p>\r\n</li>\r\n<li>\r\n<p>Criterio 2: Expediente acad&eacute;mico global del t&iacute;tulo que de acceso al programa de doctorado</p>\r\n</li>\r\n<li>\r\n<p>Criterio 3: Experiencia profesional e investigadora</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>El baremo utilizado en el proceso de admisi&oacute;n estar&aacute; publicado en la p&aacute;gina web del programa. En caso de rechazo de la admisi&oacute;n, &eacute;ste ser&aacute; motivado y la comisi&oacute;n acad&eacute;mica enviar&aacute; a la persona afectada un informe escrito justificando su decisi&oacute;n.</p>\r\n<br />\r\n<p>Para los perfiles de ingreso 3 y 4 la comisi&oacute;n acad&eacute;mica podr&aacute; exigir la realizaci&oacute;n de complementos de formaci&oacute;n espec&iacute;ficos para la admisi&oacute;n al programa.</p>\r\n<h4>Baremo de ponderaci&oacute;n</h4>\r\n<ul>\r\n<li>\r\n<p>Criterio 1: 40%</p>\r\n</li>\r\n<li>\r\n<p>Criterio 2: 35%</p>\r\n</li>\r\n<li>\r\n<p>Criterio 3: 25%</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>\r\n<p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</p>\r\n</li>\r\n<li>\r\n<p>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</p>\r\n</li>\r\n<li>\r\n<p>Escrito explicativo que contenga:</p>\r\n<ul>\r\n<li>\r\n<p>T&iacute;tulo del proyecto de tesis y l&iacute;nea de investigaci&oacute;n en la que se integra.</p>\r\n</li>\r\n<li>\r\n<p>Breve descripci&oacute;n del proyecto a desarrollar.</p>\r\n</li>\r\n<li>\r\n<p>Aceptaci&oacute;n por parte del director propuesto, que informar&aacute; y avalar&aacute; el proyecto presentado.</p>\r\n</li>\r\n<li>\r\n<p>Propuesta de tutor, en su caso, con el visto bueno del mismo y del director.</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Seg&uacute;n los perfiles de ingreso se establecen los siguientes complementos de formaci&oacute;n:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>Los estudiantes con perfiles de ingreso 1 y 2 acceden directamente al programa sin complementos de formaci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<p>Para aquellos estudiantes con perfil de ingreso 3, la comisi&oacute;n acad&eacute;mica del programa analizar&aacute; la formaci&oacute;n previa del alumno y establecer&aacute; si es necesario que realice complementos de formaci&oacute;n, que consistir&aacute;n en cursar una o varias asignaturas del M&aacute;ster en &lsquo;Ciencia y Tecnolog&iacute;a de Nuevos Materiales&rsquo; u otros m&aacute;steres ofertados por la Universidad de Sevilla, con un m&aacute;ximo de 18 ECTS y relacionadas con la l&iacute;nea de investigaci&oacute;n a la que se adscribir&aacute; el estudiante. Entre estos m&aacute;steres se pueden indican:</p>\r\n<ul>\r\n<li>\r\n<p>M&aacute;ster Universitario en Estudios Avanzados en Qu&iacute;mica.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en F&iacute;sica Avanzada.</p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Los estudiantes con perfil de ingreso 4 tendr&aacute;n que cursar un m&aacute;ximo de 18 ECTS de asignaturas del M&aacute;ster en \"Ciencia y Tecnolog&iacute;a de Nuevos Materiales\" u otros m&aacute;steres ofertados por la Universidad de Sevilla adem&aacute;s deber&aacute;n realizar un trabajo de iniciaci&oacute;n a la investigaci&oacute;n equivalente, como m&iacute;nimo, a 6 ECTS.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>El total de complementos de formaci&oacute;n no podr&aacute; superar los 24 ECTS y estar&aacute;n siempre relacionados con la l&iacute;nea de investigaci&oacute;n a la que se adscribir&aacute; el estudiante, siendo la comisi&oacute;n acad&eacute;mica del programa la que establezca que complementos formativos son necesarios una vez analizada la formaci&oacute;n previa del alumno.</p>\r\n<br />\r\n<p>Los asignaturas a cursar ser&aacute;n preferentemente correspondientes al M&aacute;ster en \"Ciencia y Tecnolog&iacute;a de Nuevos Materiales\" , pudiendo si la Comisi&oacute;n Acad&eacute;mica lo estima necesario corresponder a los estudios de M&aacute;ster Universitario en Estudios Avanzados en Qu&iacute;mica o M&aacute;ster Universitario en F&iacute;sica Avanzada</p>\r\n<br />\r\n<p>La Comisi&oacute;n Acad&eacute;mica fomentar&aacute; que los directores y tutores de los alumnos realicen el seguimiento de los niveles de formaci&oacute;n que deben adquirir los alumnos informando de los mismos a la Comisi&oacute;n Acad&eacute;mica.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Ana Ramírez Fuentes\",\"email\":\"\"}\r\n	,{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Francisco Ramos Rodríguez\",\"email\":\"\"}\r\n    ,{\"direccion\":\"Secretaría del Departamento de Química Inorgánica\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"95.455.71.59\",\"nombre\":\"José Antonio Odriozola Gordón\",\"email\":\"odrio@us.es\"}\r\n	]}}'),(6,'2014-04-09 09:19:25','3006','doctoradoccsalud@us.es','http://www.doctoradoccsalud.es/','Ciencias de la Salud','2011','SALUD','ENFERMERÍA Y ATENCIÓN A ENFERMOS','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Para acceso al programa de doctorado se recomienda haber cursado Grados en Enfermer&iacute;a, Fisioterapia, Podolog&iacute;a, Odontolog&iacute;a, Medicina, Farmacia, Psicolog&iacute;a, Sociolog&iacute;a, Antropolog&iacute;a o Biolog&iacute;a, tener un nivel de idioma extranjero equivalente a B1, y estar en posesi&oacute;n de un M&aacute;ster Universitario que haya proporcionado al estudiante competencias en investigaci&oacute;n en Ciencias de la Salud.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Criterios de admisi&oacute;n</h4>\r\n<p>Para acceso al programa oficial de doctorado en Ciencias de la Salud ser&aacute; necesario estar en posesi&oacute;n de los t&iacute;tulos oficiales espa&ntilde;oles de Grado, o equivalente. Tendr&aacute;n preferencia aquellos que hayan cursado Grados en Enfermer&iacute;a, Fisioterapia, Podolog&iacute;a, Medicina, Farmacia, Odontolog&iacute;a, Psicolog&iacute;a, Sociolog&iacute;a, Antropolog&iacute;a y Biolog&iacute;a y otros que la Comisi&oacute;n Acad&eacute;mica considere oportunos y estar en posesi&oacute;n de un M&aacute;ster Universitario. Tendr&aacute;n preferencia aquellas personas que hayan cursado:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>M&aacute;ster Universitario en Nuevas Tendencias Asistenciales en Ciencias de la Salud, de la Universidad de Sevilla.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Oficial en Ciencias Odontol&oacute;gicas, de la Universidad de Sevilla.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en Investigaci&oacute;n e Innovaci&oacute;n en Salud, Cuidados y Calidad de Vida, de la Universidad de Ja&eacute;n.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en G&eacute;nero, Feminismos y Ciudadan&iacute;a: perspectivas para un nuevo siglo, organizado por la Universidad de Ja&eacute;n y la Universidad Internacional de Andaluc&iacute;a.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Europeo en Salud P&uacute;blica, organizado por la Escuela Andaluza de Salud P&uacute;blica - Universidad de Granada.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Salud P&uacute;blica y Gesti&oacute;n Sanitaria organizado por la Escuela Andaluza de Salud P&uacute;blica de Granada</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>La Comisi&oacute;n Acad&eacute;mica asignar&aacute; el n&uacute;mero de plazas de forma equitativa, teniendo en cuenta el n&uacute;mero de alumnado matriculado en cada M&aacute;ster y las peticiones recibidas. Asimismo, se considerar&aacute;n las peticiones provenientes de otros Masteres.</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>\r\n<p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</p>\r\n</li>\r\n<li>\r\n<p>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</p>\r\n</li>\r\n<li>\r\n<p>Plan de trabajo que incluya: Introducci&oacute;n, Objetivos, Metodolog&iacute;a, Cronograma y Bibliograf&iacute;a. La extensi&oacute;n m&aacute;xima del Plan de trabajo ser&aacute; de 20 p&aacute;ginas y deber&aacute; estar avalado por un tutor miembro del programa con plena capacidad para dirigir tesis doctorales</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Para el alumnado que proviene de un M&aacute;ster Oficial no se requieren complementos de formaci&oacute;n. Pero tendr&aacute;n car&aacute;cter obligatorio para aquellos estudiantes que acceden al programa estando en posesi&oacute;n &uacute;nicamente de un t&iacute;tulo de graduado o graduada de 300 cr&eacute;ditos ECTS o m&aacute;s que no incluye cr&eacute;ditos de investigaci&oacute;n en su plan de estudio: los estudiantes que, a lo largo de su formaci&oacute;n de Grado y/o M&aacute;ster Universitario oficial no haya superado un m&iacute;nimo de 12 cr&eacute;ditos sobre metodolog&iacute;a de investigaci&oacute;n en Ciencias de la Salud, se le exigir&aacute; la superaci&oacute;n del n&uacute;mero de cr&eacute;ditos que le falten hasta alcanzar esta cifra, de asignaturas de formaci&oacute;n en metodolog&iacute;a o herramientas para la investigaci&oacute;n de los M&aacute;steres incluidos en el perfil de ingreso recomendado.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Dpto de Enfermería\",\"telefono\":\"954-551475/6\",\"nombre\":\"\",\"email\":\"doctoradoccsalud@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Dra. Eugenia Gil García\",\"email\":\"egil@us.es\"}\r\n	]}}'),(7,'2014-04-09 09:19:45','3005',' 	doctorado_cees@us.es','http://institucional.us.es/cees/','Ciencias Económicas, Empresariales y Sociales','2011','ECONOMÍA','CIENCIAS SOCIALES Y DEL COMPORTAMIENTO','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El perfil de ingreso al programa de doctorado en Ciencias Econ&oacute;micas, Empresariales y Sociales depender&aacute; de la l&iacute;nea de investigaci&oacute;n en el que vaya a realizar sus estudios de doctorado:</p>\r\n<h4>1.- Alumnos de doctorado de la l&iacute;nea de Econom&iacute;a y de la l&iacute;nea de Contabilidad, Econom&iacute;a Financiera y Empresa</h4>\r\n<p>El perfil del aspirante a cursar el programa de doctorado en estas l&iacute;neas responde al de un alumno con una formaci&oacute;n en alguna o algunas de las siguientes ramas del conocimiento: econom&iacute;a, contabilidad, finanzas, administraci&oacute;n de empresas y/o en m&eacute;todos estad&iacute;sticos y matem&aacute;ticos.</p>\r\n<br />\r\n<p>Adem&aacute;s, el alumno deber&aacute; demostrar un dominio adecuado del castellano y del ingl&eacute;s mediante los certificados o acreditaciones correspondientes.</p>\r\n<br />\r\n<h4>2.- Alumnos de doctorado de la l&iacute;nea de Antropolog&iacute;a y Sociolog&iacute;a:</h4>\r\n<p>El perfil del aspirante a cursar el programa de doctorado en esta l&iacute;nea responde al de un alumno con una formaci&oacute;n en Ciencias Sociales, preferentemente en antropolog&iacute;a y/o sociolog&iacute;a.</p>\r\n<br />\r\n<p>Adem&aacute;s, el alumno deber&aacute; demostrar un dominio adecuado del castellano y del ingl&eacute;s mediante los certificados o acreditaciones correspondientes.</p>\r\n<br /> <br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>A) ACCESO</h4>\r\n<ol>\r\n<li>\r\n<p>Para el acceso al programa de Doctorado en Ciencias Econ&oacute;micas, Empresariales y Sociales ser&aacute; necesario estar en posesi&oacute;n de un t&iacute;tulo oficial de Grado o equivalente en: Administraci&oacute;n y Direcci&oacute;n de Empresas, Econom&iacute;a, Marketing e Investigaci&oacute;n de Mercados, Antropolog&iacute;a Social y Cultural, Sociolog&iacute;a, Relaciones Laborales, Ciencias Pol&iacute;ticas, Comunicaci&oacute;n Audiovisual, Criminolog&iacute;a, Educaci&oacute;n, Pedagog&iacute;a, Gesti&oacute;n y Administraci&oacute;n P&uacute;blica y Relaciones Laborales y Recursos Humanos.</p>\r\n<br />\r\n<p>Por equivalencia con los grados anteriores, tambi&eacute;n se puede acceder al programa si el alumno dispone de alguna de las licenciaturas equivalentes: Administraci&oacute;n y Direcci&oacute;n de Empresas, Econom&iacute;a, Investigaci&oacute;n y T&eacute;cnicas del Mercado, Antropolog&iacute;a, Sociolog&iacute;a, Ciencias Pol&iacute;ticas, Comunicaci&oacute;n Audiovisual, Pedagog&iacute;a y Ciencias del Trabajo.</p>\r\n<br />\r\n<p>Adem&aacute;s de alguna de las titulaciones antes expuestas, el alumno de nuevo ingreso deber&aacute; disponer de un t&iacute;tulo oficial de m&aacute;ster universitario en el que su contenido est&eacute; orientado a alguna de las tres disciplinas fundamentales que constituyen el programa (Ciencias Econ&oacute;micas y Empresariales, Antropolog&iacute;a y Sociolog&iacute;a).</p>\r\n</li>\r\n<li>\r\n<p>Con car&aacute;cter general, especialmente para aquellos alumnos que proceden de otras universidades, asimismo podr&aacute;n acceder quienes cumplan alguno de los siguientes requisitos:</p>\r\n<br /><ol type=\"a\">\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol, o de otro pa&iacute;s integrante del Espacio Europeo de Educaci&oacute;n Superior, que habilite para el acceso a M&aacute;ster de acuerdo con lo establecido en el art&iacute;culo 16 del Real Decreto 1393/2007, de 29 de octubre y haber superado un m&iacute;nimo de 300 ECTS en el conjunto de estudios universitarios oficiales, de los que, al menos 60, habr&aacute;n de ser de nivel de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Graduado o Graduada, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 ECTS. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n, salvo que el plan de estudios del correspondiente t&iacute;tulo de grado incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudios de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologaci&oacute;n, previa comprobaci&oacute;n por la universidad de que este acredita un nivel de formaci&oacute;n equivalente a la del t&iacute;tulo oficial espa&ntilde;ol de M&aacute;ster Universitario y que faculta en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a estudios de doctorado.</p>\r\n</li>\r\n<li>\r\n<p>Podr&aacute;n acceder a los estudios de doctorado conforme al RD 99/2011, los Licenciados, que estuvieran en posesi&oacute;n del Diploma de Estudios Avanzados (RD 778/1998) o hubieran alcanzado la suficiencia investigadora (RD 185/1985).</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor obtenido conforme a anteriores ordenaciones universitarias.</p>\r\n</li>\r\n<li>\r\n<p>Con car&aacute;cter extraordinario, previo informe favorable de la comisi&oacute;n acad&eacute;mica del programa, podr&aacute;n admitirse estudiantes de otras licenciaturas o grados, cuyos estudios est&eacute;n directamente relacionados con el objeto de la investigaci&oacute;n. En este caso ser&aacute; necesario cursar un m&aacute;ster oficial de los ofertados por la Facultad de Ciencias Econ&oacute;micas y Empresariales de Sevilla, el m&aacute;ster oficial en Antropolog&iacute;a Social, el M&aacute;ster oficial Universitario en Estudios Sociales y Pol&iacute;ticas del Bienestar en la Uni&oacute;n Europea, el M&aacute;ster oficial en Ciencias del Trabajo, M&aacute;ster oficial en Comunicaci&oacute;n y Cultura, el M&aacute;ster oficial en Comunicaci&oacute;n, Instituciones y Pol&iacute;tica, M&aacute;ster en Estudios Europeos.</p>\r\n</li>\r\n</ol></li>\r\n</ol>\r\n<h4>B) ADMISI&Oacute;N</h4>\r\n<p>Dado que en cada curso acad&eacute;mico se ofertar&aacute; un n&uacute;mero determinada de plazas para estudiantes a tiempo completo y, en su caso, otro n&uacute;mero determinado de plazas para estudiantes a tiempo parcial, en el proceso de admisi&oacute;n de los candidatos al programa de doctorado se diferenciar&aacute; a los estudiantes a tiempo completo de los alumnos a tiempo parcial, realiz&aacute;ndose dos procesos paralelos de admisi&oacute;n, uno para los alumnos a tiempo parcial y otro para los estudiantes a tiempo completo. En ambos procesos se valorar&aacute; a los candidatos de la misma manera, se puntuar&aacute; el curr&iacute;culum vitae de 1 a 10 puntos los criterios expuestos a continuaci&oacute;n, ponder&aacute;ndose de la siguiente manera:</p>\r\n<ol>\r\n<li>\r\n<p>Nota media del expediente acad&eacute;mico: 40%</p>\r\n</li>\r\n<li>\r\n<p>Adecuaci&oacute;n del perfil acad&eacute;mico y profesional: 30%</p>\r\n</li>\r\n<li>\r\n<p>Publicaciones y asistencia a encuentros cient&iacute;ficos: 20%</p>\r\n</li>\r\n<li>\r\n<p>Conocimientos de idiomas: 10%</p>\r\n</li>\r\n</ol><br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</p>\r\n</li>\r\n<li>\r\n<p>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Los alumnos de doctorado que deseen entrar en el programa de Doctorado en Ciencias Econ&oacute;micas, Empresariales y Sociales si acreditan encontrarse en la situaci&oacute;n descrita en el punto 1 del apartado de Requisitos y Criterios de Admisi&oacute;n (A. ACCESO), ser&aacute;n admitidos sin necesidad de realizar complementos de formaci&oacute;n.</p>\r\n<br />\r\n<p>En caso contrario, el aspirante tendr&aacute; que realizar determinados complementos de formaci&oacute;n, quedando su admisi&oacute;n condicionada a la superaci&oacute;n de los mismos.</p>\r\n<p><strong>Complementos de formaci&oacute;n para los casos descritos en el apartado Requisitos y Criterios de Admisi&oacute;n</strong></p>\r\n<br /><ol type=\"A\">\r\n<li>\r\n<p>Para los aspirantes que se encuentren en la situaci&oacute;n de acceso descrita en los puntos 2.a, 2.b y 2.c del apartado A) ACCESO del ep&iacute;grafe &ldquo;Requisitos y criterios de admisi&oacute;n&rdquo; y que no hayan acreditado formaci&oacute;n investigadora (curso de metodolog&iacute;a de investigaci&oacute;n, trabajo de investigaci&oacute;n) se le requerir&aacute; una formaci&oacute;n complementaria en investigaci&oacute;n, que no superar&aacute; 18 ECTS.</p>\r\n<ol type=\"a\">\r\n<li>\r\n<p>Los alumnos con el perfil de ingreso descrito en el apartado 1, del Perfil de ingreso recomendado tendr&aacute;n que realizar un m&oacute;dulo de investigaci&oacute;n de 18 cr&eacute;ditos, que consistir&aacute; en cursar una asignatura de metodolog&iacute;a de investigaci&oacute;n en Ciencias Econ&oacute;micas y Empresariales de 6 cr&eacute;ditos y en realizar un trabajo de investigaci&oacute;n en una materia espec&iacute;fica de este campo.</p>\r\n</li>\r\n<li>\r\n<p>Para los alumnos con el perfil de ingreso descrito en el apartado 2 del perfil de ingreso recomendado, tendr&aacute;n que realizar un m&oacute;dulo de investigaci&oacute;n de 18 cr&eacute;ditos, que consistir&aacute; en cursar una asignatura de metodolog&iacute;a de investigaci&oacute;n en antropolog&iacute;a o sociolog&iacute;a de 6 cr&eacute;ditos y en realizar un trabajo de investigaci&oacute;n en una materia espec&iacute;fica de estos campos.</p>\r\n</li>\r\n</ol><br />\r\n<p>Esta formaci&oacute;n investigadora se realizar&aacute; en el &aacute;mbito de los m&aacute;steres oficiales ofertados por la Universidad de Sevilla o por cualquier centro reconocido por la Comisi&oacute;n acad&eacute;mica.</p>\r\n</li>\r\n<li>\r\n<p>Para los aspirantes que se encuentren en la situaci&oacute;n de acceso descrita en los puntos 2.d y 2.e del apartado A) ACCESO del ep&iacute;grafe Requisitos y criterios de admisi&oacute;n, siempre que hayan cursado grados o licenciaturas relacionadas con en los perfiles 1 y 2 tendr&aacute;n acceso directo al programa de doctorado.</p>\r\n</li>\r\n<li>\r\n<p>Para los aspirantes que se encuentren en la situaci&oacute;n de acceso descrita en los puntos 2.d y 2.e del apartado A) ACCESO del ep&iacute;grafe Requisitos y criterios de admisi&oacute;n y no hayan cursado grados o licenciaturas relacionadas con los perfiles 1 y 2 tendr&aacute;n que cursar alg&uacute;n m&aacute;ster oficial incluido en el perfil de ingreso que le corresponda</p>\r\n</li>\r\n<li>\r\n<p>Para los aspirantes que se encuentren en la situaci&oacute;n de acceso descrita en los puntos 2.f del apartado A) ACCESO, del ep&iacute;grafe Requisitos y criterios de admisi&oacute;n y previo informe favorable de la comisi&oacute;n acad&eacute;mica del programa, es decir, estudiantes de otras licenciaturas o grados, cuyos estudios est&eacute;n directamente relacionados con el objeto de la investigaci&oacute;n podr&aacute;n ser admitidos. En este caso ser&aacute; necesario cursar un m&aacute;ster oficial de los ofertados por la Facultad de Ciencias Econ&oacute;micas y Empresariales de Sevilla, el m&aacute;ster oficial en Antropolog&iacute;a Social, el M&aacute;ster oficial Universitario en Estudios Sociales y Pol&iacute;ticas del Bienestar en la Uni&oacute;n Europea, el M&aacute;ster oficial en Ciencias del Trabajo, M&aacute;ster oficial en Comunicaci&oacute;n y Cultura o el M&aacute;ster oficial en Comunicaci&oacute;n, Instituciones y Pol&iacute;tica.</p>\r\n</li>\r\n</ol>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Administración de la Facultad de Ciencias Económicas y Empresariales\",\"telefono\":\"945-557508\",\"nombre\":\"Dª Nieves Caro Ruiz\",\"email\":\"ncaro@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954554475\",\"nombre\":\"Dr. José Ignacio Castillo Manzano\",\"email\":\"doctorado_cees@us.es | jignacio@us.es\"}\r\n	]}}'),(8,'2014-04-09 09:19:56','3008',' 	doctorado_cytf@us.es ','http://institucional.us.es/doctoradocytf/','Ciencias y Tecnologías Físicas','2011','FÍSICA','','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<ul>\r\n<li>\r\n<p>Estudiantes con formaci&oacute;n en Ciencias o en Ingenier&iacute;a a nivel de Master</p>\r\n</li>\r\n<li>\r\n<p>Estudiantes que tengan inter&eacute;s por la Investigaci&oacute;n y el Desarrollo</p>\r\n</li>\r\n<li>\r\n<p>El conocimiento de idiomas es recomendable, preferentemente del idioma ingl&eacute;s.</p>\r\n</li>\r\n</ul>\r\n<p>El ingreso est&aacute; supeditado a:</p>\r\n<ol>\r\n<li>\r\n<p>El cumplimiento de unos requisitos formativos en forma de estudios cursados y</p>\r\n</li>\r\n<li>\r\n<p>La evaluaci&oacute;n de un conjunto de criterios de admisi&oacute;n por parte de la Comisi&oacute;n Acad&eacute;mica</p>\r\n</li>\r\n</ol>\r\n<h4>&nbsp;</h4>\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>1) REQUISITOS FORMATIVOS</h4>\r\n<ul>\r\n<li>\r\n<p>Podr&aacute;n ingresar sin complementos formativos, condicionado a la evaluaci&oacute;n de los criterios de admisi&oacute;n, los estudiantes que:</p>\r\n<ol type=\"i\">\r\n<li>\r\n<p>Est&eacute;n en posesi&oacute;n de un t&iacute;tulo oficial de Master (EEES) de las ramas de conocimiento de Ciencias.</p>\r\n</li>\r\n<li>\r\n<p>Est&eacute;n en posesi&oacute;n de un t&iacute;tulo oficial de Master (EEES) de las ramas de conocimiento de Ingenier&iacute;a y Arquitectura.</p>\r\n</li>\r\n</ol></li>\r\n<li>\r\n<p>Para los estudiantes que no puedan acreditar un t&iacute;tulo oficial de Master (EEES), la Comisi&oacute;n Acad&eacute;mica emitir&aacute; un informe sobre la formaci&oacute;n acreditada por el alumno y establecer&aacute; los complementos de formaci&oacute;n necesarios, si los hubiera.</p>\r\n</li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>2) CRITERIOS DE ADMISI&Oacute;N</h4>\r\n<p>La CA evaluar&aacute; todas las solicitudes de admisi&oacute;n y definir&aacute; una lista de acceso priorizada atendiendo a los siguientes criterios:</p>\r\n<ul>\r\n<li>\r\n<p>Cumplimiento de los requisitos formativos</p>\r\n</li>\r\n<li>\r\n<p>Afinidad de la titulaci&oacute;n con las l&iacute;neas de investigaci&oacute;n del Programa de Doctorado (Valoraci&oacute;n m&aacute;xima: 50 puntos sobre 100)</p>\r\n</li>\r\n<li>\r\n<p>Curriculum vitae. (Valoraci&oacute;n m&aacute;xima: 25 puntos sobre 100)</p>\r\n<ul>\r\n<li>\r\n<p>El expediente acad&eacute;mico (60%)</p>\r\n</li>\r\n<li>\r\n<p>Nivel de idiomas extranjeros. Se valorar&aacute;n especialmente los certificados que acrediten el conocimiento de idiomas seg&uacute;n la normativa establecida en el EEES (15%)</p>\r\n</li>\r\n<li>\r\n<p>Experiencia profesional y/o investigadora (15%)</p>\r\n</li>\r\n<li>\r\n<p>Otros m&eacute;ritos (10%)</p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Carta de un Profesor del Programa de Doctorado manifestando su inter&eacute;s en tutelar y/o dirigir la investigaci&oacute;n del solicitante. Esta carta de recomendaci&oacute;n deber&aacute; incluir una valoraci&oacute;n acad&eacute;mica del alumno y argumentos sobre su adecuaci&oacute;n para desarrollar un tema de investigaci&oacute;n af&iacute;n a alguna de las l&iacute;neas de investigaci&oacute;n del programa. (Valoraci&oacute;n m&aacute;xima: 25 puntos sobre 100)</p>\r\n</li>\r\n</ul>\r\n<p>Para el acceso al Programa de Doctorado ser&aacute; necesaria una puntuaci&oacute;n m&iacute;nima de 65 puntos, condicionado a la disponibilidad de plazas.</p>\r\n<h4>&nbsp;</h4>\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato y organizado teniendo en cuenta los Criterios de Admisi&oacute;n.</li>\r\n<li>Certificaciones de estudios complementarios (idiomas, etc.) y de le experiencia profesional previa, si los hubiera.</li>\r\n<li>Carta de un profesor del Programa de Doctorado manifestando su inter&eacute;s en tutelar y/o dirigir la investigaci&oacute;n del solicitante. Esta carta no es obligatoria, pero en su ausencia, no se otorgar&aacute;n los puntos correspondientes en la evaluaci&oacute;n de los Criterios de Admisi&oacute;n.</li>\r\n<li>Los alumnos que soliciten la realizaci&oacute;n de los estudios de doctorado a tiempo parcial, deber&aacute;n aportar una Memoria justificativa que soporte tal solicitud.</li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>La Comisi&oacute;n Acad&eacute;mica formular&aacute; complementos de formaci&oacute;n para los estudiantes que no hayan cursado previamente un M&aacute;ster Universitario oficial (EEES) de las ramas de conocimiento de Ciencias o de las ramas de Ingenier&iacute;a y Arquitectura.</p>\r\n<h4>&nbsp;</h4>\r\n<p>Estos complementos, por un m&aacute;ximo de 18 cr&eacute;ditos ECTS de investigaci&oacute;n, ser&aacute;n determinados por la Comisi&oacute;n Acad&eacute;mica en funci&oacute;n de su perfil de ingreso y estar&aacute;n vinculados a asignaturas de M&aacute;steres oficiales con contenidos afines a las l&iacute;neas de investigaci&oacute;n en las que el estudiante vaya a realizar su trabajo.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Decanato de la Facultad de Física\",\"telefono\":\"\",\"nombre\":\"Dolores Palma Ledesma\",\"email\":\"ffisaog@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954.466.666\",\"nombre\":\"Ángel Rodríguez Vázquez\",\"email\":\"\"}\r\n	]}}'),(9,'2014-04-09 09:20:08','3009','doctorado-comunicacion@us.es','http://www.doctorado-comunicacion.es/','Comunicación','2011','CIENCIAS SOCIALES Y DEL COMPORTAMIENTO','PERIODISMO E INFORMACIÓN','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Aunque se dar&aacute; prioridad a las personas con un perfil acad&eacute;mico (licenciatura/grado y m&aacute;ster) arm&oacute;nico con las &aacute;reas propias del Programa de Doctorado en Comunicaci&oacute;n, este estar&aacute; abierto a todo tipo de candidaturas, especialmente a las procedentes de los &aacute;mbitos de las Ciencias Sociales y las Humanidades, estableciendo en su caso la necesidad de cursar complementos de formaci&oacute;n.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Proceso de selecci&oacute;n y v&iacute;as de acceso:</h4>\r\n<p>Las candidaturas se evaluar&aacute;n a partir de:</p>\r\n<ol>\r\n<li>\r\n<p>Carta de motivaci&oacute;n en la que el alumno/a incluir&aacute; la justificaci&oacute;n personal y profesional que le lleva a solicitar su ingreso, la tem&aacute;tica y l&iacute;nea de investigaci&oacute;n que pretenden llevar a cabo, sus objetivos, su plan de trabajo, su metodolog&iacute;a y su calendario/pla&ntilde;en. Adem&aacute;s, en la misma se deber&aacute; indicar la l&iacute;nea de investigaci&oacute;n del Doctorado en Comunicaci&oacute;n por la cual el solicitante opta.</p>\r\n</li>\r\n<li>\r\n<p>Expediente acad&eacute;mico</p>\r\n<ol>\r\n<li>\r\n<p>Titulaci&oacute;n: Ser&aacute;n titulaciones preferentes para el acceso al Doctorado aquellas provenientes de los distintos estudios en Comunicaci&oacute;n (Comunicaci&oacute;n Audiovisual, Periodismo, Publicidad y Relaciones P&uacute;blicas). Asimismo, Tendr&aacute;n preferencia alta para el acceso al Doctorado en Comunicaci&oacute;n los siguientes M&aacute;steres Oficiales:</p>\r\n<ul>\r\n<li>\r\n<p>M&aacute;ster en Comunicaci&oacute;n y Cultura (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Escritura Creativa (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Gui&oacute;n, Narrativa y Creatividad Audiovisual (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Comunicaci&oacute;n Institucional y Pol&iacute;tica (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Gesti&oacute;n Estrat&eacute;gica e Innovaci&oacute;n en Comunicaci&oacute;n (Universidad de M&aacute;laga)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Interuniversitario en Comunicaci&oacute;n y Educaci&oacute;n Audiovisual (Universidad Internacional de Andaluc&iacute;a / Universidad de Huelva)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Educaci&oacute;n Intercultural (Universidad de Huelva)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Interuniversitario en Gesti&oacute;n Estrat&eacute;gica e Innovaci&oacute;n.</p>\r\n</li>\r\n</ul>\r\n<p>Para aquellos m&aacute;steres no mencionados, la Comisi&oacute;n Acad&eacute;mica har&aacute; una valoraci&oacute;n de la formaci&oacute;n adquirida por el estudiante en dichos m&aacute;steres para ser admitido al programa, estableci&eacute;ndose complementos de formaci&oacute;n si fuese preciso.</p>\r\n</li>\r\n<li>\r\n<p>Nota media del expediente acad&eacute;mico.</p>\r\n</li>\r\n</ol></li>\r\n<li>\r\n<p>Curr&iacute;culum Vitae con menci&oacute;n expresa, en su caso, de la experiencia profesional o cient&iacute;fica relevante relacionada con el &aacute;mbito del programa y, en concreto, de sus l&iacute;neas de investigaci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<p>Idiomas: aunque el idioma predominante en el Doctorado en Comunicaci&oacute;n es el espa&ntilde;ol, se valorar&aacute; positivamente el conocimiento acreditado de otros idiomas.</p>\r\n</li>\r\n</ol><br />\r\n<p>En el caso de no admisi&oacute;n al Doctorado en Comunicaci&oacute;n los solicitantes tendr&aacute;n la oportunidad de remitir una carta a la Comisi&oacute;n Acad&eacute;mica del mismo indicando sus argumentos. Dicha Comisi&oacute;n, que conceder&aacute; audiencia al solicitante en caso de que &eacute;ste la solicite, estudiar&aacute; el caso y se pronunciar&aacute; al respecto.</p>\r\n<table class=\"table table-striped\">\r\n<thead>\r\n<tr><th colspan=\"2\">Doctorado en Comunicaci&oacute;n -Baremo</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>1. Carta de motivaci&oacute;n</td>\r\n<td>20%</td>\r\n</tr>\r\n<tr>\r\n<td>2. Expediente acad&eacute;mico\r\n<ul>\r\n<li>Titulacion</li>\r\n<li>Nota media expediente acad&eacute;mico</li>\r\n</ul>\r\n</td>\r\n<td>-\r\n<ul>\r\n<li>20%</li>\r\n<li>40%</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>3. Curr&iacute;culum Vitae</td>\r\n<td>10%</td>\r\n</tr>\r\n<tr>\r\n<td>4. Idiomas</td>\r\n<td>10%</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Total</strong></td>\r\n<td><strong>100%</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta de solicitud, con menci&oacute;n expresa de la motivaci&oacute;n de la misma. En la misma se deber&aacute; indicar la l&iacute;nea de investigaci&oacute;n del Doctorado en Comunicaci&oacute;n por la cual el solicitante opta.</li>\r\n<li>Proyecto preliminar de tesis doctoral (4 folios) que contendr&aacute; los siguientes apartados: T&iacute;tulo, objetivos, fundamentos te&oacute;ricos y metodol&oacute;gicos, bibliograf&iacute;a</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>La necesidad de complementos de formaci&oacute;n ser&aacute; evaluada por la Comisi&oacute;n Acad&eacute;mica del Doctorado en Comunicaci&oacute;n que, atendiendo al curr&iacute;culum vitae del solicitante, orientar&aacute; al alumno/a (dependiendo de la l&iacute;nea de investigaci&oacute;n en la cual desee integrarse) acerca del camino m&aacute;s adecuado.</p>\r\n<br />\r\n<p>Estos complementos ser&aacute;n desarrollados por los estudiantes que lo requieran en algunos de los siguientes M&aacute;steres oficiales que se imparten en las universidades integradas en el Doctorado en Comunicaci&oacute;n:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>M&aacute;ster en Comunicaci&oacute;n y Cultura (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Escritura Creativa (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Gui&oacute;n, Narrativa y Creatividad Audiovisual (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Comunicaci&oacute;n Institucional y Pol&iacute;tica (Universidad de Sevilla)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Gesti&oacute;n Estrat&eacute;gica e Innovaci&oacute;n en Comunicaci&oacute;n (Universidad de M&aacute;laga)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Interuniversitario en Comunicaci&oacute;n y Educaci&oacute;n Audiovisual (Universidad Internacional de Andaluc&iacute;a / Universidad de Huelva)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Educaci&oacute;n Intercultural (Universidad de Huelva)</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Interuniversitario en Gesti&oacute;n Estrat&eacute;gica e Innovaci&oacute;n en Comunicaci&oacute;n (Universidad de C&aacute;diz)</p>\r\n</li>\r\n</ul>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de la Facultad de Comunicación, Universidad de Sevilla. Avda. Américo Vespucio s/n. 41010 Sevilla\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"Facultad de Comunicación. Despacho D-11. Avda. Américo Vespucio s/n. 41010 Sevilla\",\"telefono\":\"95.455.96.87\",\"nombre\":\"Manuel Ángel Vázquez Medel\",\"email\":\"amedel@us.es\"}\r\n	]}}'),(10,'2014-04-09 09:20:19','3029','doctorado_derecho@us.es','http://institucional.us.es/vicederinves/','Derecho','2011','DERECHO','DERECHO','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<ol>\r\n<li>\r\n<p>Capacidades y conocimientos previos en el &aacute;mbito del Derecho.</p>\r\n<br />\r\n<p>Las titulaciones que habr&aacute; debido cursar el estudiante en el primer y segundo ciclos son las siguientes:</p>\r\n<ol type=\"a\">\r\n<li>\r\n<p>Primer ciclo. El perfil recomendado es el de Graduado en Derecho, pero tambi&eacute;n pueden ingresar en el Programa quienes hayan cursado otros estudios de Grado en la medida en que contengan una acusada formaci&oacute;n jur&iacute;dica (Gesti&oacute;n y Administraci&oacute;n P&uacute;blica, Criminolog&iacute;a, Relaciones Laborales y Recursos Humanos, etc.).</p>\r\n</li>\r\n<li>\r\n<p>Segundo ciclo. M&aacute;ster Universitario oficial en el &aacute;mbito de las ciencias jur&iacute;dicas.</p>\r\n</li>\r\n</ol><br />\r\n<p>Si el estudiante tiene formaci&oacute;n jur&iacute;dica previa, pero no alcanza la intensidad suficiente, en los t&eacute;rminos previstos en los criterios de admisi&oacute;n, deber&aacute; desarrollar los Complementos de Formaci&oacute;n correspondientes.</p>\r\n</li>\r\n<li>\r\n<p>Capacidades y conocimientos previos de ingl&eacute;s a nivel B 1.</p>\r\n</li>\r\n</ol><br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>A) Acceso:</h4>\r\n<p>De acuerdo con el art. 6 RD 99/2011:</p>\r\n<ol>\r\n<li>\r\n<p>Con car&aacute;cter general, para el acceso a un programa oficial de doctorado ser&aacute; necesario estar en posesi&oacute;n de los t&iacute;tulos oficiales espa&ntilde;oles de Grado, o equivalente, y de M&aacute;ster Universitario.</p>\r\n</li>\r\n<li>\r\n<p>Asimismo podr&aacute;n acceder quienes se encuentren en alguno de los siguientes supuestos:</p>\r\n<ol type=\"a\">\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol, o de otro pa&iacute;s integrante del Espacio Europeo de Educaci&oacute;n Superior, que habilite para el acceso a M&aacute;ster de acuerdo con lo establecido en el art&iacute;culo 16 del Real Decreto 1393/2007, de 29 de octubre y haber superado un m&iacute;nimo de 300 cr&eacute;ditos ECTS en el conjunto de estudios universitarios oficiales, de los que, al menos 60, habr&aacute;n de ser de nivel de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Graduado o Graduada, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 cr&eacute;ditos ECTS. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n a que se refiere el art&iacute;culo 7.2 de esta norma, salvo que el plan de estudios del correspondiente t&iacute;tulo de grado incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudios de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Los titulados universitarios que, previa obtenci&oacute;n de plaza en formaci&oacute;n en la correspondiente prueba de acceso a plazas de formaci&oacute;n sanitaria especializada, hayan superado con evaluaci&oacute;n positiva al menos dos a&ntilde;os de formaci&oacute;n de un programa para la obtenci&oacute;n del t&iacute;tulo oficial de alguna de las especialidades en Ciencias de la Salud.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologaci&oacute;n, previa comprobaci&oacute;n por la universidad de que &eacute;ste acredita un nivel de formaci&oacute;n equivalente a la del t&iacute;tulo oficial espa&ntilde;ol de M&aacute;ster Universitario y que faculta en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a estudios de doctorado. Esta admisi&oacute;n no implicar&aacute;, en ning&uacute;n caso, la homologaci&oacute;n del t&iacute;tulo previo del que est&eacute; en posesi&oacute;n el interesado ni su reconocimiento a otros efectos que el del acceso a ense&ntilde;anzas de Doctorado.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor obtenido conforme a anteriores ordenaciones universitarias.</p>\r\n</li>\r\n</ol></li>\r\n</ol><br />\r\n<h4>B) Admisi&oacute;n:</h4>\r\n<h5>Criterios de admisi&oacute;n</h5>\r\n<p>Conforme al art&iacute;culo 7.1 del Real Decreto 99/2011, se establecen como requisitos espec&iacute;ficos de admisi&oacute;n que la titulaci&oacute;n de Grado tenga un contenido jur&iacute;dico de al menos 120 ECTS y que el M&aacute;ster Universitario (o la titulaci&oacute;n alternativa que haya servido de v&iacute;a de acceso dentro de las recogidas en el art&iacute;culo 6.2 del Real Decreto 99/2011) se haya obtenido en el &aacute;mbito de las ciencias jur&iacute;dicas para lo cual se establece el umbral m&iacute;nimo de 45 ECTS de contenido jur&iacute;dico cursados en el mismo. La comisi&oacute;n acad&eacute;mica, de modo excepcional, podr&aacute; admitir al programa a aquellos estudiantes que hayan realizado al menos 108 cr&eacute;ditos ECTS de contenido jur&iacute;dico en sus estudios de Grado. En el caso de no llegarse al umbral m&iacute;nimo de 45 cr&eacute;ditos ECTS en los estudios de m&aacute;ster se podr&aacute;n realizar los cr&eacute;ditos restantes mediante los complementos de formaci&oacute;n. Asimismo ser&aacute;n necesarios complementos de formaci&oacute;n de car&aacute;cter investigador en los m&aacute;steres jur&iacute;dicos exigidos legalmente para el acceso a una profesi&oacute;n.</p>\r\n<br />\r\n<p>Podr&aacute;n ser admitidos a los estudios de doctorado conforme al RD 99/2011, los Licenciados en Derecho que estuvieran en posesi&oacute;n del Diploma de Estudios Avanzados obtenido de acuerdo con lo dispuesto en el Real Decreto 778/1998, de 30 de abril, o hubieran alcanzado la suficiencia investigadora regulada en el Real Decreto 185/1985, de 23 de enero; siempre que uno u otro lo hubieran obtenido en programas de contenido jur&iacute;dico.</p>\r\n<br />\r\n<p>Entre los estudiantes que cumplan los requisitos de acceso y los requisitos espec&iacute;ficos de admisi&oacute;n, las plazas ofertadas se asignar&aacute;n mediante la aplicaci&oacute;n de los siguientes criterios, que se enumeran especificando las reglas de valoraci&oacute;n y su peso respectivo en la puntuaci&oacute;n total:</p>\r\n<br /><ol>\r\n<li>\r\n<p>Adecuaci&oacute;n del perfil acad&eacute;mico al Programa de Doctorado.- 50 por 100. Distribuido de la siguiente manera:</p>\r\n<ol type=\"A\">\r\n<li>\r\n<p>Adecuaci&oacute;n de los estudios de Grado realizados al contenido jur&iacute;dico del Programa de Doctorado. 20 por 100. A los Graduados en Derecho, se les otorgar&aacute; en este apartado la m&aacute;xima valoraci&oacute;n. Para los titulados en estudios diferentes a los de Derecho, la valoraci&oacute;n se emitir&aacute; en funci&oacute;n del peso relativo de las disciplinas jur&iacute;dicas en el conjunto de los cr&eacute;ditos del t&iacute;tulo cursado</p>\r\n</li>\r\n<li>\r\n<p>Adecuaci&oacute;n de los estudios de M&aacute;ster realizados al contenido jur&iacute;dico del Programa de Doctorado. 20 por 100. La valoraci&oacute;n se emitir&aacute; en funci&oacute;n del peso relativo de las disciplinas jur&iacute;dicas en el conjunto de los cr&eacute;ditos del t&iacute;tulo cursado.</p>\r\n</li>\r\n<li>\r\n<p>Adecuaci&oacute;n de los estudios de Grado y M&aacute;ster realizados a la l&iacute;nea de investigaci&oacute;n y al objeto de la investigaci&oacute;n proyectada. 10 por 100. En relaci&oacute;n con este criterio de valoraci&oacute;n, se entiende que existe adecuaci&oacute;n entre las titulaciones y las siguientes &aacute;reas de conocimiento o temas de investigaci&oacute;n: Gesti&oacute;n y Administraci&oacute;n P&uacute;blica &uacute;nicamente con Derecho Administrativo y Derecho Financiero y Tributario; Criminolog&iacute;a &uacute;nicamente con Derecho Penal y Derecho Procesal; Relaciones Laborales y Recursos Humanos &uacute;nicamente con Derecho del Trabajo y de la Seguridad Social. Este requisito resulta excluyente para puntuaciones inferiores a 5 sobre 10.</p>\r\n</li>\r\n</ol></li>\r\n<li>\r\n<p>Nota media del expediente acad&eacute;mico de Grado y M&aacute;ster.- 30 por 100.</p>\r\n</li>\r\n<li>\r\n<p>Publicaciones y asistencia a eventos cient&iacute;ficos adecuados al Programa.- 10 por 100.</p>\r\n</li>\r\n<li>\r\n<p>Conocimiento de idiomas.- 5 por 100.</p>\r\n</li>\r\n<li>\r\n<p>Actividad profesional adecuada al Programa y otros m&eacute;ritos.- 5 por 100.</p>\r\n</li>\r\n</ol>\r\n<p>El proceso de admisi&oacute;n ser&aacute; competencia de la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado.</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum vitae indicando experiencia profesional e investigadora, publicaciones, formaci&oacute;n impartida y recibida.</li>\r\n<li>Carta de motivaci&oacute;n, indicando el &aacute;mbito de inter&eacute;s para realizar la tesis doctoral, la experiencia previa en dicho &aacute;mbito y una propuesta de proyecto de tesis y programa de trabajo (incluyendo posibles contactos previos con un posible tutor/director y posibilidades de financiaci&oacute;n).</li>\r\n<li>Documento acreditativo de un nivel B1 de conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencia y discusiones cient&iacute;ficas y dominio de la expresi&oacute;n escrita</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<ol type=\"A\"><ol type=\"A\">\r\n<li>\r\n<p>Cuando no se alcancen los 45 ECTS en formaci&oacute;n jur&iacute;dica en el m&aacute;ster, la Comisi&oacute;n Acad&eacute;mica exigir&aacute; como Complementos de Formaci&oacute;n la obtenci&oacute;n de los cr&eacute;ditos ECTS que resten hasta ese n&uacute;mero cursando las asignaturas adecuadas de alguno de los M&aacute;steres Universitarios ofertados por la Facultad de Derecho. Las asignaturas que se utilizar&aacute;n como Complementos de Formaci&oacute;n ser&aacute;n establecidas por la Comisi&oacute;n Acad&eacute;mica en funci&oacute;n de la formaci&oacute;n previa acreditada por el estudiante.</p>\r\n</li>\r\n<li>\r\n<p>Cuando no se alcance la puntuaci&oacute;n de 30 sobre 50 en el apartado 1.&ordm; de los criterios de admisi&oacute;n, dedicado a la Adecuaci&oacute;n del perfil acad&eacute;mico al Programa de Doctorado (es decir, el 60 por 100 de la puntuaci&oacute;n total computable en el mismo), la Comisi&oacute;n Acad&eacute;mica exigir&aacute; como Complementos de Formaci&oacute;n la obtenci&oacute;n de 12 cr&eacute;ditos ECTS cursando las asignaturas adecuadas de alguno de los M&aacute;steres Universitarios ofertados por la Facultad de Derecho. Las asignaturas que se utilizar&aacute;n como Complementos de Formaci&oacute;n ser&aacute;n establecidas por la Comisi&oacute;n Acad&eacute;mica en funci&oacute;n de la formaci&oacute;n previa acreditada por el estudiante.</p>\r\n</li>\r\n<li>\r\n<p>Cuando la v&iacute;a de acceso al Programa fuera la prevista en el art&iacute;culo 6.2.b) del Real Decreto 99/2011 (t&iacute;tulo oficial de Graduado cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea al menos 300 cr&eacute;ditos ECTS), los estudiantes deber&aacute;n cursar con car&aacute;cter obligatorio Complementos de Formaci&oacute;n consistentes en 12 cr&eacute;ditos ECTS de alguno de los M&aacute;steres Universitarios ofertados por la Facultad de Derecho. Las asignaturas de los M&aacute;steres que se utilizar&aacute;n como Complementos de Formaci&oacute;n ser&aacute;n establecidas por la Comisi&oacute;n Acad&eacute;mica en funci&oacute;n de su car&aacute;cter investigador y de su adecuaci&oacute;n al perfil de la futura investigaci&oacute;n que se pretenda realizar (adecuaci&oacute;n que deber&aacute; quedar acreditada mediante el informe positivo del tutor de la tesis doctoral). Estos Complementos de Formaci&oacute;n no ser&aacute;n exigibles cuando el plan de estudios del t&iacute;tulo de grado incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos de investigaci&oacute;n procedentes de estudios de M&aacute;ster.</p>\r\n</li>\r\n<li>\r\n<p>Cuando la v&iacute;a de acceso al Programa fuera un m&aacute;ster jur&iacute;dico exigido legalmente para el acceso a una profesi&oacute;n, los estudiantes deber&aacute;n cursar con car&aacute;cter obligatorio Complementos de Formaci&oacute;n consistentes al menos en 6 cr&eacute;ditos ECTS en alg&uacute;n M&aacute;ster Universitario. Las asignaturas de los M&aacute;steres que se utilizar&aacute;n como Complementos de Formaci&oacute;n ser&aacute;n establecidas por la Comisi&oacute;n Acad&eacute;mica en funci&oacute;n de su car&aacute;cter investigador y de su adecuaci&oacute;n al perfil de la futura investigaci&oacute;n que se pretenda realizar (adecuaci&oacute;n que deber&aacute; quedar acreditada mediante el informe positivo del tutor de la tesis doctoral).</p>\r\n</li>\r\n</ol></ol><br />\r\n<p>En los cuatro supuestos previstos, la admisi&oacute;n en el Programa de Doctorado queda condicionada a la superaci&oacute;n de los Complementos de Formaci&oacute;n espec&iacute;ficos.</p>\r\n<br />\r\n<p>Se incluyen a continuaci&oacute;n los M&aacute;steres actualmente implantados en la Facultad de Derecho (veh&iacute;culo para el desarrollo de los Complementos de Formaci&oacute;n), con los enlaces a sus planes de estudio:</p>\r\n<br />\r\n<h5>M&aacute;ster Universitario en Asesor&iacute;a Jur&iacute;dico-Mercantil, Fiscal y Laboral (R.D.1393/2007)</h5>\r\n<a href=\"http://www.us.es/estudios/master/master_M123\">http://www.us.es/estudios/master/master_M123</a><br />\r\n<h5>M&aacute;ster Universitario en Derecho Constitucional (R.D.1393/07)</h5>\r\n<a href=\"http://www.us.es/estudios/master/master_M061\">http://www.us.es/estudios/master/master_M061</a><br />\r\n<h5>M&aacute;ster Universitario en Derecho de la Uni&oacute;n Europea (R.D. 1393/2007)</h5>\r\n<a href=\"http://www.us.es/estudios/master/master_M124\">http://www.us.es/estudios/master/master_M124</a><br />\r\n<h5>M&aacute;ster Universitario en Derecho P&uacute;blico (R.D.1393/07)</h5>\r\n<a href=\"http://www.us.es/estudios/master/master_M062\">http://www.us.es/estudios/master/master_M062</a><br />\r\n<h5>M&aacute;ster Universitario en Relaciones Jur&iacute;dico-Privadas (R.D.1393/07)</h5>\r\n<a href=\"http://www.us.es/estudios/master/master_M106\">http://www.us.es/estudios/master/master_M106</a><br /><br /><ol type=\"A\"><ol><!-- /.blog-post --></ol></ol>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaria Facultad de Derecho\",\"telefono\":\"954551214\",\"nombre\":\"Mercedes Verdugo Rasco\",\"email\":\"derecho@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Ángel M. López López\",\"email\":\"doctorado_derecho@us.es\"}\r\n\r\n	]}}'),(11,'2014-04-09 09:20:33','3010','doctoradoeducacion@us.es','http://institucional.us.es/educacion/','Educación','2011','CIENCIAS DE LA EDUCACIÓN','','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El programa de doctorado en Educaci&oacute;n define los siguientes perfiles de acceso:</p>\r\n<br />\r\n<h5>1. Alumnos con acceso directo al programa de doctorado:</h5>\r\n<p>Tendr&aacute;n acceso preferente al programa de doctorado, previa valoraci&oacute;n por la Comisi&oacute;n Acad&eacute;mica del mismo, aquellos alumnos que cumplan las condiciones que a continuaci&oacute;n se detallan:</p>\r\n<br />\r\n<p>Alumnos que hayan cursado alguna de las siguientes titulaciones:</p>\r\n<ul>\r\n<li>\r\n<p>Licenciados en Psicopedagog&iacute;a</p>\r\n</li>\r\n<li>\r\n<p>Licenciados en Pedagog&iacute;a</p>\r\n</li>\r\n<li>\r\n<p>Graduados en Pedagog&iacute;a</p>\r\n</li>\r\n<li>\r\n<p>Graduados en Educaci&oacute;n Social</p>\r\n</li>\r\n<li>\r\n<p>Graduados en Maestro de Educaci&oacute;n Infantil</p>\r\n</li>\r\n<li>\r\n<p>Graduados en Maestro de Educaci&oacute;n Primaria</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>Y que hayan cursado alguno de los siguientes:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>M&aacute;ster en Direcci&oacute;n, Evaluaci&oacute;n y Calidad de Instituciones de Formaci&oacute;n, con perfil investigador.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Formaci&oacute;n y Orientaci&oacute;n Profesional para el Empleo, con perfil investigador.</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster en Actividad F&iacute;sica y Calidad de Vida de Personas Adultas y Mayores, con perfil investigador.</p>\r\n</li>\r\n<li>\r\n<p>y cualquier otro M&aacute;ster Oficial vinculado con las Ciencias de la Educaci&oacute;n de universidades espa&ntilde;olas o extranjeras, con perfil investigador que incluya, al menos, 10 cr&eacute;ditos ECTS de formaci&oacute;n en investigaci&oacute;n educativa y haber realizado un trabajo de fin de m&aacute;ster con car&aacute;cter investigador en contextos educativos, con un valor equivalente a 10 ECTS.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h5>2. Alumnos que deber&aacute;n realizar complementos de formaci&oacute;n:</h5>\r\n<p>La aceptaci&oacute;n en el programa de los solicitantes que hayan cursado M&aacute;steres distintos a los arriba indicados ser&aacute; decidida por la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado en Educaci&oacute;n en funci&oacute;n de la afinidad del M&aacute;ster cursado con la tem&aacute;tica de este Programa de Doctorado. En caso de que los cr&eacute;ditos cursados en el M&aacute;ster no incluyan perfil y competencias investigadoras, los alumnos deber&aacute;n cursar los complementos de formaci&oacute;n definidos para este programa.</p>\r\n<br />\r\n<p>La admisi&oacute;n en el programa de solicitantes que no est&eacute;n en ninguna de la situaciones definidas en los dos apartados anteriores ser&aacute; decidida por la Comisi&oacute;n Acad&eacute;mica en funci&oacute;n de la adecuaci&oacute;n de la formaci&oacute;n recibida y de su afinidad a la tem&aacute;tica de este programa, siempre que se cumplan los requisitos de acceso establecidos por el RD 99/2011. Los alumnos deber&aacute;n cursar los complementos de formaci&oacute;n definidos para este programa.</p>\r\n<br />\r\n<p>Los candidatos que hayan obtenido el t&iacute;tulo de Doctor/a conforme a anteriores ordenaciones universitarias o que est&eacute;n en posesi&oacute;n del Diploma de Estudios Avanzados obtenido de acuerdo con lo dispuesto en el Real Decreto 778/1998, de 30 de abril, o hubieran alcanzado la suficiencia investigadora regulada en el Real Decreto 185/1985, de 23 de enero, podr&aacute;n ser admitidos directamente o deber&aacute;n cursar los complementos de formaci&oacute;n de estudios de Doctorado que establezca la Comisi&oacute;n Acad&eacute;mica en funci&oacute;n de la adecuaci&oacute;n de los estudios previos realizados.</p>\r\n<br />\r\n<p>Los candidatos en posesi&oacute;n de un t&iacute;tulo universitario de M&aacute;ster obtenido conforme a sistemas educativos extranjeros podr&aacute;n ser admitidos sin necesidad de la homologaci&oacute;n del t&iacute;tulo y previa comprobaci&oacute;n por parte de la Universidad de Sevilla de que acreditan un nivel de formaci&oacute;n equivalente a M&aacute;ster. Estos estudiantes podr&aacute;n ser admitidos directamente o deber&aacute;n cursar los complementos de formaci&oacute;n que establezca la Comisi&oacute;n Acad&eacute;mica.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Los requisitos y criterios de admisi&oacute;n son los establecidos en el perfil de ingreso recomendado.</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curriculum vitae indicando datos personales y profesionales.</li>\r\n<li>Carta aval firmada por el director de la tesis doctoral.</li>\r\n<li>Carta aval firmada por el tutor del doctorando, caso de que el director sea un profesor que no pertenezca al programa de doctorado.</li>\r\n<li>Proyecto de investigaci&oacute;n. Extensi&oacute;n m&aacute;xima 6000 palabras. Esquema: T&iacute;tulo, Resumen, Justificaci&oacute;n, Declaraci&oacute;n de problema, Revisi&oacute;n de literatura relevante; Dise&ntilde;o, Sujetos, Instrumentos, Referencias.li&gt;</li>\r\n<li>Acreditaci&oacute;n nivel B1 de Ingl&eacute;s.</li>\r\n<li>Nota: El/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deber&aacute; incorporar expresamente la nota media num&eacute;rica (Baremo 1-4 por Real Decreto 1267/1994, de 10 de junio o Baremo 0-10 por Real Decreto 1125/2003, de 5 de septiembre)</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>A continuaci&oacute;n, se sintetizan los complementos de formaci&oacute;n en funci&oacute;n de los perfiles que los alumnos deber&aacute;n completar:</p>\r\n<ol>\r\n<li>\r\n<p>Alumnos que hayan cursado el M&aacute;ster en Direcci&oacute;n, Evaluaci&oacute;n y Calidad de Instituciones de Formaci&oacute;n, sin haber cursado materias correspondientes al perfil investigador.</p>\r\n<ul>\r\n<li>\r\n<p>Metodolog&iacute;a para la elaboraci&oacute;n de Trabajo de Investigaci&oacute;n en Educaci&oacute;n (6 ECTS) - Obligatoria</p>\r\n</li>\r\n<li>\r\n<p>Elaboraci&oacute;n y difusi&oacute;n de trabajos de investigaci&oacute;n (4 ECTS) - Obligatoria</p>\r\n</li>\r\n<li>\r\n<p>Trabajo de investigaci&oacute;n (10 ECTS) - Obligatoria</p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Alumnos que hayan cursado el M&aacute;ster en Formaci&oacute;n y Orientaci&oacute;n Profesional para el Empleo, sin haber cursado materias correspondientes al perfil investigador. Deber&aacute;n elegir una de entre las dos materias optativas, as&iacute; como cursar las materias obligatorias:</p>\r\n<ul>\r\n<li>\r\n<p>Investigaci&oacute;n en Formaci&oacute;n profesional (6 ECTS) - Optativa</p>\r\n</li>\r\n<li>\r\n<p>Investigaci&oacute;n en Orientaci&oacute;n Profesional (6 ECTS) - Optativa</p>\r\n</li>\r\n<li>\r\n<p>Trabajo de investigaci&oacute;n (10 ECTS) - Obligatoria</p>\r\n</li>\r\n<li>\r\n<p>Investigaci&oacute;n Diagn&oacute;stico y Evaluaci&oacute;n en la Formaci&oacute;n y Orientaci&oacute;n Profesionales (4 ECTS) - Obligatoria</p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Alumnos que hayan cursado el M&aacute;ster en Actividad F&iacute;sica y Calidad de Vida de Personas Adultas y Mayores, sin haber cursado materias correspondientes al perfil investigador</p>\r\n<ul>\r\n<li>\r\n<p>Investigaci&oacute;n cualitativa en Ciencias de la Actividad F&iacute;sica y el Deporte en Personas Adultas y Mayores (5 ECTS) - Obligatoria</p>\r\n</li>\r\n<li>\r\n<p>Investigaci&oacute;n cuantitativa en Ciencias de la Actividad F&iacute;sica y el Deporte en Personas Adultas y Mayores (5 ECTS) - Obligatoria</p>\r\n</li>\r\n<li>\r\n<p>Trabajo de investigaci&oacute;n (10 ECTS) - Obligatoria</p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Alumnos que hayan cursado cualquier otro M&aacute;ster Oficial vinculado con las Ciencias de la Educaci&oacute;n de universidades espa&ntilde;olas o internacionales sin haber cursado materias correspondientes al perfil investigador.</p>\r\n<ul>\r\n<li>\r\n<p>Metodolog&iacute;a para la elaboraci&oacute;n de Trabajo de Investigaci&oacute;n en Educaci&oacute;n (6 ECTS) - Obligatoria</p>\r\n</li>\r\n<li>\r\n<p>Elaboraci&oacute;n y difusi&oacute;n de trabajos de investigaci&oacute;n (4 ECTS) - Obligatoria</p>\r\n</li>\r\n<li>\r\n<p>Trabajo de investigaci&oacute;n (10 ECTS) - Obligatoria</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ol></div>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaria Facultad de Derecho\",\"telefono\":\"954551214\",\"nombre\":\"Mercedes Verdugo Rasco\",\"email\":\"derecho@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Ángel M. López López\",\"email\":\"doctorado_derecho@us.es\"}\r\n	]}}'),(13,'2014-04-09 09:20:43','3012','doctorado_estudios_filologicos@us.es','http://institucional.us.es/docfilologia/','Estudios Filológicos','2011','LENGUAS EXTRANJERAS','HUMANIDADES','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Para el acceso a este programa oficial de doctorado en Estudios Filol&oacute;gicos (Facultad de Filolog&iacute;a) por la Universidad de Sevilla, ser&aacute; obligatorio estar en posesi&oacute;n del t&iacute;tulo oficial de Grado, o equivalente, y de un M&aacute;ster Universitario relacionado con el &aacute;mbito de las Humanidades.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Criterios de acceso</h4>\r\n<p>Atendiendo a las diversas l&iacute;neas de investigaci&oacute;n que abarca nuestro programa de Doctorado en Estudios Filol&oacute;gicos, los alumnos ser&aacute;n admitidos en una determinada l&iacute;nea de investigaci&oacute;n s&oacute;lo demostrando tener el perfil de ingreso id&oacute;neo, acreditando el dominio de la lengua de la l&iacute;nea de investigaci&oacute;n elegida (nivel B2) y atendiendo a la especificidad tem&aacute;tica de la l&iacute;nea de investigaci&oacute;n que vayan a seguir.</p>\r\n<br />\r\n<ul>\r\n<li>Nivel de estudios: M&aacute;ster oficial o equivalente (DEA, suficiencia investigadora) en Espa&ntilde;a o pa&iacute;s de la UE. Acceso desde m&aacute;steres equivalentes cursados en otras universidades extranjeras avalados por la US</li>\r\n<li>Posibles perfiles de ingresos:\r\n<ul>\r\n<li>Estudios Filol&oacute;gicos</li>\r\n<li>Humanidades</li>\r\n<li>Historia</li>\r\n<li>Arqueolog&iacute;a</li>\r\n<li>Filosof&iacute;a</li>\r\n<li>Ciencias de la Educaci&oacute;n</li>\r\n<li>Comunicaci&oacute;n</li>\r\n<li>Bellas Artes</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<br />\r\n<h4>Criterios de acceso</h4>\r\n<p>(para cuando la demanda supere la oferta)</p>\r\n<ul>\r\n<li>Expediente acad&eacute;mico 35%:\r\n<ul>\r\n<li>Grado o equivalente (ponderado en funci&oacute;n del percentil de la titulaci&oacute;n) 25%</li>\r\n<li>M&aacute;ster oficial o equivalente: 10%.</li>\r\n</ul>\r\n</li>\r\n<li>Estancias internacionales de al menos tres meses para realizar estudios de m&aacute;ster, as&iacute; como conocimiento de idiomas: 15%;</li>\r\n<li>Curr&iacute;culum vitae: 25%</li>\r\n<li>Documento de motivaci&oacute;n y entrevista personal con la comisi&oacute;n de admisi&oacute;n: 25%.</li>\r\n</ul>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>La Comisi&oacute;n Acad&eacute;mica formular&aacute; para cada candidato la necesidad de complementos de formaci&oacute;n.</p>\r\n<br />\r\n<p>De forma gen&eacute;rica y para todos los alumnos extranjeros que su lengua materna no sea hispano hablante, se exigir&aacute; la asistencia, como complemento de formaci&oacute;n espec&iacute;fico, a un curso de espa&ntilde;ol avanzado que cada alumno tendr&aacute; que superar y demostrar a la Comisi&oacute;n Acad&eacute;mica de Doctorado, transcurrido el primer a&ntilde;o de su matr&iacute;cula, bien por el certificado pertinente, bien someti&eacute;ndose a un examen que ser&aacute; llevado a cabo por profesorado experto en la materia. Tendr&aacute;n que adquirir, como m&iacute;nimo, el nivel B2.</p>\r\n<br />\r\n<p>Se establecen como complementos de formaci&oacute;n en el programa expresados seg&uacute;n la l&iacute;nea de investigaci&oacute;n:</p>\r\n<br />\r\n<ul>\r\n<li>L&iacute;nea de investigaci&oacute;n de Literatura espa&ntilde;ola:\r\n<ul>\r\n<li>Para aquellos que el tema de sus tesis vaya a ser el campo de la literatura espa&ntilde;ola de la Edad Media y/o Siglo de Oro, y no puedan demostrar documentalmente que han cursado previamente la materia, tendr&aacute;n que cursar y superar, durante su primer a&ntilde;o acad&eacute;mico, 16 cr&eacute;ditos ECTS en el Master Universitario en Documentos y Libros. Archivos y Bibliotecas (R.D. 1393/07),(Facultad de Geograf&iacute;a e Historia), siendo 8 cr&eacute;ditos de entre sus materias obligatorias y los otros 8 cr&eacute;ditos entre sus optativas.</li>\r\n</ul>\r\n</li>\r\n<li>L&iacute;nea de investigaci&oacute;n: An&aacute;lisis y descripci&oacute;n de la estructura de la lengua espa&ntilde;ola:\r\n<ul>\r\n<li>Para los alumnos de preferencia media y preferencia baja: tendr&aacute;n que realizar 18 cr&eacute;ditos ECTS del &aacute;rea de Lengua Espa&ntilde;ola, en alguno de los m&aacute;steres Estudios Hisp&aacute;nicos Superiores, en Ense&ntilde;anza del Espa&ntilde;ol como Lengua Extranjera o en Traducci&oacute;n e Interpretaci&oacute;n (o similar), en su primer a&ntilde;o de doctorado.</li>\r\n</ul>\r\n</li>\r\n<li>L&iacute;nea de investigaci&oacute;n: Estudios sobre la historia del espa&ntilde;ol:\r\n<ul>\r\n<li>Para los alumnos de preferencia media y preferencia baja: tendr&aacute;n que realizar 18 cr&eacute;ditos del &aacute;rea de Lengua Espa&ntilde;ola, en alguno de los m&aacute;steres Estudios Hisp&aacute;nicos Superiores, en Ense&ntilde;anza del Espa&ntilde;ol como Lengua Extranjera o en Traducci&oacute;n e Interpretaci&oacute;n (o similar), en su primer a&ntilde;o de doctorado.</li>\r\n</ul>\r\n</li>\r\n<li>L&iacute;nea de investigaci&oacute;n: La variaci&oacute;n dialectal y social en la lengua espa&ntilde;ola:\r\n<ul>\r\n<li>Para los alumnos de preferencia media y preferencia baja: tendr&aacute;n que realizar 18 cr&eacute;ditos del &aacute;rea de Lengua Espa&ntilde;ola, en alguno de los m&aacute;steres Estudios Hisp&aacute;nicos Superiores, en Ense&ntilde;anza del Espa&ntilde;ol como Lengua Extranjera o en Traducci&oacute;n e Interpretaci&oacute;n (o similar), en su primer a&ntilde;o de doctorado.</li>\r\n</ul>\r\n</li>\r\n<li>L&iacute;nea de investigaci&oacute;n: An&aacute;lisis del discurso y pragm&aacute;tica del espa&ntilde;ol\r\n<ul>\r\n<li>Para los alumnos de preferencia media y preferencia baja: tendr&aacute;n que realizar 18 cr&eacute;ditos del &aacute;rea de Lengua Espa&ntilde;ola, en alguno de los m&aacute;steres Estudios Hisp&aacute;nicos Superiores, en Ense&ntilde;anza del Espa&ntilde;ol como Lengua Extranjera o en Traducci&oacute;n e Interpretaci&oacute;n (o similar), en su primer a&ntilde;o de doctorado.</li>\r\n</ul>\r\n</li>\r\n</ul>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954551495\",\"nombre\":\"Milagros Martín\",\"email\":\"filologia@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"José María Candau Morón\",\"email\":\"vicplanffl@us.es\"}\r\n	]}}'),(14,'2014-04-09 09:20:55','3013','doctoradofarmacia@us.es','http://www.farmacia.us.es/doctorado','Farmacia','2011','FARMACIA','SALUD','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El perfil del estudiante que acceder&aacute; al programa se encuentra en aquellos que hayan cursado titulaciones de Grado de las &aacute;reas de Ciencias de la Salud o de Ciencias de la Vida. Asimismo, algunas l&iacute;neas de investigaci&oacute;n concretas pueden presentar inter&eacute;s espec&iacute;fico para otras titulaciones.</p>\r\n<br />\r\n<p>Las v&iacute;as de acceso de los estudiantes se pueden resumir en los siguientes perfiles de acceso:</p>\r\n<br />\r\n<h5>Perfil 1: Licenciados en Farmacia con M&aacute;ster</h5>\r\n<p>M&aacute;ster con acceso directo: M&aacute;ster Universitario en Atenci&oacute;n Farmac&eacute;utica y Farmacia Asistencial, M&aacute;ster Universitario en Ciencia y Tecnolog&iacute;a Farmac&eacute;utica y Uso Racional del Medicamento y M&aacute;ster Universitario de Especializaci&oacute;n Profesional en Farmacia.</p>\r\n<p>Estudiantes que cursen otros M&aacute;ster con contenidos formativos similares en particular en metodolog&iacute;as de investigaci&oacute;n en el &aacute;rea, tambi&eacute;n tendr&iacute;an acceso directo. La adecuaci&oacute;n de esos t&iacute;tulos ser&aacute; evaluada por la Comisi&oacute;n teniendo en cuenta los contenidos y su adecuaci&oacute;n a las l&iacute;neas de investigaci&oacute;n.</p>\r\n<br />\r\n<h5>Perfil 2: Graduados en Farmacia</h5>\r\n<p>Los Graduados en Farmacia, con 300 ECTS y una vez se confirme que el t&iacute;tulo contiene 60 ECTS de nivel M&aacute;ster, podr&aacute;n tener acceso al programa.</p>\r\n<p>En aquellos t&iacute;tulos de Grado en Farmacia con 300 ECTS que no contengan 60 ECTS de nivel M&aacute;ster, el estudiante habr&aacute; de cursar complementos de Formaci&oacute;n dentro de la oferta formativa del M&aacute;ster Universitario de Especializaci&oacute;n Profesional en Farmacia. La Comisi&oacute;n Acad&eacute;mica evaluar&aacute; cuales ser&aacute;n las materias m&aacute;s adecuadas en funci&oacute;n de la formaci&oacute;n previa del estudiante incluyendo siempre el Trabajo Fin de M&aacute;ster.</p>\r\n<br />\r\n<h5>Perfil 3: Estudiantes que han superado dos a&ntilde;os de evaluaci&oacute;n positiva de formaci&oacute;n sanitaria especializada</h5>\r\n<p>Residentes de Farmacia (F.I.R.) que hayan superado dos a&ntilde;os de evaluaci&oacute;n positiva de formaci&oacute;n sanitaria y que ser&aacute;n considerados estudiantes con dedicaci&oacute;n a tiempo parcial mientras contin&uacute;en su residencia.</p>\r\n<br />\r\n<h5>Perfil 4: Otras titulaciones de Ciencias de la Salud y Ciencias de la Vida de 240 ECTS seguidas de M&aacute;ster.</h5>\r\n<p>Estudiantes con Grados 240 ECTS o Licenciaturas/Diplomaturas de Ciencias de la Salud y Ciencias de la vida: Enfermer&iacute;a, &Oacute;ptica y Optometr&iacute;a, Biomedicina, Odontolog&iacute;a, Nutrici&oacute;n y Diet&eacute;tica, Ciencia y Tecnolog&iacute;a de Alimentos, Bioqu&iacute;mica, Biolog&iacute;a, Biotecnolog&iacute;a y otros, deber&aacute;n cursar una M&aacute;ster Universitario que les habilite para el acceso a estudios de Doctorado y con contenidos formativos similares en metodolog&iacute;as de investigaci&oacute;n &uacute;tiles en el &aacute;rea (como M&aacute;ster Universitario de Estudios Avanzados en Qu&iacute;mica o M&aacute;ster Universitario en Investigaci&oacute;n Biom&eacute;dica, entre otros). La Comisi&oacute;n Acad&eacute;mica evaluar&aacute; cu&aacute;les son las l&iacute;neas de investigaci&oacute;n a las que se adecua m&aacute;s su formaci&oacute;n previa y la adecuaci&oacute;n del M&aacute;ster Universitario a las l&iacute;neas del Programa de Doctorado.</p>\r\n<br />\r\n<h5>Perfil 5: Graduados en Medicina y Veterinaria.</h5>\r\n<p>T&iacute;tulos con 300 o m&aacute;s ECTS que si contienen 60 ECTS de nivel M&aacute;ster pueden acceder al Doctorado en Farmacia. En el caso de que no contengan 60 ECTS de nivel M&aacute;ster, el estudiante habr&aacute; de cursar complementos de formaci&oacute;n dentro de la oferta formativa del M&aacute;ster Universitario de Especializaci&oacute;n Profesional en Farmacia. La Comisi&oacute;n Acad&eacute;mica evaluar&aacute; cuales ser&aacute;n las materias m&aacute;s adecuadas en funci&oacute;n de la formaci&oacute;n previa del estudiante incluyendo siempre el Trabajo Fin de M&aacute;ster. La Comisi&oacute;n Acad&eacute;mica evaluar&aacute; cu&aacute;les son las l&iacute;neas de investigaci&oacute;n a las que se adecua su formaci&oacute;n previa.</p>\r\n<br />\r\n<h5>Perfil 6: Titulaciones de otras Ramas del Conocimiento.</h5>\r\n<p>Estudiantes del Grado en Criminolog&iacute;a con M&aacute;ster Universitario en Ciencias Forenses.</p>\r\n<p>Su admisi&oacute;n quedar&aacute; condicionada al informe previo de la Comisi&oacute;n Acad&eacute;mica, pudiendo ser necesario el cursar complementos de formaci&oacute;n en funci&oacute;n de los contenidos espec&iacute;ficos del M&aacute;ster cursado y ser&iacute;an admitidos en la l&iacute;nea de Investigaci&oacute;n de Toxicolog&iacute;a.</p>\r\n<br />\r\n<h5>Perfil 7: Estudiantes con t&iacute;tulos de sistemas educativos extranjeros.</h5>\r\n<p>Requerir&aacute;n una evaluaci&oacute;n de la adecuaci&oacute;n de su titulaci&oacute;n por la Comisi&oacute;n Acad&eacute;mica y podr&iacute;a requerir la realizaci&oacute;n de complementos de formaci&oacute;n.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Criterios de admisi&oacute;n</h4>\r\n<p>La valoraci&oacute;n de los m&eacute;ritos de los estudiantes se basar&aacute; en los principios de equidad y calidad, teniendo en cuenta los siguientes m&eacute;ritos:</p>\r\n<ul>\r\n<li>\r\n<p>Expediente acad&eacute;mico del solicitante</p>\r\n</li>\r\n<li>\r\n<p>Experiencia previa en programas de inicio a la investigaci&oacute;n (becas de colaboraci&oacute;n o similares) o publicaciones previas.</p>\r\n</li>\r\n<li>\r\n<p>Conocimiento de idiomas</p>\r\n</li>\r\n<li>\r\n<p>Titulaci&oacute;n cursada y formaci&oacute;n previa, que condicionar&iacute;a la asignaci&oacute;n del estudiante a la l&iacute;nea de investigaci&oacute;n m&aacute;s adecuada a su perfil. Se priorizar&aacute; la admisi&oacute;n de estudiantes con formaci&oacute;n farmac&eacute;utica.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4>Baremo de ponderaci&oacute;n</h4>\r\n<p>Sobre una puntuaci&oacute;n m&aacute;xima de 10 puntos:</p>\r\n<ul>\r\n<li>\r\n<p>Expediente acad&eacute;mico (Valoraci&oacute;n m&aacute;x. 6 puntos)</p>\r\n</li>\r\n<li>\r\n<p>Experiencia previa investigadora acreditada (Valoraci&oacute;n m&aacute;x. 1 punto)</p>\r\n</li>\r\n<li>\r\n<p>Conocimiento de idiomas, valorando al m&aacute;ximo un nivel B2 (Valoraci&oacute;n m&aacute;x. 1 punto)</p>\r\n</li>\r\n<li>\r\n<p>Perfil de acceso:</p>\r\n<ul>\r\n<li>Perfiles 1, 2 y 3 - 1 punto</li>\r\n<li>Perfil 4 y 5 - 0,8 puntos</li>\r\n<li>Perfil 6 - 0,6 puntos</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Existencia de beca o contrato de investigaci&oacute;n ligado a un profesor del programa (Valoraci&oacute;n m&aacute;x. 1 punto)</p>\r\n</li>\r\n</ul>\r\n<p>Los estudiantes extranjeros (perfil 7), ser&aacute;n evaluados por la comisi&oacute;n acad&eacute;mica en funci&oacute;n de sus titulaciones de origen y agrup&aacute;ndolos en una de las tres subcategor&iacute;as.</p>\r\n<p>&nbsp;</p>\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito. En la carta el candidato debe exponer sus preferencias por las l&iacute;neas de investigaci&oacute;n del programa y por los equipos que lo integran.</li>\r\n<li>Documentos que acrediten los m&eacute;ritos espec&iacute;ficamente valorados en el acceso (conocimiento de idiomas y beca o contrato de investigaci&oacute;n ligado a un profesor del programa).</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Consistir&aacute;n en 18 ECTS dentro de la oferta de M&aacute;ster de la Faculta de Farmacia de la Universidad de Sevilla, y comprender&aacute;n materias relacionadas con el desarrollo de competencias de investigaci&oacute;n (Trabajo Fin de M&aacute;ster, Metodolog&iacute;a de Investigaci&oacute;n...).</p>\r\n<p>Estos complementos formativos deber&iacute;an ser cursados por:</p>\r\n<ul>\r\n<li>Estudiantes con t&iacute;tulos de sistemas educativos extranjeros que tras evaluar la adecuaci&oacute;n de su titulaci&oacute;n por la Comisi&oacute;n Acad&eacute;mica fuera considerado necesario realizar determinados complementos.</li>\r\n<li>Estudiantes de titulaciones de Ciencias de la Salud o Ciencias de la Vida con 300 ECTS o m&aacute;s que no contaran con el reconocimiento de 60 ECTS de competencias de Nivel M&aacute;ster.</li>\r\n</ul>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de la Facultad de Farmacia\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Juan Bautista Palomas\",\"email\":\"jdbaut@us.es\"}\r\n	,{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"María Álvarez de Sotomayor Paz\",\"email\":\"aldesoto@us.es\"}\r\n    ,{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"doctoradofarmacia@us.es\"}\r\n	]}}'),(15,'2014-04-09 09:21:05','3014','doctorado_filosofia@us.es','docfilus.wordpress.com','Filosofía','2011','FILOSOFÍA Y ÉTICA','HUMANIDADES','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El objetivo general del programa de doctorado en Filosof&iacute;a es el de formar investigadores de nivel avanzado, con una s&oacute;lida formaci&oacute;n especializada tanto en contenidos como en m&eacute;todos y t&eacute;cnicas de investigaci&oacute;n en los distintos &aacute;mbitos filos&oacute;ficos. Por ese motivo, se cuenta con una formaci&oacute;n previa del alumnado, que permita en un periodo de tiempo razonable la adquisici&oacute;n de estas habilidades.</p>\r\n<br />\r\n<p>Con car&aacute;cter general, los alumnos de nueva inscripci&oacute;n habr&aacute;n de contar con una formaci&oacute;n equivalente a un M&aacute;ster en Filosof&iacute;a o &aacute;reas afines (ver una enumeraci&oacute;n de m&aacute;steres de acceso en el perfil 1 del apartado siguiente). S&oacute;lo excepcionalmente se considerar&aacute; a candidatos provenientes de otros estudios de posgrado (ver perfil 3).</p>\r\n<br />\r\n<p>Entre las caracter&iacute;sticas personales de los estudiantes, se recomienda la posesi&oacute;n de un alto grado de inter&eacute;s por el pensamiento filos&oacute;fico, capacidad de lectura de textos filos&oacute;ficos y literarios complejos, capacidad cr&iacute;tica y de enjuiciamiento, destrezas de expresi&oacute;n, tanto orales como escritas, y conocimientos avanzados de la filosof&iacute;a y de la cultura moderna en general. Se espera de ellos un conocimiento detallado de la historia de la disciplina y del contexto en que se desarrollan sus debates contempor&aacute;neos, y que hayan adquirido las competencias b&aacute;sicas para el desarrollo de una investigaci&oacute;n original y relevante en el &aacute;mbito de la filosof&iacute;a.</p>\r\n<br />\r\n<p>Es imprescindible el dominio del castellano oral y escrito, en el cu&aacute;l tendr&aacute; lugar la tutela y direcci&oacute;n de la tesis, as&iacute; como la mayor&iacute;a de las actividades acad&eacute;micas ligadas al programa. Adicionalmente, se espera del alumno que tenga un conocimiento medio-avanzado (nivel B1 seg&uacute;n el MCERL) de al menos una de las lenguas m&aacute;s habituales de la comunidad cient&iacute;fica internacional (ingl&eacute;s, franc&eacute;s, alem&aacute;n o italiano). En funci&oacute;n de la tem&aacute;tica de su investigaci&oacute;n, la comisi&oacute;n acad&eacute;mica podr&aacute; requerir a cada candidato la acreditaci&oacute;n del conocimiento de las lenguas antiguas y/o modernas que sean precisas para la realizaci&oacute;n de su proyecto.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<br />\r\n<h4>Perfiles de acceso</h4>\r\n<p>Se determinan tres perfiles distintos de acceso, en funci&oacute;n de la formaci&oacute;n previa de los solicitantes.</p>\r\n<br />\r\n<h5>(PERFIL 1) Posgraduados en m&aacute;steres del &aacute;rea de filosof&iacute;a.</h5>\r\n<p>Habr&aacute;n de acreditar la posesi&oacute;n de uno de los m&aacute;steres siguientes, u otros que la Comisi&oacute;n Acad&eacute;mica estime equivalentes:</p>\r\n<ul>\r\n<li>M&aacute;ster Universitario en Filosof&iacute;a y Cultura Moderna (Universidad de Sevilla).</li>\r\n<li>M&aacute;ster Universitario en Filosof&iacute;a Contempor&aacute;nea (Universidad de Granada).</li>\r\n<li>M&aacute;ster Universitario en Filosof&iacute;a Te&oacute;rica y Pr&aacute;ctica (UNED).</li>\r\n<li>M&aacute;ster Universitario en Pensamiento Espa&ntilde;ol e Iberoamericano (Universidad Complutense de Madrid).</li>\r\n<li>M&aacute;ster Siglo XXI: Filosof&iacute;a y Ciencias Sociales (Universidad Complutense de Madrid)</li>\r\n<li>M&aacute;ster Universitario en Estudios Avanzados de Filosof&iacute;a (Universidad de Valladolid).</li>\r\n<li>M&aacute;ster de Filosof&iacute;a y Estudios Cl&aacute;sicos (Universidad de Barcelona).</li>\r\n<li>M&aacute;ster en Pensamiento Contempor&aacute;neo (Universidad de Barcelona).</li>\r\n<li>M&aacute;ster de Filosof&iacute;a Anal&iacute;tica (Universidad de Barcelona).</li>\r\n<li>M&aacute;ster Universitario en Filosof&iacute;a Contempor&aacute;nea: Tendencias y Debates (Universidad Aut&oacute;noma de Barcelona).</li>\r\n<li>M&aacute;ster Universitario en Filosof&iacute;a (Universidad de Pamplona).</li>\r\n<li>M&aacute;ster Universitario en Filosof&iacute;a Contempor&aacute;nea (Universidad de las Islas Baleares).</li>\r\n<li>M&aacute;ster en L&oacute;gica y Filosof&iacute;a de la Ciencia (Universidad de La Laguna).</li>\r\n<li>M&aacute;ster en Filosof&iacute;a Pr&aacute;ctica (Universidad de Gerona).</li>\r\n<li>M&aacute;ster en Filosof&iacute;a en un mundo global (Universidad del Pa&iacute;s Vasco).</li>\r\n</ul>\r\n<p>En ning&uacute;n caso podr&aacute;n ser admitidos dentro de este perfil aquellos estudiantes que accedan al programa estando en posesi&oacute;n &uacute;nicamente de un t&iacute;tulo de graduado o graduada de 300 ECTS o m&aacute;s que no incluya cr&eacute;ditos de investigaci&oacute;n en su plan de estudios.</p>\r\n<br />\r\n<h5>(PERFIL 2) Posgraduados en m&aacute;steres de disciplinas afines.</h5>\r\n<p>Se considerar&aacute; dentro de este perfil a candidatos que hayan cursado un m&aacute;ster en disciplinas de car&aacute;cter human&iacute;stico (Ense&ntilde;anza Secundaria, Filolog&iacute;a, Historia, Geograf&iacute;a, Traducci&oacute;n, Humanidades, Estudios Culturales, etc.).</p>\r\n<br />\r\n<h5>(PERFIL 3) Posgraduados en m&aacute;steres de otras disciplinas.</h5>\r\n<p>En casos excepcionales, la Comisi&oacute;n Acad&eacute;mica podr&aacute; admitir candidatos procedentes de otros m&aacute;steres, apoyados en la especial afinidad del proyecto propuesto con alguna de las l&iacute;neas de investigaci&oacute;n del Programa.</p>\r\n<br /> <br />\r\n<h4>Requisitos y pruebas adicionales</h4>\r\n<p>La selecci&oacute;n y aceptaci&oacute;n de candidatos al Programa la llevar&aacute; a cabo la Comisi&oacute;n Acad&eacute;mica del mismo.</p>\r\n<br />\r\n<p>Los solicitantes habr&aacute;n de presentar su solicitud de aceptaci&oacute;n acompa&ntilde;ada de su curr&iacute;culum vitae y un breve proyecto de trabajo avalado por el visto bueno de un profesor del programa, que actuar&aacute; como su tutor.</p>\r\n<br />\r\n<p>La selecci&oacute;n entre los solicitantes se llevar&aacute; a cabo tomando en consideraci&oacute;n los siguientes criterios:</p>\r\n<br />\r\n<ul>\r\n<li>Afinidad de la titulaci&oacute;n acreditada para acceder al Programa.</li>\r\n<li>Expediente acad&eacute;mico en los estudios de Grado y M&aacute;ster.</li>\r\n<li>Relevancia y actualidad del proyecto de trabajo.</li>\r\n<li>Adecuaci&oacute;n del proyecto a alguna de las l&iacute;neas de investigaci&oacute;n del Programa.</li>\r\n<li>Conocimiento acreditado de idiomas relevantes para la investigaci&oacute;n.</li>\r\n<li>Experiencia previa en labores de investigaci&oacute;n.</li>\r\n</ul>\r\n<br />\r\n<p>La principal prueba de admisi&oacute;n ser&aacute; el estudio y valoraci&oacute;n del proyecto del solicitante y su curriculum aunque, en caso de estimarlo conveniente, la Comisi&oacute;n podr&aacute; concertar una entrevista oral con el solicitante a fin de aclarar aspectos de su formaci&oacute;n y/o su proyecto.</p>\r\n<br />\r\n<h4>Baremo de ponderaci&oacute;n</h4>\r\n<ul>\r\n<li>Criterio 1: Afinidad de la titulaci&oacute;n: hasta 20 puntos.</li>\r\n<li>Criterio 2: Expediente acad&eacute;mico: hasta 20 puntos.</li>\r\n<li>Criterio 3: Relevancia y actualidad del proyecto: hasta 20 puntos.</li>\r\n<li>Criterio 4: Adecuaci&oacute;n del proyecto a alguna l&iacute;nea del Programa: hasta 20 puntos.</li>\r\n<li>Criterio 5: Conocimiento de idiomas: hasta 10 puntos.</li>\r\n<li>Criterio 6: Experiencia previa: hasta 10 puntos.</li>\r\n</ul>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n<li>Breve proyecto de trabajo avalado por el visto bueno de un profesor del programa, que actuar&aacute; como su tutor.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>El programa contempla la posibilidad de exigir a los estudiantes la realizaci&oacute;n de complementos de formaci&oacute;n, que corresponder&aacute;n &uacute;nicamente a cr&eacute;ditos ECTS del M&aacute;ster Universitario Oficial en Filosof&iacute;a y Cultura Moderna de la Universidad de Sevilla. Tales complementos tendr&aacute;n un c&oacute;mputo m&aacute;ximo de 18 ECTS en cr&eacute;ditos de investigaci&oacute;n (excepcionalmente, se podr&aacute; llegar a 24 ECTS cuando las exigencias del plan formativo del M&aacute;ster lo requieran, v&eacute;ase el caso de los Trabajos Fin de M&aacute;ster).</p>\r\n<br />\r\n<p>En funci&oacute;n de los perfiles de ingreso establecidos, los estudiantes habr&aacute;n de cursar los siguientes Complementos de Formaci&oacute;n:</p>\r\n<br />\r\n<h5>(PERFIL 1) Posgraduados en m&aacute;steres del &aacute;rea de filosof&iacute;a.</h5>\r\n<p>Estos estudiantes estar&aacute;n exentos de la obligaci&oacute;n de cursar complementos de formaci&oacute;n.</p>\r\n<br />\r\n<h5>(PERFIL 2) Posgraduados en m&aacute;steres de disciplinas afines.</h5>\r\n<p>La Comisi&oacute;n Acad&eacute;mica podr&aacute; exigir al candidato que curse hasta un m&aacute;ximo de 18 cr&eacute;ditos en asignaturas del M&aacute;ster en Filosof&iacute;a y Cultura Moderna de la Facultad de Filosof&iacute;a de la Universidad de Sevilla, en funci&oacute;n de su formaci&oacute;n previa y el proyecto de investigaci&oacute;n presentado.</p>\r\n<br />\r\n<h5>(PERFIL 3) Posgraduados en m&aacute;steres de otras disciplinas.</h5>\r\n<p>La Comisi&oacute;n Acad&eacute;mica podr&aacute; exigir excepcionalmente hasta un m&aacute;ximo de 24 cr&eacute;ditos en asignaturas del M&aacute;ster en Filosof&iacute;a y Cultura Moderna de la Facultad de Filosof&iacute;a de la Universidad de Sevilla, en funci&oacute;n de la formaci&oacute;n previa de cada candidato y el proyecto de investigaci&oacute;n presentado.</p>\r\n<br />\r\n<p>Podr&aacute;n formar parte de dichos cr&eacute;ditos, a juicio de la Comisi&oacute;n Acad&eacute;mica, la elaboraci&oacute;n de un trabajo de iniciaci&oacute;n a la investigaci&oacute;n que computar&aacute; como Trabajo de Fin de M&aacute;ster.</p>\r\n<br />\r\n<p>Tales complementos deben estar ligados a cr&eacute;ditos de investigaci&oacute;n, y tendr&aacute;n car&aacute;cter obligatorio para aquellos estudiantes que acceden al programa estando en posesi&oacute;n &uacute;nicamente de un t&iacute;tulo de graduado o graduada de 300 ECTS o m&aacute;s que no incluya cr&eacute;ditos de investigaci&oacute;n en su plan de estudios.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría del Centro (planta baja)\",\"telefono\":\"954551617\",\"nombre\":\"Manuel Zamora\",\"email\":\"psalufil@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954551677\",\"nombre\":\"Manuel Barrios Casares\",\"email\":\"\"}\r\n	]}}'),(16,'2014-04-09 09:21:15','3015','doctorado_geografia@us.es','http://institucional.us.es/doctorgeografia/','Geografía','2011','HUMANIDADES','CIENCIAS SOCIALES Y DEL COMPORTAMIENTO','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El perfil ideal de los doctorandos que se inscriban en el Programa de Doctorado de Geograf&iacute;a se corresponder&aacute; con los alumnos procedentes de los Grados de Geograf&iacute;a, Ciencias Ambientales, Turismo, Arquitectura, Ingenier&iacute;as, Ciencias Biol&oacute;gicas, Sociolog&iacute;a, Econom&iacute;a, Psicolog&iacute;a, as&iacute; como el M&aacute;ster Universitario de Ordenaci&oacute;n y Gesti&oacute;n del Desarrollo Territorial y Local, o cualquier otro con contenidos y aspectos metodol&oacute;gicos y t&eacute;cnicos similares a &eacute;ste.</p>\r\n<br /><ol type=\"a\">\r\n<li>\r\n<p>Capacidades. Los alumnos inscritos en el Programa de Doctorado de Geograf&iacute;a deber&aacute;n ya poseer las siguientes capacidades generales:</p>\r\n<ul>\r\n<li>Resoluci&oacute;n de problemas y toma de decisiones</li>\r\n<li>Evaluaci&oacute;n e interpretaci&oacute;n de resultados complejos</li>\r\n<li>An&aacute;lisis y s&iacute;ntesis</li>\r\n<li>Relacionar hechos, fen&oacute;menos y procesos en la investigaci&oacute;n</li>\r\n<li>Aplicaci&oacute;n de la teor&iacute;a a la pr&aacute;ctica</li>\r\n<li>Creatividad</li>\r\n<li>Habilidades de investigaci&oacute;n</li>\r\n<li>Realizaci&oacute;n de trabajo de campo y obtenci&oacute;n de conocimiento directo del territorio</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Conocimientos previos: Metodolog&iacute;as y t&eacute;cnicas investigadoras (t&eacute;cnicas multivariantes, cartogr&aacute;ficas y Sistemas de Informaci&oacute;n Geogr&aacute;fica).</p>\r\n</li>\r\n<li>\r\n<p>Lengua de uso y nivel exigido: Adem&aacute;s del espa&ntilde;ol, conocimiento de ingl&eacute;s (nivel B1 umbral).</p>\r\n</li>\r\n<li>\r\n<p>Capacidades espec&iacute;ficas del &aacute;rea del programa de Geograf&iacute;a:</p>\r\n<ul>\r\n<li>Trabajo con las principales t&eacute;cnicas estad&iacute;sticas multivariantes y su complementariedad con las estad&iacute;sticas descriptivas</li>\r\n<li>Gesti&oacute;n de las t&eacute;cnicas y sistemas de informaci&oacute;n geogr&aacute;fica</li>\r\n<li>Conocimiento de los conceptos esenciales y de las fuentes para la gesti&oacute;n del territorio y sus riesgos naturales</li>\r\n<li>An&aacute;lisis, interpretaci&oacute;n y gesti&oacute;n del medio f&iacute;sico</li>\r\n<li>Explicaci&oacute;n de las relaciones que gestionan y mantienen la interconexi&oacute;n territorio, recursos y patrimonio</li>\r\n<li>Conocimiento, an&aacute;lisis e interpretaci&oacute;n de los procesos de innovaci&oacute;n, gesti&oacute;n tecnol&oacute;gica y de aprendizaje de la empresa</li>\r\n<li>Metodolog&iacute;as de an&aacute;lisis de redes</li>\r\n<li>Trabajo con las metodolog&iacute;as de an&aacute;lisis y las herramientas de gesti&oacute;n en el desarrollo rural y urbano</li>\r\n<li>An&aacute;lisis e interpretaci&oacute;n de los sistemas tur&iacute;sticos</li>\r\n<li>Aplicaci&oacute;n de los conceptos fundamentales en materia de ordenaci&oacute;n del territorio, planeamiento urbano y acci&oacute;n p&uacute;blica</li>\r\n<li>Aplicaci&oacute;n de los fundamentos de la gesti&oacute;n de recursos naturales costeros y de las pol&iacute;ticas del litoral</li>\r\n<li>Combinaci&oacute;n de las dimensiones temporal y espacial en la explicaci&oacute;n de procesos socioterritoriales</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<br />\r\n<h4>Requisitos de acceso</h4>\r\n<ol>\r\n<li>\r\n<p>Con car&aacute;cter general, para el acceso al programa oficial de doctorado de Geograf&iacute;a ser&aacute; necesario estar en posesi&oacute;n del T&iacute;tulo oficial de Grado en Geograf&iacute;a y Gesti&oacute;n del Territorio y de un T&iacute;tulo oficial de M&aacute;ster Universitario.</p>\r\n</li>\r\n<li>\r\n<p>Asimismo podr&aacute;n acceder quienes cumplan alguno de los siguientes requisitos:</p>\r\n<ol type=\"a\">\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol, o de otro pa&iacute;s integrante del Espacio Europeo de Educaci&oacute;n Superior, que habilite para el acceso a M&aacute;ster de acuerdo con lo establecido en el art&iacute;culo 16 del Real Decreto 1393/2007, de 29 de octubre y haber superado un m&iacute;nimo de 300 cr&eacute;ditos ECTS en el conjunto de estudios universitarios oficiales, de los que, al menos 60, habr&aacute;n de ser de nivel de M&aacute;ster</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Graduado en las posibilidades recogidas en el Perfil Espec&iacute;fico, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 cr&eacute;ditos ECTS. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n, salvo que el plan de estudios del correspondiente t&iacute;tulo de grado incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudios de M&aacute;ster en Geograf&iacute;a.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologaci&oacute;n, previa comprobaci&oacute;n por la universidad de que &eacute;ste acredita un nivel de formaci&oacute;n equivalente al de t&iacute;tulo oficial espa&ntilde;ol de M&aacute;ster Universitario y que faculta en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a estudios de doctorado. Esta admisi&oacute;n no implicar&aacute;, en ning&uacute;n caso, la homologaci&oacute;n del t&iacute;tulo previo del que est&eacute; en posesi&oacute;n el interesado ni su reconocimiento a otros efectos que el de cursar ense&ntilde;anzas de Doctorado. El t&iacute;tulo de Doctor as&iacute; obtenido tendr&aacute; plena validez en Espa&ntilde;a.</p>\r\n</li>\r\n<li>\r\n<p>Podr&aacute;n ser admitidos a los estudios de doctorado conforme al RD 99/2011, los licenciados, arquitectos o ingenieros que estuvieran en posesi&oacute;n del Diploma de Estudios Avanzados obtenido de acuerdo con lo dispuesto en el Real Decreto 778/1998, de 30 de abril, o hubieran alcanzado la suficiencia investigadora regulada en el Real Decreto 185/1985, de 23 de enero.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor obtenido conforme a anteriores ordenaciones universitarias.</p>\r\n</li>\r\n</ol></li>\r\n</ol><br />\r\n<h4>Criterios de admisi&oacute;n generales</h4>\r\n<ol>\r\n<li>\r\n<p>Presentaci&oacute;n de solicitud de admisi&oacute;n al programa de doctorado durante el per&iacute;odo establecido.</p>\r\n</li>\r\n<li>\r\n<p>El doctorando elegir&aacute; la l&iacute;nea de investigaci&oacute;n y el director/tutor o directores de la tesis cumplimentando una solicitud dirigida a la comisi&oacute;n Acad&eacute;mica del Programa. Dicha elecci&oacute;n podr&aacute; recaer sobre cualquier doctor, con experiencia investigadora acreditada. Cualquier doctor sin experiencia investigadora acreditada podr&aacute; actuar como codirector siempre que otro codirector sea un doctor con experiencia investigadora acreditada.</p>\r\n</li>\r\n<li>\r\n<p>El doctorando, en los t&eacute;rminos indicados por el art. 10.3 de la Normativa de doctorado de la Universidad de Sevilla, quedar&aacute; adscrito al departamento de su tutor/director/es.</p>\r\n</li>\r\n<li>\r\n<p>Tras la admisi&oacute;n al programa de doctorado de Geograf&iacute;a, el alumno formalizar&aacute; su matr&iacute;cula a tiempo completo o a tiempo parcial, en la unidad responsable de la gesti&oacute;n de los estudios de doctorado de la Universidad de Sevilla. Todo ello en los t&eacute;rminos y plazos establecidos en la correspondiente convocatoria. A tal efecto el estudiante debe cumplir los requisitos establecidos y adjuntar la documentaci&oacute;n acreditativa.</p>\r\n</li>\r\n<li>\r\n<p>Una vez matriculado, el doctorando elaborara un Plan de investigaci&oacute;n asesorado por el Director/tutor que tendr&aacute; que presentar a la Comisi&oacute;n Acad&eacute;mica a partir del nombramiento del director/tutor.</p>\r\n</li>\r\n</ol><br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>\r\n<p>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato, con la siguiente estructura de contenidos:</p>\r\n<ol>\r\n<li>Datos Generales (Nombre, DNI, fecha de nacimiento, direcci&oacute;n, tel&eacute;fono, e-mail</li>\r\n<li>Experiencia investigadora<ol>\r\n<li>Publicaci&oacute;n de art&iacute;culos en revistas cient&iacute;ficas de prestigio reconocido (JCR del Science Citation Index)</li>\r\n<li>Publicaci&oacute;n de libros o cap&iacute;tulos de libros</li>\r\n<li>Participaci&oacute;n en proyectos de investigaci&oacute;n obtenidos en convocatorias p&uacute;blicas y competitivas, en especial los financiados mediante programas nacionales, europeos u otros de &aacute;mbito internacional y/o contratos de investigaci&oacute;n con empresas o con la administraci&oacute;n p&uacute;blica.</li>\r\n<li>Contribuciones presentadas en Congresos, conferencias, seminarios u otros tipos de reuniones de relevancia cient&iacute;fica.</li>\r\n<li>Otros m&eacute;ritos de investigaci&oacute;n no contemplados en los apartados anteriores</li>\r\n</ol></li>\r\n<li>Formaci&oacute;n acad&eacute;mica, experiencia docente y profesional.<ol>\r\n<li>Formaci&oacute;n acad&eacute;mica</li>\r\n<li>Estancias de car&aacute;cter investigador y/o formativo en centros de investigaci&oacute;n.</li>\r\n<li>Experiencia docente</li>\r\n<li>Experiencia profesional</li>\r\n<li>Otros m&eacute;ritos</li>\r\n</ol></li>\r\n</ol></li>\r\n<li>\r\n<p>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito (esta carta servir&aacute; de presentaci&oacute;n del candidato a doctorando ante la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado). En ella se puede indicar los motivos que mueven al alumno a cursar este Programa, la afinidad de su trayectoria formativa y/o profesional con la tem&aacute;tica a investigar, o las expectativas laborales y personales que este Programa le suscita.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Los complementos de formaci&oacute;n previstos en el programa de doctorado de Geograf&iacute;a ser&aacute;n fijados en el seno de un M&aacute;ster Universitario Oficial de la oferta de la Universidad de Sevilla y tendr&aacute;n un m&aacute;ximo de 18 ECTS en cr&eacute;ditos de investigaci&oacute;n de acuerdo con las siguientes situaciones:</p>\r\n<ol type=\"a\"><ol type=\"a\">\r\n<li>\r\n<p>Estando en posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol, o de otro pa&iacute;s integrante del Espacio Europeo de Educaci&oacute;n Superior, que habilite para el acceso a M&aacute;ster de acuerdo con lo establecido en el art&iacute;culo 16 del Real Decreto 1393/2007, de 29 de octubre y haber superado un m&iacute;nimo de 300 cr&eacute;ditos ECTS en el conjunto de estudios universitarios oficiales, de los que, al menos 60, habr&aacute;n de ser de nivel de M&aacute;ster oficial, ser&aacute; necesario cursar los complementos de formaci&oacute;n siguientes: Elaboraci&oacute;n de tesis doctorales y art&iacute;culos cient&iacute;ficos (2 ECTC), Tratamiento de datos (3 ECTS), T&eacute;cnicas para la investigaci&oacute;n cualitativa (2 ECTS), Participaci&oacute;n en congresos y jornadas (3 participaciones m&iacute;nimo).</p>\r\n</li>\r\n<li>\r\n<p>Estando en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Graduado, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 cr&eacute;ditos ECTS. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n expresados en el apartado a) m&aacute;s T&eacute;cnicas multivariantes (3 ECTS) y Fuentes de informaci&oacute;n territorial e introducci&oacute;n a los SIG (3 ECTS).</p>\r\n</li>\r\n<li>\r\n<p>Estando en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologaci&oacute;n, previa comprobaci&oacute;n por la universidad de que &eacute;ste acredita un nivel de formaci&oacute;n equivalente al de t&iacute;tulo oficial espa&ntilde;ol de M&aacute;ster Universitario y que faculta en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a estudios de doctorado. Esta admisi&oacute;n no implicar&aacute;, en ning&uacute;n caso, la homologaci&oacute;n del t&iacute;tulo previo del que est&eacute; en posesi&oacute;n el interesado ni su reconocimiento a otros efectos que el de cursar ense&ntilde;anzas de Doctorado. El t&iacute;tulo de Doctor as&iacute; obtenido tendr&aacute; plena validez en Espa&ntilde;a. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n expresados en el apartado a).</p>\r\n</li>\r\n<li>\r\n<p>Pudiendo ser admitidos a los estudios de doctorado conforme al RD 99/2011, los Licenciados, arquitectos o Ingenieros que estuvieran en posesi&oacute;n del Diploma de Estudios Avanzados obtenido de acuerdo con lo dispuesto en el Real Decreto 778/1998, de 30 de abril, o hubieran alcanzado la suficiencia investigadora regulada en el Real Decreto 185/1985, de 23 de enero. Estos alumnos deber&aacute;n cursar los complementos de formaci&oacute;n siguientes: tratamiento de datos (3 ECTS), T&eacute;cnicas para la investigaci&oacute;n cualitativa (2 ECTS), Fuentes de informaci&oacute;n territorial e introducci&oacute;n a los SIG (3 ECTS) y Participaci&oacute;n en congresos y jornadas (3 participaciones m&iacute;nimo).</p>\r\n</li>\r\n<li>\r\n<p>Estando en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor obtenido conforme a anteriores ordenaciones universitarias, si proviene de una licenciatura o Grado de Artes y Humanidades Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n siguientes: Tratamiento de datos (3 ECTS), T&eacute;cnicas para la investigaci&oacute;n cualitativa (2 ECTS), Participaci&oacute;n en congresos y jornadas (3 participaciones m&iacute;nimo), m&aacute;s T&eacute;cnicas multivariantes (3 ECTS) y Fuentes de informaci&oacute;n territorial e introducci&oacute;n a los SIG (3 ECTS). Estos dos cursos &uacute;ltimos a elegir en funci&oacute;n de las t&eacute;cnicas a emplear en la tesis. Para los doctores provenientes de otros perfiles ser&aacute; necesario cursar los complementos de formaci&oacute;n: Tratamiento de datos (3 ECTS), T&eacute;cnicas para la investigaci&oacute;n cualitativa (2 ECTS), Participaci&oacute;n en congresos y jornadas (3 participaciones m&iacute;nimo).</p>\r\n</li>\r\n</ol></ol>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Departamento de Geografía Física y Análisis Geográfico Regional\",\"telefono\":\"954551366\",\"nombre\":\"\",\"email\":\"geofiagr@us.es\"}\r\n	,{\"direccion\":\"Departamento de Geografía Humana\",\"telefono\":\"954.555.975\",\"nombre\":\"\",\"email\":\"secregeohum@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"Dpto. de Geografía Física y Análisis Geográfico Regional\",\"telefono\":\"954551366\",\"nombre\":\"Rosa María Jordá Borrell\",\"email\":\"geofiagr@us.es\"}\r\n	,{\"direccion\":\"Dpto. de Geografía Humana\",\"telefono\":\"954.555.975\",\"nombre\":\"\",\"email\":\"secregeohum@us.es\"}\r\n	]}}'),(17,'2014-04-09 09:21:28','3016','doctorado_geni@us.es','http://institucional.us.es/docgestra','Gestión Estratégica y Negocios Internacionales','2011','ADMINISTRACIÓN Y GESTIÓN DE EMPRESAS','ADMINISTRACIÓN Y GESTIÓN DE EMPRESAS','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Licenciados/Graduados en Administraci&oacute;n y Direcci&oacute;n de Empresas, Investigaci&oacute;n y T&eacute;cnicas de Mercado, Econom&iacute;a, Turismo o Ingenier&iacute;a Superior, u otras ramas del conocimiento, con un M&aacute;ster realizado en &aacute;reas afines a los objetivos y l&iacute;neas de investigaci&oacute;n del programa de doctorado, con conocimiento de lengua inglesa y con motivaci&oacute;n e inter&eacute;s por la investigaci&oacute;n en el &aacute;mbito del programa propuesto, as&iacute; como una actitud proactiva para el aprendizaje continuo.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Los requisitos para el acceso al programa de doctorado son los siguientes:</p>\r\n<br />\r\n<h4>Criterios generales de admisi&oacute;n</h4>\r\n<ul>\r\n<li>\r\n<p>Candidatos con t&iacute;tulo de licenciatura o grados de 240 ECTS: deber&aacute;n haber cursado un m&aacute;ster universitario que incluyan al menos 6 cr&eacute;ditos metodol&oacute;gicos de formaci&oacute;n en investigaci&oacute;n, y haber realizado un trabajo fin de m&aacute;ster de car&aacute;cter investigador.</p>\r\n</li>\r\n<li>\r\n<p>Candidatos con t&iacute;tulo de licenciatura o grados de 240 ECTS que no hayan cursado un m&aacute;ster con formaci&oacute;n investigadora, sino otro tipo de m&aacute;ster oficial: deber&aacute;n cursar, durante el primer a&ntilde;o, los complementos de formaci&oacute;n que la comisi&oacute;n acad&eacute;mica establezca.</p>\r\n</li>\r\n<li>\r\n<p>Graduados/as cuyos estudios tengan como m&iacute;nimo 300 cr&eacute;ditos ECTS: deber&aacute;n cursar, durante el primer a&ntilde;o, los complementos de formaci&oacute;n que la comisi&oacute;n acad&eacute;mica establezca.</p>\r\n</li>\r\n<li>\r\n<p>Candidatos que hayan obtenido el t&iacute;tulo de Doctor/a conforme a anteriores ordenaciones universitarias o que est&eacute;n en posesi&oacute;n del DEA (R.D. 778/1998) o hubieran alcanzado la suficiencia investigadora (RD 185/1985): la comisi&oacute;n acad&eacute;mica decidir&aacute; sobre su admisi&oacute;n directa o de la necesidad de realizar complementos de formaci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<p>Candidatos en posesi&oacute;n de un t&iacute;tulo universitario de m&aacute;ster obtenido conforme a sistemas educativos extranjeros. Podr&aacute;n ser admitidos sin la homologaci&oacute;n del t&iacute;tulo y previa comprobaci&oacute;n por parte de la Universidad de Sevilla de que acreditan un nivel de formaci&oacute;n equivalente a los correspondientes t&iacute;tulos espa&ntilde;oles de m&aacute;ster universitario, incluida la formaci&oacute;n investigadora equivalente a la requerida al resto de los estudiantes, y de que dicho t&iacute;tulo facilita en el pa&iacute;s expedidor del mismo el acceso a estudios de doctorado. Esta admisi&oacute;n no implicar&aacute;, en ning&uacute;n caso, la homologaci&oacute;n del t&iacute;tulo previo que posee la persona interesada, ni reconocimiento a otros efectos que el de cursar estudios de Doctorado.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h4>Criterios espec&iacute;ficos de admisi&oacute;n</h4>\r\n<p>Junto a los criterios generales se&ntilde;alados, el programa establece los siguientes criterios espec&iacute;ficos:</p>\r\n<ul>\r\n<li>\r\n<p>Licenciados en Administraci&oacute;n y Direcci&oacute;n de Empresas, Investigaci&oacute;n y T&eacute;cnicas de Mercado, Econom&iacute;a, Turismo o Ingenier&iacute;a Superior, con un M&aacute;ster realizado en &aacute;reas afines a los objetivos y l&iacute;neas de investigaci&oacute;n del programa de doctorado</p>\r\n</li>\r\n<li>\r\n<p>Graduados en Administraci&oacute;n y Direcci&oacute;n de Empresas, Investigaci&oacute;n y T&eacute;cnicas de Mercado, Econom&iacute;a, Turismo, Finanzas y Contabilidad o Ingenier&iacute;a Superior, con un M&aacute;ster realizado en &aacute;reas afines a los objetivos y l&iacute;neas de investigaci&oacute;n del programa de doctorado.</p>\r\n</li>\r\n<li>\r\n<p>Licenciados o graduados en otras ramas del conocimiento, con un m&aacute;ster realizado en &aacute;reas afines a los objetivos y l&iacute;neas de investigaci&oacute;n del programa de doctorado</p>\r\n</li>\r\n<li>\r\n<p>Conocimiento de lengua inglesa que le permite seguir los seminarios, conferencias y discusiones cient&iacute;ficas.</p>\r\n</li>\r\n<li>\r\n<p>Motivaci&oacute;n e inter&eacute;s por la investigaci&oacute;n en el &aacute;mbito de los negocios internacionales y de la direcci&oacute;n estrat&eacute;gica de la empresa, as&iacute; como una actitud proactiva para el aprendizaje continuo.</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h4>Baremo de ponderaci&oacute;n</h4>\r\n<p>La Comisi&oacute;n Acad&eacute;mica analizar&aacute; detenidamente el curr&iacute;culum vitae de cada candidato utilizando el siguiente baremo de ponderaci&oacute;n:</p>\r\n<ul>\r\n<li>\r\n<p>Nota media del expediente acad&eacute;mico: 40%</p>\r\n</li>\r\n<li>\r\n<p>Adecuaci&oacute;n del perfil acad&eacute;mico y profesional del candidato: 30%</p>\r\n</li>\r\n<li>\r\n<p>Conocimiento de idiomas: 20%</p>\r\n</li>\r\n<li>\r\n<p>Publicaciones y asistencia a encuentros cient&iacute;ficos: 10%</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>Cada uno de estos criterios ser&aacute; valorado por la comisi&oacute;n acad&eacute;mica del programa de 1 a 10. En caso de que el n&uacute;mero de solicitantes sea superior al de plazas ofertadas, la puntuaci&oacute;n recibida por el candidato establecer&aacute; el orden de prelaci&oacute;n para el acceso al programa</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Datos personales completos. Entre ellos, si fuera necesario, se informar&aacute; de las necesidades especiales derivadas de la discapacidad del candidato.</li>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en el &aacute;mbito de la gesti&oacute;n de empresas y de los negocios internacionales.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>La Comisi&oacute;n Acad&eacute;mica formular&aacute; para cada candidato la necesidad de complementos de formaci&oacute;n. Estos complementos, por un m&aacute;ximo de 18 cr&eacute;ditos ECTS de investigaci&oacute;n, estar&aacute;n vinculados a determinadas materias o seminarios asociados al <strong>m&aacute;ster en Gesti&oacute;n Estrat&eacute;gica y Negocios Internacionales de la Universidad de Sevilla</strong>, o en el seguimiento de los cursos ofertados en el contexto de los m&aacute;steres oficiales de la Universidad de Sevilla</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Departamento de Administración de Empresas y Marketing. Facultad de Ciencias Económica y Empresariales\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"empresa@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"95.455.75.21\",\"nombre\":\"Carmen Barroso Castro\",\"email\":\"barroso@us.es\"}\r\n	]}}'),(18,'2014-04-09 09:21:39','3017','doctoradohistoria@us.es','http://institucional.us.es/doctorhistoria','Historia','2011','HISTORIA Y ARQUEOLOGÍA','HISTORIA Y ARQUEOLOGÍA','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Personas con t&iacute;tulos de Grado en Historia, Arqueolog&iacute;a e Historia del Arte, o bien de las antiguas licenciaturas de id&eacute;ntica denominaci&oacute;n, y con t&iacute;tulo de M&aacute;ster universitario relacionados, preferentemente, con la Historia, como los existentes en la oferta oficial formativa de la Universidad de Sevilla y que capacitan a futuros doctorandos a realizar investigaciones en el campo de la Historia:</p>\r\n<ul>\r\n<li>\r\n<p>M&aacute;ster Universitario en Arqueolog&iacute;a</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en Documentos y libros. Archivos y bibliotecas</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en Estudios Americanos</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en Estudios Hist&oacute;ricos comparados. La Pen&iacute;nsula Ib&eacute;rica entre el Mundo Mediterr&aacute;neo y el Atl&aacute;ntico</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en Estudios Hist&oacute;ricos Avanzados</p>\r\n</li>\r\n<li>\r\n<p>M&aacute;ster Universitario en Patrimonio art&iacute;stico andaluz y su proyecci&oacute;n iberoamericana</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>Asimismo, cualquier persona que, cumpliendo los requisitos necesarios para acceder a un programa de Doctorado, desee adquirir su plena capacidad investigadora en cualquiera de las ramas de la Historia.</p>\r\n<br />\r\n<p>Las l&iacute;neas de investigaci&oacute;n de este Programa de Doctorado son las siguientes:</p>\r\n<ul>\r\n<li>Arqueolog&iacute;a</li>\r\n<li>Ciencias y T&eacute;cnicas Historiogr&aacute;ficas</li>\r\n<li>Historia Antigua</li>\r\n<li>Historia de Am&eacute;rica</li>\r\n<li>Historia del Arte</li>\r\n<li>Historia Contempor&aacute;nea</li>\r\n<li>Historia Medieval</li>\r\n<li>Historia Moderna</li>\r\n<li>Prehistoria</li>\r\n</ul>\r\n<br />\r\n<p>Las capacidades y conocimientos previos exigibles a los alumnos que deseen matricularse en este Programa de Doctorado son los relacionados con las titulaciones en Historia, Arqueolog&iacute;a e Historia del Arte y con los m&aacute;s espec&iacute;ficos de un M&aacute;ster relacionado con estos campos.</p>\r\n<br />\r\n<p>La lengua a utilizar en el proceso formativo ser&aacute; preferentemente el espa&ntilde;ol, lo que no obsta la utilizaci&oacute;n de recursos bibliogr&aacute;ficos en otras lenguas (ingl&eacute;s, franc&eacute;s, alem&aacute;n e italiano).</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Este Programa de Doctorado se dirige, preferentemente, a graduados universitarios de la rama de Artes y Humanidades, en particular, graduados en Historia, Historia del Arte, Arqueolog&iacute;a, Humanidades, Ciencias de la Informaci&oacute;n, o licenciados en las antiguas titulaciones con igual nombre y con un M&aacute;ster Universitario que los capacite para el Doctorado en Historia. Otros perfiles afines ser&aacute;n analizados de manera individual.</p>\r\n<br />\r\n<p>La Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado realizar&aacute; la selecci&oacute;n de los estudiantes conforme a los requisitos espec&iacute;ficos y criterios de valoraci&oacute;n de m&eacute;ritos que ser&aacute;n establecidos cada curso.</p>\r\n<br />\r\n<p>El criterio general de admisi&oacute;n y selecci&oacute;n se basar&aacute; en la afinidad del expediente acad&eacute;mico del aspirante y en la adecuaci&oacute;n de su curr&iacute;culum acad&eacute;mico, profesional e investigador al contenido del Programa de Doctorado. Se tendr&aacute; en cuenta, de manera especial, la realizaci&oacute;n de M&aacute;steres que proporcionen una formaci&oacute;n espec&iacute;fica en las l&iacute;neas de investigaci&oacute;n y &aacute;reas de conocimiento que forman parte de este Programa de Doctorado:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>Expediente acad&eacute;mico</p>\r\n</li>\r\n<li>\r\n<p>Adecuaci&oacute;n del t&iacute;tulo de M&aacute;ster u otros t&iacute;tulos de Postgrado homologables a las l&iacute;neas de investigaci&oacute;n del Programa de Doctorado</p>\r\n</li>\r\n<li>\r\n<p>Becas de investigaci&oacute;n, publicaciones y participaci&oacute;n en proyectos de investigaci&oacute;n relacionados con la especialidad</p>\r\n</li>\r\n<li>\r\n<p>Otros m&eacute;ritos</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<p>Para su admisi&oacute;n se tendr&aacute; en cuenta el siguiente baremo:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<p>Expediente acad&eacute;mico, hasta 4 puntos</p>\r\n</li>\r\n<li>\r\n<p>Becas de investigaci&oacute;n, publicaciones y participaci&oacute;n en proyectos de investigaci&oacute;n relacionados con la especialidad, hasta 4 puntos</p>\r\n</li>\r\n<li>\r\n<p>Adecuaci&oacute;n de la formaci&oacute;n de posgrado al perfil del Programa de Doctorado, hasta 4 puntos</p>\r\n</li>\r\n<li>\r\n<p>Otros m&eacute;ritos, hasta 2 puntos</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Dentro del programa se contempla la realizaci&oacute;n por parte del alumnado de actividades docentes adicionales que completen su formaci&oacute;n. No se establece una secuencia &uacute;nica, pues los complementos de formaci&oacute;n estar&aacute;n en relaci&oacute;n con los estudios previos de los estudiantes, as&iacute; como con la l&iacute;nea de investigaci&oacute;n en la que desarrollen sus estudios dentro del Programa. Los complementos de formaci&oacute;n podr&aacute;n ser cursos, seminarios o asignaturas regladas.</p>\r\n<br />\r\n<p>Los estudiantes que no tengan un perfil adecuado, realizar&aacute;n en el seno de un M&aacute;ster Universitario Oficial de la oferta de la Universidad de Sevilla al menos 9 cr&eacute;ditos ECTS y hasta un m&aacute;ximo de 18 cr&eacute;ditos. Excepcionalmente y cuando las exigencias del plan formativo de un M&aacute;ster lo requiera, se podr&iacute;a llegar a 24 cr&eacute;ditos ECTS.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Decanato de la Facultad de Gª e Hª\",\"telefono\":\"\",\"nombre\":\"Mª de los Ángeles Ordóñez Cabrera\",\"email\":\"mangelesoc@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"95.455.14.31\",\"nombre\":\"María Pilar Ostos Salcedo\",\"email\":\"doctoradohistoria@us.es\"}\r\n	]}}'),(19,'2014-04-09 09:21:49','3018','doctorado_ingenieria_agraria@us.es','http://www.ingeverde.es','Ingeniera Agraria, Alimentaria, Forestal y del Desarrollo Rural Sostenible','2011','INDUSTRIA DE LA ALIMENTACIÓN','PRODUCCIÓN AGRÍCOLA Y EXPLOTACIÓN GANADERA','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Adicionalmente a los requisitos generales, establecidos en las normativas de ambas universidades, el Programa establece los siguientes criterios de preferencia:</p>\r\n<ul>\r\n<li>Titulado en el &aacute;rea de la ingenier&iacute;a agraria, alimentaria, forestal o del desarrollo rural, con un m&aacute;ster realizado en &aacute;reas afines</li>\r\n<li>Solicitante con alta motivaci&oacute;n por la investigaci&oacute;n cient&iacute;fica y las aproximaciones transdisciplinares.</li>\r\n<li>Conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencia y discusiones cient&iacute;ficas y dominio de la expresi&oacute;n escrita.</li>\r\n<li>Actitud favorable para trabajar en equipo y para combinar el trabajo te&oacute;rico con el experimental en campo y/o laboratorio.</li>\r\n<li>Actitud favorable para la movilidad y el aprendizaje permanente.</li>\r\n</ul>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Los candidatos a incorporarse en el Programa de doctorado utilizar&aacute;n, fundamentalmente, dos v&iacute;as para el primer contacto con el Programa de doctorado: contactando directamente con un investigador/a con potencial para dirigir una tesis doctoral (contacto que se sustenta en el conocimiento de los trabajos del investigador, indicaci&oacute;n de pares de otras universidades y centros de investigaci&oacute;n, conocimiento directo a trav&eacute;s de la asistencia a cursos y conferencias) o, como segunda v&iacute;a, dirigiendo un correo a la direcci&oacute;n de contacto del espacio Web del Programa de Doctorado.</p>\r\n<br />\r\n<p>De acuerdo a los plazos que establezcan las Universidades de C&oacute;rdoba y Sevilla, la Comisi&oacute;n Acad&eacute;mica, de forma definitiva, realizar&aacute;:</p>\r\n<ul>\r\n<li>valoraci&oacute;n de las solicitudes de admisi&oacute;n al Programa</li>\r\n<li>selecci&oacute;n de los candidatos</li>\r\n<li>recomendaci&oacute;n de complementos de formaci&oacute;n, en funci&oacute;n de la l&iacute;nea en la que se matricular&aacute; el alumno</li>\r\n<li>nombramientos de tutores y directores.</li>\r\n</ul>\r\n<br />\r\n<p>Cuando las solicitudes que cumplen los requisitos de acceso sobrepasen el n&uacute;mero de plazas disponibles, se considerar&aacute;n las reservas para alumnos internacionales (30%) y para alumnos con discapacidades (5%), y se valorar&aacute;n las candidaturas de acuerdo a los siguientes criterios de prioridad:</p>\r\n<br /><ol>\r\n<li>\r\n<p>Solicitantes que hayan cursado el perfil investigador de los siguientes programas de m&aacute;ster</p>\r\n<ul>\r\n<li>M&aacute;ster en Desarrollo Rural Territorial</li>\r\n<li>M&aacute;ster en Olivicultura y Elaiotecnia</li>\r\n<li>M&aacute;ster en Proyectos y Gesti&oacute;n de Plantas Agroindustriales</li>\r\n<li>M&aacute;ster en Cambio Global: Recursos Naturales y Sostenibilidad</li>\r\n<li>M&aacute;ster en Producci&oacute;n, Protecci&oacute;n y Mejora Vegetal</li>\r\n<li>M&aacute;ster en Representaci&oacute;n y Dise&ntilde;o en Ingenier&iacute;a y Arquitectura</li>\r\n<li>M&aacute;ster en Biotecnolog&iacute;a Molecular, Celular y Gen&eacute;tica</li>\r\n</ul>\r\n<br />\r\n<p>La Comisi&oacute;n Acad&eacute;mica podr&aacute; evaluar y proponer como preferentes otros programas de m&aacute;ster que sean acordes con el &aacute;mbito tem&aacute;tico del Programa de Doctorado.</p>\r\n<br />\r\n<p>Para alumnos de otros pa&iacute;ses se considerar&aacute; la acreditaci&oacute;n de la instituci&oacute;n en la que han cursado sus estudios previos</p>\r\n</li>\r\n<li>\r\n<p>Expediente acad&eacute;mico: se seleccionar&aacute;n los alumnos en funci&oacute;n de las notas medias de sus estudios</p>\r\n</li>\r\n<li>\r\n<p>Conocimiento de idiomas: el conocimiento avanzado de ingl&eacute;s, tanto oral como escrito, ser&aacute; un aspecto definitivo.</p>\r\n</li>\r\n<li>\r\n<p>Motivaci&oacute;n: ser&aacute; valorada por la Comisi&oacute;n Acad&eacute;mica a trav&eacute;s de las cartas de motivaci&oacute;n de los candidatos y la entrevista personal.</p>\r\n</li>\r\n<li>\r\n<p>Experiencia previa en labores de investigaci&oacute;n, manejo de equipos, publicaciones, etc.</p>\r\n</li>\r\n</ol><br />\r\n<p>Estos criterios ser&aacute;n cuantificados de acuerdo al baremo elaborado, generando una lista priorizada de los solicitantes y la correspondiente asignaci&oacute;n de las plazas disponibles.</p>\r\n<ul>\r\n<li>M&eacute;rito acad&eacute;mico: hasta 5 puntos.</li>\r\n<li>Si procede de un m&aacute;ster prioritario: 1 punto.</li>\r\n<li>Conocimiento de idiomas: hasta 2 puntos.</li>\r\n<li>Experiencia en labores de investigaci&oacute;n: hasta 2 puntos</li>\r\n<li>Entrevista personal y motivaci&oacute;n (incluyendo el plan de trabajo y el proyecto presentado): hasta 3 puntos</li>\r\n<li>Alumno de otras universidades: 1 punto</li>\r\n</ul>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta de motivaci&oacute;n, indicando el &aacute;mbito de inter&eacute;s para realizar la tesis doctoral, la experiencia previa en dicho &aacute;mbito y una propuesta de proyecto de tesis y programa de trabajo (incluyendo posibles contactos previos con un posible tutor/director y posibilidades de financiaci&oacute;n).</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Recibida la candidatura para ser admitido en el Programa de Doctorado, y una vez analizados los requisitos normativos de obligado cumplimiento, la formaci&oacute;n previa, los antecedentes curriculares, la motivaci&oacute;n del aspirante y la Propuesta de Trabajo de Tesis Doctoral, la Comisi&oacute;n Acad&eacute;mica, establecer&aacute; una propuesta de formaci&oacute;n complementaria basada fundamentalmente en el seguimiento de los cursos ofertados en el contexto de los m&aacute;steres oficiales ofertados por la Universidad de C&oacute;rdoba y/o la de Sevilla, de acuerdo al baremo establecido por ambas universidades para el reconocimiento de cr&eacute;ditos.</p>\r\n<br />\r\n<p>Para el establecimiento de los complementos de formaci&oacute;n se tendr&aacute; en cuenta los baremos aprobados por las Comisiones responsables de los Programas de Doctorado de la Universidad de C&oacute;rdoba y de la Universidad de Sevilla.</p>\r\n<br />\r\n<p>El Programa de Doctorado no contempla la realizaci&oacute;n de complementos de formaci&oacute;n para los estudiantes que cumplan con los criterios de acceso teniendo una titulaci&oacute;n de Grado, de al menos 240 cr&eacute;ditos ECTS, y habiendo cursado un M&aacute;ster Oficial con Perfil Investigador.</p>\r\n<br />\r\n<p>Como se ha indicado anteriormente, estos cr&eacute;ditos se realizar&aacute;n cursando las asignaturas que indique la Comisi&oacute;n Acad&eacute;mica, adecuados al perfil y l&iacute;nea de investigaci&oacute;n de cada solicitante, entre las asignaturas de m&aacute;ster ofertadas por la Universidad de C&oacute;rdoba y la Universidad de Sevilla. Preferentemente asignaturas metodol&oacute;gicas y de formaci&oacute;n en investigaci&oacute;n de los m&aacute;steres que se citan en el perfil de ingreso (M&aacute;ster en Desarrollo Rural Territorial, M&aacute;ster en Olivicultura y Elaiotecnia, M&aacute;ster en Proyectos y Gesti&oacute;n de Plantas Agroindustriales, M&aacute;ster en Cambio Global: Recursos Naturales y Sostenibilidad, M&aacute;ster en Producci&oacute;n, Protecci&oacute;n y Mejora Vegetal, M&aacute;ster en Representaci&oacute;n y Dise&ntilde;o en Ingenier&iacute;a y Arquitectura, M&aacute;ster en Biotecnolog&iacute;a Molecular, Celular y Gen&eacute;tica), o de otros m&aacute;steres que pudieran ser incorporados por la Comisi&oacute;n Acad&eacute;mica o considerarse adecuados al perfil concreto de cada alumno</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\" Dpto. Ciencias Agroforestales.\",\"telefono\":\"95 448.64.48\",\"nombre\":\"Víctor Manuel Fernández Cabanás\",\"email\":\"victorf@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954.48.64.52\",\"nombre\":\"D. Antonio Delgado García\",\"email\":\"adelgado@us.es\"}\r\n	,{\"direccion\":\"Dpto. Ciencias Agroforestales\",\"telefono\":\"95 448.64.48\",\"nombre\":\"Víctor Manuel Fernández Cabanás\",\"email\":\"victorf@us.es\"}\r\n	]}}'),(20,'2014-04-09 09:21:59','3019','doctorado_iaet@us.es','http://institucional.us.es/webdiaet/','Ingeniería Automática, Electrónica y de Telecomunicación','2011','INGENIERÍA Y PROFESIONES AFINES','','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Adicionalmente a los requisitos generales, el programa establece los siguientes criterios de preferencia</p>\r\n<ul>\r\n<li>Titulado en el &aacute;rea de ingenier&iacute;a, con un m&aacute;ster realizado en la misma &aacute;rea.</li>\r\n<li>Solicitante con alta motivaci&oacute;n por la investigaci&oacute;n cient&iacute;fico-t&eacute;cnica. Se valorar&aacute; la experiencia previa en trabajos de investigaci&oacute;n</li>\r\n<li>Conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencias y discusiones cient&iacute;ficas y dominio de la expresi&oacute;n escrita. Es recomendable que el alumno posea como m&iacute;nimo el nivel B2 en la lengua inglesa en el Marco Com&uacute;n Europeo de Referencia para las Lenguas</li>\r\n<li>Actitud favorable para trabajar en equipo y para combinar el trabajo te&oacute;rico con el experimental en campo y/o laboratorio.</li>\r\n<li>Actitud favorable para la movilidad y el aprendizaje permanente.</li>\r\n</ul>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Procedimiento de admisi&oacute;n</h4>\r\n<p>La comisi&oacute;n acad&eacute;mica del programa de doctorado evaluar&aacute; cada candidato individualmente y decidir&aacute; sobre su admisi&oacute;n. Si concurrieran en un candidato circunstancias especiales no previstas, esta comisi&oacute;n podr&aacute; establecer requisitos y criterios adicionales para la selecci&oacute;n y admisi&oacute;n de los estudiantes al programa de doctorado. Entre estos requisitos se podr&aacute;n incluir complementos de formaci&oacute;n espec&iacute;ficos adaptados a los diversos perfiles de ingreso en el doctorado</p>\r\n<br />\r\n<h4>Criterios de admisi&oacute;n</h4>\r\n<ul>\r\n<li>Titulado en el &aacute;rea de ingenier&iacute;a, con un m&aacute;ster realizado en la misma &aacute;rea.</li>\r\n<li>Solicitante con alta motivaci&oacute;n por la investigaci&oacute;n cient&iacute;fico-t&eacute;cnica. Se valorar&aacute; la experiencia previa en trabajos de investigaci&oacute;n</li>\r\n<li>Conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencias y discusiones cient&iacute;ficas y dominio de la expresi&oacute;n escrita. Es recomendable que el alumno posea como m&iacute;nimo el nivel B2 en la lengua inglesa en el Marco Com&uacute;n Europeo de Referencia para las Lenguas</li>\r\n<li>Actitud favorable para trabajar en equipo y para combinar el trabajo te&oacute;rico con el experimental en campo y/o laboratorio.</li>\r\n<li>Actitud favorable para la movilidad y el aprendizaje permanente.</li>\r\n</ul>\r\n<br />\r\n<h4>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h4>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h4>Complementos de Formaci&oacute;n</h4>\r\n<p>Aquellos alumnos que en el t&iacute;tulo (de m&aacute;ster, de grado o de t&iacute;tulo de ciclo largo en extinci&oacute;n) que le da acceso al programa de doctorado no hayan cursado cr&eacute;ditos de investigaci&oacute;n equivalentes a los cr&eacute;ditos de investigaci&oacute;n procedentes de estudios de m&aacute;ster estar&aacute;n obligados a realizar complementos de formaci&oacute;n hasta completar este n&uacute;mero de cr&eacute;ditos.</p>\r\n<br />\r\n<p>La Comisi&oacute;n Acad&eacute;mica del programa de doctorado analizar&aacute; individualmente cada caso previa consulta al profesorado que haya aceptado la direcci&oacute;n del estudiante, e indicar&aacute; en su caso, cu&aacute;les son las asignaturas de complementos de formaci&oacute;n que debe cursar el alumno en funci&oacute;n de su perfil de acceso y de la l&iacute;nea de investigaci&oacute;n en la que realizar&aacute; su tesis doctoral.</p>\r\n<br />\r\n<p>En ning&uacute;n caso, se podr&aacute; autorizar que el estudiante se matricule en complementos de formaci&oacute;n por un n&uacute;mero superior a 18 ECTS y, en casos excepcionales, 24 ECTS.</p>\r\n<br />\r\n<p>Estas asignaturas se elegir&aacute;n seg&uacute;n las tablas siguiente entre la oferta de car&aacute;cter investigador del M&aacute;ster de Autom&aacute;tica, Rob&oacute;tica y Telem&aacute;tica y/o del M&aacute;ster Universitario en Electr&oacute;nica, Tratamiento de Se&ntilde;al y Comunicaciones, ambos de la Universidad de Sevilla e impartidos en la Escuela T&eacute;cnica Superior de Ingenier&iacute;a.</p>\r\n<br />\r\n<p>Asignaturas del M&aacute;ster de Autom&aacute;tica, Rob&oacute;tica y Telem&aacute;tica.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de alumnos de la Escuela Técnica Superior de Ingeniería\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	,{\"direccion\":\"\",\"telefono\":\"954487473\",\"nombre\":\"Fernando Muñoz Chavero\",\"email\":\"doctorado_iaet@us.es | fmunoz@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"95 448 73 50\",\"nombre\":\"Dr. Francisco Rodríguez Rubio\",\"email\":\"rubio@us.es\"}\r\n	]}}'),(21,'2014-04-09 09:22:13','3020','doctorado_ieqa@us.es','http://www.etsi.us.es/postgrado/doctorado/ieqa','Ingeniería Energética, Química y Ambiental','2011','INGENIERÍA Y PROFESIONES AFINES','','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Adicionalmente a los requisitos generales, el programa establece los siguientes criterios de preferencia:</p>\r\n<ul>\r\n<li>Titulado en el &aacute;rea de ingenier&iacute;a o con un m&aacute;ster realizado en la misma &aacute;rea.</li>\r\n<li>Solicitante con alta motivaci&oacute;n por la investigaci&oacute;n cient&iacute;fico-t&eacute;cnica. Se valorar&aacute; la experiencia previa en trabajos de investigaci&oacute;n</li>\r\n<li>Conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencias y discusiones cient&iacute;ficas y dominio de la expresi&oacute;n escrita. Es recomendable que el alumno posea como m&iacute;nimo el nivel B2 en la lengua inglesa en el Marco Com&uacute;n Europeo de Referencia para las Lenguas</li>\r\n<li>Actitud favorable para trabajar en equipo y para combinar el trabajo te&oacute;rico con el experimental en campo y/o laboratorio.</li>\r\n<li>Actitud favorable para la movilidad y el aprendizaje permanente.</li>\r\n</ul>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Procedimiento de admisi&oacute;n</h4>\r\n<p>La comisi&oacute;n acad&eacute;mica del programa de doctorado evaluar&aacute; cada candidato individualmente y decidir&aacute; sobre su admisi&oacute;n. Si concurrieran en un candidato circunstancias especiales no previstas, esta comisi&oacute;n podr&aacute; establecer requisitos y criterios adicionales para la selecci&oacute;n y admisi&oacute;n de los estudiantes al programa de doctorado. Entre estos requisitos se podr&aacute;n incluir complementos de formaci&oacute;n espec&iacute;ficos adaptados a los diversos perfiles de ingreso en el doctorado.</p>\r\n<br />\r\n<h4>Criterios de admisi&oacute;n:</h4>\r\n<ul>\r\n<li>Titulado en el &aacute;rea de ingenier&iacute;a o con un m&aacute;ster realizado en la misma &aacute;rea (30%).</li>\r\n<li>Solicitante con alta motivaci&oacute;n por la investigaci&oacute;n cient&iacute;fico-t&eacute;cnica. Se valorar&aacute; la experiencia previa en trabajos de investigaci&oacute;n. (25%)</li>\r\n<li>Conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencias y discusiones cient&iacute;ficas y dominio de la expresi&oacute;n escrita. Es recomendable que el alumno posea como m&iacute;nimo el nivel B2 en la lengua inglesa en el Marco Com&uacute;n Europeo de Referencia para las Lenguas. (15%)</li>\r\n<li>Actitud favorable para trabajar en equipo y para combinar el trabajo te&oacute;rico con el experimental en campo y/o laboratorio. (15%)</li>\r\n<li>Actitud favorable para la movilidad y el aprendizaje permanente. (15%)</li>\r\n</ul>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Aquellos alumnos que en el t&iacute;tulo (de m&aacute;ster, de grado o de t&iacute;tulo de ciclo largo en extinci&oacute;n) que le da acceso al programa de doctorado no hayan cursado cr&eacute;ditos de investigaci&oacute;n equivalentes a los cr&eacute;ditos de investigaci&oacute;n procedentes de estudios de m&aacute;ster estar&aacute;n obligados a realizar complementos de formaci&oacute;n hasta completar este n&uacute;mero de cr&eacute;ditos.</p>\r\n<br />\r\n<p>La Comisi&oacute;n Acad&eacute;mica del programa de doctorado analizar&aacute; individualmente cada caso previa consulta al profesorado que haya aceptado la direcci&oacute;n del estudiante, e indicar&aacute; en su caso, cu&aacute;les son las asignaturas de complementos de formaci&oacute;n que debe cursar el alumno en funci&oacute;n de su perfil de acceso y de la l&iacute;nea de investigaci&oacute;n en la que realizar&aacute; su tesis doctoral.</p>\r\n<br />\r\n<p>Con car&aacute;cter general no se autorizar&aacute; que el estudiante se matricule en complementos de formaci&oacute;n por un n&uacute;mero superior a 18 ECTS salvo caso excepcionales en los que se podr&aacute; llegar hasta los 24 ECTS.</p>\r\n<br />\r\n<p>Estas asignaturas se elegir&aacute;n seg&uacute;n las tablas siguiente entre la oferta de car&aacute;cter investigador del M&aacute;ster Universitario de Sistemas de Energ&iacute;a T&eacute;rmica y/o del M&aacute;ster Universitario en Ingenier&iacute;a Ambiental, ambos de la Universidad de Sevilla e impartidos en la Escuela T&eacute;cnica Superior de Ingenier&iacute;a.</p>\r\n<br />\r\n<h4>ASIGNATURAS DEL M&Aacute;STER EN SISTEMAS DE ENERG&Iacute;A T&Eacute;RMICA</h4>\r\n<div class=\"table table-condensed\">\r\n<table class=\"table table-striped\">\r\n<thead>\r\n<tr><th>ASIGNATURAS</th><th>ECTS</th><th>&nbsp;</th><th>ALUMNOS QUE DEBER&Aacute;N CURSARLAS</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Introducci&oacute;n a las plantas de potencia</td>\r\n<td>6 ECTS</td>\r\n<td>C1</td>\r\n<td>Alumnos sin formaci&oacute;n en plantas de potencia y que se inscriban en la l&iacute;nea de investigaci&oacute;n 1</td>\r\n</tr>\r\n<tr>\r\n<td>Fundamentos de turbom&aacute;quinas t&eacute;rmicas</td>\r\n<td>6 ECTS</td>\r\n<td>C1</td>\r\n<td>Alumnos sin formaci&oacute;n en m&aacute;quinas t&eacute;rmicas y que se inscriban en la l&iacute;nea de investigaci&oacute;n 1</td>\r\n</tr>\r\n<tr>\r\n<td>Cogeneraci&oacute;n</td>\r\n<td>4 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 1, cuya tesis doctoral est&eacute; relacionada espec&iacute;ficamente con los sistemas de cogeneraci&oacute;n y no tengan una s&oacute;lida formaci&oacute;n en estas materias.</td>\r\n</tr>\r\n<tr>\r\n<td>Ingenier&iacute;a de las plantas de vapor</td>\r\n<td>5 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 1, cuya tesis doctoral est&eacute; espec&iacute;ficamente relacionada con las plantas de vapor y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Tecnolog&iacute;a de las turbinas de gas y de los ciclos combinados</td>\r\n<td>6 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 1 cuya tesis doctoral est&eacute; relacionada espec&iacute;ficamente con las turbinas de gas o los ciclos combinados y no tengan una s&oacute;lida formaci&oacute;n en estas materias y se inscriban en la l&iacute;nea de investigaci&oacute;n 1</td>\r\n</tr>\r\n<tr>\r\n<td>Sistemas auxiliares de las plantas de potencia</td>\r\n<td>4 ECTS</td>\r\n<td>C3</td>\r\n<td>Alumnos sin formaci&oacute;n en plantas de potencia y que se inscriban en la l&iacute;nea de investigaci&oacute;n 1</td>\r\n</tr>\r\n<tr>\r\n<td>Combusti&oacute;n en motores de combusti&oacute;n interna</td>\r\n<td>4,5 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 1, cuya tesis doctoral est&eacute; espec&iacute;ficamente relacionada con los procesos de combusti&oacute;n en motores de combusti&oacute;n interna alternativos o en turbinas de gas y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Conceptos innovadores en la generaci&oacute;n de potencia</td>\r\n<td>4 ECTS</td>\r\n<td>C3</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 1 y cuya tesis doctoral est&eacute; espec&iacute;ficamente relacionada con nuevos conceptos de plantas de potencia</td>\r\n</tr>\r\n<tr>\r\n<td>Fundamentos de Transmisi&oacute;n de Calor</td>\r\n<td>6 ECTS</td>\r\n<td>C1</td>\r\n<td>Alumnos sin formaci&oacute;n en Transmisi&oacute;n de Calor y que se inscriban en las l&iacute;neas de investigaci&oacute;n relacionadas con la ingenier&iacute;a energ&eacute;tica (1 y 2)</td>\r\n</tr>\r\n<tr>\r\n<td>Fundamentos de Tecnolog&iacute;a Energ&eacute;tica</td>\r\n<td>6 ECTS</td>\r\n<td>C1</td>\r\n<td>Alumnos sin formaci&oacute;n en tecnolog&iacute;as de la energ&iacute;a t&eacute;rmica y que se inscriban en la l&iacute;nea de investigaci&oacute;n 2</td>\r\n</tr>\r\n<tr>\r\n<td>Energ&iacute;a solar t&eacute;rmica a baja temperatura</td>\r\n<td>4 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 2, cuya tesis doctoral est&eacute; relacionada espec&iacute;ficamente con los equipos y/o sistemas de energ&iacute;a solar t&eacute;rmica a baja temperatura y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Hidr&oacute;geno y pilas de combustible de baja y media temperatura</td>\r\n<td>4 ECTS</td>\r\n<td>C3</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 2, cuya tesis doctoral est&eacute; espec&iacute;ficamente relacionada con la generaci&oacute;n de hidr&oacute;geno y/o pilas de combustible y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Eficiencia energ&eacute;tica en edificios I</td>\r\n<td>4 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 2 cuya tesis doctoral est&eacute; relacionada espec&iacute;ficamente con la t&eacute;rmica en la edificaci&oacute;n tanto a nivel de epidermis como de sistemas y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Eficiencia energ&eacute;tica en edificios II</td>\r\n<td>4 ECTS</td>\r\n<td>C3</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 2 cuya tesis doctoral est&eacute; relacionada espec&iacute;ficamente con la t&eacute;rmica en la edificaci&oacute;n tanto a nivel de epidermis como de sistemas y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Instalaciones t&eacute;rmicas en la edificaci&oacute;n</td>\r\n<td>6 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 2 cuya tesis doctoral est&eacute; relacionada espec&iacute;ficamente con las instalaciones t&eacute;rmicas en la edificaci&oacute;n y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Instalaciones t&eacute;rmicas en la industria</td>\r\n<td>4,5 ECTS</td>\r\n<td>C2</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 2 cuya tesis doctoral est&eacute; relacionada espec&iacute;ficamente con las instalaciones t&eacute;rmicas en la industria y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Optimizaci&oacute;n de sistemas t&eacute;rmicos</td>\r\n<td>4 ECTS</td>\r\n<td>C3</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 2, cuya tesis doctoral est&eacute; relacionada con la optimizaci&oacute;n de equipos y/o procesos t&eacute;rmicos y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Complementos de Termodin&aacute;mica Aplicada y Energ&iacute;as Renovables</td>\r\n<td>6 ECTS</td>\r\n<td>C1</td>\r\n<td>Alumnos sin formaci&oacute;n en Termodin&aacute;mica Aplicada y que se inscriban en las l&iacute;neas de investigaci&oacute;n relacionadas con la ingenier&iacute;a energ&eacute;tica (1 y 2)</td>\r\n</tr>\r\n<tr>\r\n<td>Instalaciones solares fotovoltaicas y t&eacute;rmicas a media y alta temperatura</td>\r\n<td>8 ECTS</td>\r\n<td>C1</td>\r\n<td>Alumnos que se inscriban en las l&iacute;neas de investigaci&oacute;n 1 y/o 2, cuya tesis doctoral est&eacute; espec&iacute;ficamente relacionada con la captaci&oacute;n y concentraci&oacute;n solar y no tengan una s&oacute;lida formaci&oacute;n en estas materias</td>\r\n</tr>\r\n<tr>\r\n<td>Desalaci&oacute;n solar y s&iacute;ntesis de combustibles por concentradores solares</td>\r\n<td>8 ECTS</td>\r\n<td>C1</td>\r\n<td>Alumnos que se inscriban en la l&iacute;nea de investigaci&oacute;n 1, cuya tesis doctoral est&eacute; espec&iacute;ficamente relacionada con la desalaci&oacute;n solar y no tengan una s&oacute;lida formaci&oacute;n en esta materia</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<br />\r\n<h4>ASIGNATURAS DEL M&Aacute;STER EN INGENIER&Iacute;A AMBIENTAL</h4>\r\n<div class=\"table table-condensed\">\r\n<table class=\"table table-reflow\">\r\n<thead>\r\n<tr><th>ASIGNATURAS</th><th>ALUMNOS QUE DEBER&Aacute;N CURSARLAS</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>ANALISIS CICLO VIDA</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre an&aacute;lisis ambientales de procesos y productos, ecodise&ntilde;o y norma ISO 14040</td>\r\n</tr>\r\n<tr>\r\n<td>ASPECTOS ECON&Oacute;MICOS DE LA GESTI&Oacute;N AMBIENTAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre la aplicaci&oacute;n del coste de alternativas tecnol&oacute;gicas para la reducci&oacute;n del impacto ambiental de actividades industriales, en particular de la industria qu&iacute;mica y petroqu&iacute;mica.</td>\r\n</tr>\r\n<tr>\r\n<td>BASES DE LA INGENIER&Iacute;A QU&Iacute;MICA Y AMBIENTAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre balances de materia y energ&iacute;a</td>\r\n</tr>\r\n<tr>\r\n<td>BIOENERGIA: RECURSOS, PROCESOS Y APLICACIONES</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre biomasa como fuente de energ&iacute;a renovable para la producci&oacute;n de electricidad, calor y biocombustibles.</td>\r\n</tr>\r\n<tr>\r\n<td>CAPTURA Y ALMACENAMIENTO DE CO 2</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre tecnolog&iacute;as de captura, transporte y almacenamiento de CO 2 de importancia para la reducci&oacute;n de emisiones de este gas: Implicaciones t&eacute;cnicas, econ&oacute;micas y de percepci&oacute;n social</td>\r\n</tr>\r\n<tr>\r\n<td>DISE&Ntilde;O Y AN&Aacute;LISIS EXPERIMENTAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre dise&ntilde;os factoriales de experimentos, procesamiento estad&iacute;stico de datos experimentales y an&aacute;lisis de regresi&oacute;n</td>\r\n</tr>\r\n<tr>\r\n<td>EVALUACI&Oacute;N DE LA CALIDAD AMBIENTAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre toma de muestras y m&eacute;todos de preservaci&oacute;n y an&aacute;lisis de contaminantes ambientales.</td>\r\n</tr>\r\n<tr>\r\n<td>GESTI&Oacute;N AMBIENTAL INDUSTRIAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre evaluaci&oacute;n de impacto ambiental (de planes, programas y proyectos), auditor&iacute;a ambiental e inspecci&oacute;n ambiental.</td>\r\n</tr>\r\n<tr>\r\n<td>GESTI&Oacute;N DE RESIDUOS S&Oacute;LIDOS</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre caracterizaci&oacute;n de los distintos tipos de residuos y de las distintas operaciones de gesti&oacute;n de los mismos.</td>\r\n</tr>\r\n<tr>\r\n<td>HERRAMIENTAS SIMULACI&Oacute;N PROCESOS</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre resoluci&oacute;n de problemas num&eacute;ricos en el &aacute;rea de la Ingenier&iacute;a Qu&iacute;mica, con el uso de herramientas inform&aacute;ticas (programaci&oacute;n).</td>\r\n</tr>\r\n<tr>\r\n<td>INGENIER&Iacute;A AC&Uacute;STICA AMBIENTAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre fundamentos de ac&uacute;stica y m&eacute;todos de medida de ruidos.</td>\r\n</tr>\r\n<tr>\r\n<td>INGENIER&Iacute;A DE LA CONTAMINACI&Oacute;N ATMOSF&Eacute;RICA</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre desarrollos tecnol&oacute;gicos para la correcci&oacute;n de las emisiones de contaminantes atmosf&eacute;ricos.</td>\r\n</tr>\r\n<tr>\r\n<td>INGENIER&Iacute;A DE LA CONTAMINACI&Oacute;N DE AGUAS</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre c&aacute;lculo y dise&ntilde;o de procesos de tratamientos de aguas residuales y potables</td>\r\n</tr>\r\n<tr>\r\n<td>INGENIERIA DEL AGUA ADECUADA AL ENTORNO</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre dise&ntilde;o de procesos eficientes de tratamiento de aguas con ahorro energ&eacute;tico y de recursos naturales.</td>\r\n</tr>\r\n<tr>\r\n<td>OPERACIONES Y PROCESOS AVANZADOS DE DEPURACI&Oacute;N</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre operaciones no convencionales que se usan en la depuraci&oacute;n de efluentes industriales.</td>\r\n</tr>\r\n<tr>\r\n<td>OPERACIONES Y PROCESOS INGENIER&Iacute;A AMBIENTAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre operaciones b&aacute;sicas de la Ingenier&iacute;a Qu&iacute;mica y en tecnolog&iacute;as de procesos industriales.</td>\r\n</tr>\r\n<tr>\r\n<td>PREVENCI&Oacute;N DE RIESGOS Y SEGURIDAD INDUSTRIAL</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre prevenci&oacute;n de riesgos laborales y de accidentes graves.</td>\r\n</tr>\r\n<tr>\r\n<td>SISTEMA AMBIENTALES</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre metabolismos bacterianos, relaciones ecol&oacute;gicas entre industrias y factores ecol&oacute;gicos en sistemas ambientales</td>\r\n</tr>\r\n<tr>\r\n<td>TECNOLOG&Iacute;A AVANZADAS DE REACTORES</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre tecnolog&iacute;as avanzadas de tratamiento de emisiones gaseosas de producci&oacute;n industrial y equipos de control</td>\r\n</tr>\r\n<tr>\r\n<td>TRANSFORMACI&Oacute;N ENERG&Iacute;A Y MEDIO AMBIENTE</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre implicaciones de las tecnolog&iacute;as de obtenci&oacute;n, transformaci&oacute;n y empleo de energ&iacute;as primaria y final, incluyendo renovables y f&oacute;siles.</td>\r\n</tr>\r\n<tr>\r\n<td>TRATAMIENTOS AVANZADOS DE EMISIONES GASESOSAS</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre t&eacute;cnicas avanzadas de tratamiento medioambiental de emisiones gaseosas de procesos industriales y equipos de control.</td>\r\n</tr>\r\n<tr>\r\n<td>VALORIZACI&Oacute;N RESIDUOS COMBUSTIBLE Y GASIFICACI&Oacute;N</td>\r\n<td>Alumnos con carencias en formaci&oacute;n sobre las diferentes v&iacute;as de reciclado de cenizas y escorias procedentes de procesos de valoraci&oacute;n energ&eacute;tica de combustibles f&oacute;siles.</td>\r\n</tr>\r\n</tbody>\r\n</table>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de alumnos de la Escuela Técnica Superior de Ingeniería\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954.487.223\",\"nombre\":\"Dr. Alberto Gómez Barea\",\"email\":\"doctorado_ieqa@us.es | agomezbarea@us.es\"}\r\n	]}}'),(22,'2014-04-09 09:22:25','3021','doctorado_inge_informatica@us.es','https://www.informatica.us.es/index.php/doctorado','Ingeniería Informática','2011','INGENIERÍA','INGENIERÍA Y PROFESIONES AFINES','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Los alumnos del programa de doctorado de Ingenier&iacute;a Inform&aacute;tica proceder&aacute;n de las siguientes titulaciones:</p>\r\n<ul>\r\n<li>Ingenier&iacute;a Inform&aacute;tica (II)</li>\r\n<li>Ingenier&iacute;a Inform&aacute;tica en Inform&aacute;tica de Sistemas (ITIS)</li>\r\n<li>Ingenier&iacute;a Inform&aacute;tica en Inform&aacute;tica de Gesti&oacute;n (ITIG)</li>\r\n</ul>\r\n<p>y grados:</p>\r\n<ul>\r\n<li>Grado en Ingenier&iacute;a Inform&aacute;tica - Ingenier&iacute;a del Software (IIIS)</li>\r\n<li>Grado en Ingenier&iacute;a Inform&aacute;tica - Ingenier&iacute;a de Computadores (IIIC)</li>\r\n<li>Grado en Ingenier&iacute;a Inform&aacute;tica - Tecnolog&iacute;as Inform&aacute;ticas (IITI)</li>\r\n<li>Grado en Ingenier&iacute;a de la Salud (ISA)</li>\r\n</ul>\r\n<p>y que, preferentemente, hayan cursado alguno de los siguientes m&aacute;steres:</p>\r\n<ul>\r\n<li>M&aacute;ster Universitario en Ingenier&iacute;a y Tecnolog&iacute;a del Software (MITS)</li>\r\n<li>M&aacute;ster Universitario en Ingenier&iacute;a de Computadores y Redes (MICR)</li>\r\n<li>M&aacute;ster Universitario en L&oacute;gica, Computaci&oacute;n e inteligencia Artificial (MLCIA)</li>\r\n<li>M&aacute;ster Universitario en Gesti&oacute;n de Tecnolog&iacute;as de las Informaci&oacute;n y de las Comunicaciones (MGTIC)</li>\r\n<li>M&aacute;ster Universitario en Matem&aacute;tica Computacional (MMC)</li>\r\n</ul>\r\n<br />\r\n<p>Los alumnos provenientes de otros estudios deber&aacute;n haber cursado y tener conocimientos en diversas disciplinas fundamentales de la ingenier&iacute;a inform&aacute;tica: Tecnolog&iacute;a del Software, Tecnolog&iacute;a Electr&oacute;nica y de las Comunicaciones, Tecnolog&iacute;a de Computadores, Matem&aacute;ticas y Ciencias de la Computaci&oacute;n.</p>\r\n<br />\r\n<p>Los estudiantes de doctorado deber&aacute;n acreditar un nivel de ingl&eacute;s B1 o equivalente.</p>\r\n<br />\r\n<p>Los m&aacute;steres anteriormente citados dar&aacute;n acceso directo al programa de doctorado de Ingenier&iacute;a Inform&aacute;tica, siempre que el alumno cumpla los requisitos de acceso. En otro caso, ser&aacute; la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado la encargada de valorar las solicitudes de admisi&oacute;n recibidas</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Acceso directo:</h4>\r\n<p>Cualquiera de los m&aacute;steres contemplados en el perfil de ingreso recomendado</p>\r\n<br />\r\n<h4>Acceso condicionado:</h4>\r\n<p>Otros t&iacute;tulos oficiales relacionados con el &aacute;mbito del contenido del programa. En este caso, la Comisi&oacute;n Acad&eacute;mica har&aacute; una valoraci&oacute;n de la adecuaci&oacute;n de la formaci&oacute;n adquirida por el estudiante para ser admitido al programa. Como resultado de la valoraci&oacute;n, la comisi&oacute;n dictaminar&aacute; tres posibles situaciones:</p>\r\n<br />\r\n<ul>\r\n<li>\r\n<h5>APTO:</h5>\r\n<p>La solicitud es informada favorablemente. Los estudios aportados son adecuados a los contenidos del programa.</p>\r\n</li>\r\n<li>\r\n<h5>NO APTO:</h5>\r\n<p>La solicitud es informada negativamente. Los estudios aportados no son los adecuados, y son imposibles de mejorar a trav&eacute;s de complementos de formaci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<h5>APTO CONDICIONADO:</h5>\r\n<p>El informe favorable de la solicitud queda condicionado a que el interesado realice complementos de formaci&oacute;n de hasta un m&aacute;ximo de 18 ECTS. Estos complementos se realizar&aacute;n en el seno de alguno de los m&aacute;steres oficiales que dan acceso directo al programa de doctorado y ser&aacute;n recomendados por la Comisi&oacute;n Acad&eacute;mica</p>\r\n</li>\r\n</ul>\r\n<br />\r\n<h4>Acceso para estudiantes a tiempo parcial:</h4>\r\n<p>En este caso, se deber&aacute; aportar la documentaci&oacute;n adecuada que justifique su adscripci&oacute;n al programa de doctorado en los t&eacute;rminos de dedicaci&oacute;n parcial. En general, se reconocer&aacute; esta modalidad a aquellos estudiantes que est&eacute;n realizando otra actividad laboral.</p>\r\n<br />\r\n<h4>Criterios de admisi&oacute;n:</h4>\r\n<p>La selecci&oacute;n de candidatos se realizar&aacute; de acuerdo al siguiente baremo:</p>\r\n<ul>\r\n<li>Nota media expediente (grado + m&aacute;ster): 70%</li>\r\n<li>Curr&iacute;culum acad&eacute;mico/profesional: 10% (posesi&oacute;n de otros t&iacute;tulos de m&aacute;ster, cursos, experiencia cient&iacute;fica, etc.)</li>\r\n<li>Metas profesionales: 5%</li>\r\n<li>Nivel de idiomas: 5%</li>\r\n<li>Otros m&eacute;ritos: 10%</li>\r\n</ul>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada (m&aacute;ximo 200 palabras) en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>La docencia de los complementos formativos se realizar&aacute; en paralelo con la matr&iacute;cula en los estudios de doctorado. La matr&iacute;cula podr&aacute; ser cancelada si los complementos de formaci&oacute;n no fuesen superados por el estudiante.</p>\r\n<br />\r\n<p>La comisi&oacute;n acad&eacute;mica &ndash;previo an&aacute;lisis de los estudios realizados por el alumno- determinar&aacute; los complementos de formaci&oacute;n que el estudiante necesita. Dichos complementos se seleccionar&aacute;n, de acuerdo a la l&iacute;nea de investigaci&oacute;n elegida por el solicitante, de entre las asignaturas de los m&aacute;steres que dan acceso directo al programa. El contenido, actividades formativas, evaluaci&oacute;n y planificaci&oacute;n de estos complementos se ajustar&aacute;n a lo establecido para dichas asignaturas.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de la Escuela Técnica Superior de Ingeniería Informática. Avenida de Reina Mercedes sn. 41012, Sevilla\",\"telefono\":\" (+34) 954552757\",\"nombre\":\"\",\"email\":\"secretaria-eii@listas.us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"95.455.64.72\",\"nombre\":\"Alberto Yúfera García\",\"email\":\"yufera@us.es\"}\r\n	]}}'),(23,'2014-04-09 09:22:35','3030','doctorado_imoi@us.es','http://institucional.us.es/webdimoi/','Ingeniería Mecánica y de Organización Industrial','2011','INGENIERÍA Y PROFESIONES AFINES','','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<h4>Perfil de ingreso recomendado o id&oacute;neo</h4>\r\n<p>Se recomienda que estudiantes que accedan al doctorado en su periodo de investigaci&oacute;n, idealmente, hayan cursado y por ende adquirido las capacidades, destrezas y conocimientos que otorga el M&aacute;ster Universitario en Qu&iacute;mica Te&oacute;rica y Modelizaci&oacute;n Computacional/ Theoretical Chemistry and Computational. Quienes opten al doctorado y no hayan seguido el m&aacute;ster anterior pero est&aacute;n en posesi&oacute;n de un t&iacute;tulo oficial de M&aacute;ster Universitario en Qu&iacute;mica, F&iacute;sica, Ciencias de los Materiales, Bioqu&iacute;mica, o alg&uacute;n otro del mismo nivel, que les provea de un conocimiento adecuado para seguir el doctorado pueden ser considerados como candidatos o candidatas. Las personas candidatas que no provengan del M&aacute;ster en Qu&iacute;mica Te&oacute;rica y Modelizaci&oacute;n Computacional/ Theoretical Chemistry and Computational y muestren deficiencias en su formaci&oacute;n en qu&iacute;mica te&oacute;rica y modelizaci&oacute;n computacional podr&aacute;n realizar complementos de formaci&oacute;n a consejo de sus directores y, en el caso, sus codirectores o por solicitud de la Comisi&oacute;n de Coordinaci&oacute;n Acad&eacute;mica del doctorado. El lenguaje empleado en el m&aacute;ster en Qu&iacute;mica Te&oacute;rica y Modelizaci&oacute;n Computacional/ Theoretical Chemistry and Computational, es el ingl&eacute;s con nivel B2. Por lo tanto, en el periodo de investigaci&oacute;n es muy recomendable poseer suficiencia en esta lengua.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Los requisitos de admisi&oacute;n son los establecidos en el art&iacute;culo 6 RD 99/2011 y en el perfil de ingreso recomendado.</p>\r\n<h4>Criterios de Admisi&oacute;n</h4>\r\n<p>Los estudiantes que cumplan los requisitos de acceso detallados anteriormente, podr&aacute;n ser admitidos en el programa de Doctorado. La Comisi&oacute;n de Coordinaci&oacute;n Acad&eacute;mica del Programa de Doctorado en Qu&iacute;mica Te&oacute;rica y Modelizaci&oacute;n Computacional/Theoretical Chemistry and Computational Modelling analizar&aacute; las solicitudes de admisi&oacute;n valorando los siguientes aspectos y m&eacute;ritos. Se indica entre par&eacute;ntesis el peso espec&iacute;fico, en t&eacute;rminos porcentuales, de cada uno de los criterios de admisi&oacute;n que se utilizar&aacute; para evaluar el CV del candidato o candidata.</p>\r\n<br />\r\n<ul>\r\n<li>Las calificaciones obtenidas en el grado y/o m&aacute;ster que haya realizado (55%).</li>\r\n<li>Las publicaciones en revistas y comunicaciones a congresos realizadas, en especial las derivadas de la tesis de m&aacute;ster (15 %).</li>\r\n<li>Certificado de Nivel de ingl&eacute;s, m&iacute;nimo recomendado B2 (10 %).</li>\r\n<li>Carta de referencia de dos profesores que no pertenezcan al programa de doctorado y que hayan participado en la formaci&oacute;n del estudiante (10%).</li>\r\n<li>Otros m&eacute;ritos relevantes alegados en su CV (10 %).</li>\r\n</ul>\r\n<br />\r\n<p>El programa de doctorado, y de acuerdo con las normativas existentes en las Universidades participantes, contempla la realizaci&oacute;n de estudios de doctorado a tiempo parcial. Los criterios y procedimientos de admisi&oacute;n para estudiantes que opten por esta modalidad de estudios ser&aacute;n exactamente los mismos que los de estudiantes a tiempo completo.</p>\r\n<br />\r\n<p>Se recomienda que los estudiantes que accedan al doctorado hayan cursado un grado en Qu&iacute;mica, F&iacute;sica, Ciencias de los Materiales o &aacute;reas afines y que hayan realizado al menos 60 ECTS en el m&aacute;ster en \"Qu&iacute;mica Te&oacute;rica y Modelizaci&oacute;n Computacional\", el m&aacute;ster \"Qu&iacute;mica Te&oacute;rica y Computacional\" o m&aacute;steres en las &aacute;reas de Qu&iacute;mica, F&iacute;sica, Ciencias de los Materiales con un importante contenido te&oacute;rico y orientaci&oacute;n investigadora. Egresados de los dos m&aacute;steres indicados constituyen el mayor porcentaje de estudiantes de nuevo ingreso en este programa de doctorado.</p>\r\n<br />\r\n<p>Sin embargo, tambi&eacute;n existen estudiantes provenientes de otros masters de orientaci&oacute;n investigadora impartidos en las Universidades participantes. En aquellos casos en los cuales la Comisi&oacute;n de Coordinaci&oacute;n Acad&eacute;mica considere que la formaci&oacute;n previa de la persona candidata no es suficiente o no es adecuada para el acceso al programa de doctorado, se podr&aacute; exigir que se realicen complementos de formaci&oacute;n espec&iacute;fica.</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum vitae indicando experiencia profesional e investigadora, publicaciones, formaci&oacute;n impartida y recibida. (obligatoria).</li>\r\n<li>Carta de motivaci&oacute;n, indicando el &aacute;mbito de inter&eacute;s para realizar la tesis doctoral, la experiencia previa en dicho &aacute;mbito y una propuesta de proyecto de tesis y programa de trabajo (incluyendo posibles contactos previos con un posible tutor/director y posibilidades de financiaci&oacute;n).(opcional).</li>\r\n<li>Acreditaci&oacute;n de conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencia y discusiones cient&iacute;ficas y dominio de la expresi&oacute;n escrita. (opcional).</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>La v&iacute;a de acceso recomendada para el programa de doctorado es la realizaci&oacute;n de un grado en Qu&iacute;mica, F&iacute;sica o Ciencia de Materiales y la posterior realizaci&oacute;n de uno de los dos masteres oficiales siguientes: el M&aacute;ster en Qu&iacute;mica Te&oacute;rica y Modelizaci&oacute;n Computacional o el M&aacute;ster en Qu&iacute;mica Te&oacute;rica y Computacional.</p>\r\n<br />\r\n<p>En aquellos casos en que se haya realizado un grado o un m&aacute;ster distinto a los indicados la Comisi&oacute;n de Coordinaci&oacute;n Acad&eacute;mica podr&aacute; establecer complementos de formaci&oacute;n que ser&aacute;n en cualquier caso, asignaturas del primer a&ntilde;o de los citados m&aacute;steres hasta un m&aacute;ximo de 20 cr&eacute;ditos. Estos complementos de formaci&oacute;n espec&iacute;fica tendr&aacute;n, a efectos de precios p&uacute;blicos y de concesi&oacute;n de becas y ayudas al estudio, la consideraci&oacute;n de formaci&oacute;n de nivel de doctorado. El tiempo que se dedique a esta formaci&oacute;n espec&iacute;fica no se computar&aacute; a efectos del l&iacute;mite de tres a&ntilde;os a contar desde la admisi&oacute;n del doctorando o doctoranda al programa, hasta la presentaci&oacute;n de la tesis doctoral, tal y como establece el art&iacute;culo 3.2 del RD 99/2011 Los complementos de formaci&oacute;n cursados se registrar&aacute;n en el documento de actividades del doctorando.</p>\r\n<br />\r\n<p>Aquellos casos en los que la v&iacute;a de acceso sea un grado cuya duraci&oacute;n sea de al menos 300 ECTS y no se haya realizado ning&uacute;n m&aacute;ster previo, la realizaci&oacute;n de estos complementos formativos ser&aacute; obligatoria, salvo que el correspondiente plan de estudios contemple cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n. En los anteriores casos el director o directora de tesis estar&aacute; encargado de sugerir los complementos requeridos y ser&aacute; la Comisi&oacute;n de Coordinaci&oacute;n Acad&eacute;mica del doctorado la que finalmente decida los complementos de formaci&oacute;n a realizar por cada estudiante a la vista de su historial acad&eacute;mico previo.</p>\r\n<br />\r\n<p>Como complementos de formaci&oacute;n se impartir&aacute;n las asignaturas obligatorias del primer a&ntilde;o de los m&aacute;steres mencionados, no superando el alumno en ning&uacute;n caso un total de m&aacute;s de 20 ECTS. En particular se considerar&aacute;n asignaturas que con el t&iacute;tulo rese&ntilde;ado o al menos con los contenidos tem&aacute;ticos siguientes:</p>\r\n<br />\r\n<ul>\r\n<li>Fundamentos Matem&aacute;ticos de la Mec&aacute;nica Cu&aacute;ntica (5 ECTS)</li>\r\n<li>Mec&aacute;nica Estad&iacute;stica y aplicaciones en simulaci&oacute;n (5 ECTS)</li>\r\n<li>M&eacute;todos de la Qu&iacute;mica Te&oacute;rica I (5 ECTS)</li>\r\n<li>M&eacute;todos de la Qu&iacute;mica Te&oacute;rica II (5 ECTS)</li>\r\n</ul>\r\n<br />\r\n<p>Estas asignaturas se realizar&aacute;n despu&eacute;s de la admisi&oacute;n y matriculaci&oacute;n al programa de doctorado y se podr&aacute;n seguir a nivel local o en cursos intensivos organizados de forma conjunta por las Universidades participantes. Se dispondr&aacute;, como m&aacute;ximo, de un curso acad&eacute;mico para superar los complementos de formaci&oacute;n requeridos. Se tendr&aacute;n que superar los mismos para continuar el programa de doctorado..</p>\r\n<br />\r\n<p>Independientemente del grado realizado previamente, todos los alumnos que no hayan realizado un m&aacute;ster que incluya el aprendizaje de Qu&iacute;mica Te&oacute;rica o herramientas de simulaci&oacute;n deber&aacute;n realizar complementos de formaci&oacute;n.</p>\r\n<br />\r\n<p>A la hora de asignar los complementos formativos se estudiar&aacute; cada caso individualmente. Se considerar&aacute;n los siguientes perfiles gen&eacute;ricos:</p>\r\n<br /><ol>\r\n<li>Alumnos provenientes del grado de Qu&iacute;mica y de m&aacute;steres de Qu&iacute;mica que no incluyan formaci&oacute;n espec&iacute;fica en t&eacute;cnicas de simulaci&oacute;n o Qu&iacute;mica Te&oacute;rica. Deber&aacute;n realizar las 4 asignaturas mencionadas</li>\r\n<li>Alumnos provenientes del grado de F&iacute;sica o Ciencias de Materiales y de m&aacute;steres de F&iacute;sica deber&aacute;n realizar las asignaturas: M&eacute;todos de la Qu&iacute;mica Te&oacute;rica I y M&eacute;todos de la Qu&iacute;mica Te&oacute;rica II (5 ECTS)</li>\r\n<li>Alumnos provenientes del grado y m&aacute;steres de Matem&aacute;ticas Deber&aacute;n realizar las asignaturas: Mec&aacute;nica Estad&iacute;stica y aplicaciones en simulaci&oacute;n, M&eacute;todos de la Qu&iacute;mica Te&oacute;rica I y M&eacute;todos de la Qu&iacute;mica Te&oacute;rica II (5 ECTS)</li>\r\n<li>El resto de alumnos provenientes de otros grados y m&aacute;steres deber&aacute;n cursar las 4 asignaturas mencionadas.</li>\r\n</ol><br />\r\n<p>A la vista de la formaci&oacute;n previa, el Curriculum Vitae y los cursos realizados de cada estudiante analizando toda la trayectoria formativa previa del estudiante (estudios de grado y master realizados y las asignaturas cursadas en ellos) la comisi&oacute;n de coordinaci&oacute;n Acad&eacute;mica podr&aacute; decidir que un estudiante haga menos cursos que los indicados anteriormente.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Escuela Técnica Superior de Ingeniería\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954482135\",\"nombre\":\"Vladislav Mantic Lescisin\",\"email\":\"mantic@us.es\"}\r\n	]}}'),(24,'2014-04-09 09:22:44','3022','admin2-imus@us.es','http://www.imus.us.es/doctorado/','Matemáticas','2011','MATEMÁTICAS','','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Se recomienda a los estudiantes que deseen acceder el programa de doctorado que hayan cursado estudios de matem&aacute;ticas a nivel de m&aacute;ster universitario oficial o similar.</p>\r\n<p>Los estudiantes deber&aacute;n tener capacidad para desarrollar trabajos de recopilaci&oacute;n de informaci&oacute;n matem&aacute;tica, de revisi&oacute;n de contenidos y demostraci&oacute;n de resultados. Es recomendable tener un buen nivel de ingl&eacute;s tanto le&iacute;do como escrito. Dado que parte de la formaci&oacute;n se podr&aacute; impartir en lengua inglesa, asimismo se recomienda cierta fluidez en ingl&eacute;s hablado.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Criterios de admisi&oacute;n</h4>\r\n<p>Dan acceso directo al programa de doctorado \"Matem&aacute;ticas\" los t&iacute;tulos oficiales de m&aacute;ster universitario en &ldquo;Matem&aacute;tica Avanzada&rdquo; y &ldquo;Matem&aacute;tica Computacional&rdquo; de la Universidad de Sevilla, as&iacute; como el t&iacute;tulo de m&aacute;ster universitario en &ldquo;L&oacute;gica, Computaci&oacute;n e Inteligencia Artificial&rdquo; de la Universidad de Sevilla para aquellos alumnos que sean Licenciados o Graduados en Matem&aacute;ticas.</p>\r\n<br />\r\n<p>De forma alternativa, se podr&aacute; acceder al mismo si se dispone de T&iacute;tulo oficial de M&aacute;ster Universitario en matem&aacute;ticas, u otro del mismo nivel expedido por una instituci&oacute;n de educaci&oacute;n superior del EEES u otros t&iacute;tulos obtenidos conforme a sistemas educativos ajenos al EEES, en todos los casos previo informe favorable de la Comisi&oacute;n Acad&eacute;mica del programa</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>De forma general, previo informe de la comisi&oacute;n acad&eacute;mica del programa, se requerir&aacute; a todos los estudiantes que no hayan cursado cr&eacute;ditos de investigaci&oacute;n en &aacute;reas relacionadas con las matem&aacute;ticas que realicen complementos de formaci&oacute;n en la forma de un m&aacute;ximo de 18 ECTS en cr&eacute;ditos de investigaci&oacute;n (excepcionalmente, se podr&aacute; llegar a 24 ECTS cuando las exigencias del plan formativo del M&aacute;ster lo requieran) del m&aacute;ster universitario oficial de &ldquo;Matem&aacute;tica Avanzada&rdquo; o &ldquo;Matem&aacute;tica Computacional&rdquo; de la oferta de la Universidad de Sevilla.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"955420840\",\"nombre\":\"María del Carmen Barriga Flores\",\"email\":\"admin2-imus@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954.556.834\",\"nombre\":\"Antonio Suárez Fernández\",\"email\":\"suarez@us.es\"}\r\n	]}}'),(25,'2014-04-09 09:22:55','3023','doctorado_psicologia@us.es','http://doctoradopsicosevilla.es/','Psicología','2011','PSICOLOGÍA','PSICOLOGÍA','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Se podr&aacute; acceder al Programa de Doctorado en los siguientes casos :</p>\r\n<br />\r\n<ul>\r\n<li>Estar en posesi&oacute;n del t&iacute;tulo oficial de M&aacute;ster correspondiente a las &aacute;reas de Ciencias de la Salud o de Ciencias Sociales y Jur&iacute;dicas, expedido en Espa&ntilde;a u otro expedido por una instituci&oacute;n oficial perteneciente al Espacio Europeo de Educaci&oacute;n Superior (EEES) que faculte en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a ense&ntilde;anzas de Doctorado, o, en su caso, haber cursado 60 cr&eacute;ditos de t&iacute;tulo oficial de M&aacute;ster de las &aacute;reas citadas, tal como establece el Real Decreto 99/2011, de 28 de enero, por el que se regulan las ense&ntilde;anzas oficiales de doctorado</li>\r\n<li>Los Titulados de M&aacute;ster de Ciencias de la Salud o de Ciencias Sociales y Jur&iacute;dicas realizados conforme a sistemas educativos ajenos al EEES podr&aacute;n acceder al Programa de Doctorado sin necesidad de homologar sus t&iacute;tulos. Previamente, la Universidad deber&aacute; comprobar que acreditan un nivel de formaci&oacute;n equivalente a los correspondientes t&iacute;tulos universitarios oficiales espa&ntilde;oles y que la titulaci&oacute;n obtenida faculta, en el pa&iacute;s expedidor del t&iacute;tulo, para el acceso a ense&ntilde;anzas de Doctorado. El acceso por esta v&iacute;a no implicar&aacute; en ning&uacute;n caso la homologaci&oacute;n del t&iacute;tulo previo de que est&eacute; en posesi&oacute;n el interesado, ni su reconocimiento a otros efectos que el de cursar las ense&ntilde;anzas de Doctorado.</li>\r\n<li>Para el acceso a los estudios de Doctorado en Psicolog&iacute;a desde titulaciones de M&aacute;ster correspondientes a &aacute;reas diferentes a las Ciencias de la Salud o a las Ciencias Sociales y Jur&iacute;dicas, la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado decidir&aacute; tras la comprobaci&oacute;n de una serie de capacidades y conocimientos previos exigidos a todo estudiante del programa.</li>\r\n</ul>\r\n<br />\r\n<h4>Conocimientos y capacidades previos</h4>\r\n<ol type=\"a\">\r\n<li>\r\n<h5>Idiomas</h5>\r\n<p>El desarrollo del programa se har&aacute; en castellano, aunque se utilizar&aacute; el ingl&eacute;s instrumentalmente en todos aquellos textos cient&iacute;ficos, conferencias, cursos y/o seminarios que se consideren oportunos</p>\r\n</li>\r\n<li>\r\n<h5>Conocimientos</h5>\r\n<p>Sobre la Psicolog&iacute;a como disciplina cient&iacute;fica, sus distintos modelos te&oacute;ricos, conocimientos sobre procesos psicol&oacute;gicos b&aacute;sicos, sus etapas de desarrollo, fundamentos biol&oacute;gicos de la conducta humana y de las funciones psicol&oacute;gicas, principios psicosociales que intervienen en el comportamiento, y principios y procesos b&aacute;sicos del funcionamiento de la personalidad y de la psicopatolog&iacute;a. Asimismo, deber&aacute; conocer m&eacute;todos y dise&ntilde;os de investigaci&oacute;n y t&eacute;cnicas de an&aacute;lisis e interpretaci&oacute;n de datos propios de la Psicolog&iacute;a y relevantes para el trabajo profesional.</p>\r\n</li>\r\n<li>\r\n<h5>Capacidades</h5>\r\n<p>El alumno/a de doctorado debe ser capaz de demostrar una serie de capacidades que se detallan a continuaci&oacute;n:</p>\r\n<br />\r\n<p>c.1) Sobre manejo y generaci&oacute;n de informaci&oacute;n cient&iacute;fica. El estudiante de doctorado sabr&aacute;: distinguir informaci&oacute;n relevante e irrelevante en una situaci&oacute;n real o simulada para la consecuci&oacute;n de una meta profesional concreta; tener capacidad de an&aacute;lisis y s&iacute;ntesis de informaci&oacute;n; formular hip&oacute;tesis para explicar una situaci&oacute;n y establecer procedimientos v&aacute;lidos para su comprobaci&oacute;n; llegar a conclusiones v&aacute;lidas a partir de datos emp&iacute;ricos; localizar informaci&oacute;n concreta, expl&iacute;cita e impl&iacute;cita en textos escritos y discursos orales, organizando dicha informaci&oacute;n y construyendo conocimiento a partir de ella. Igualmente deber&aacute; ser capaz de: integrar conocimiento declarativo de diferente naturaleza procedente de distintas disciplinas, contextos y fuentes; traducir conocimientos declarativos te&oacute;ricos en pautas de an&aacute;lisis y acci&oacute;n ante situaciones concretas, tales como hip&oacute;tesis, estrategias, etc.; conocer y/o elaborar modelos para la comprensi&oacute;n de la realidad; formular valoraciones y propuestas originales ante los modelos te&oacute;ricos y aportaciones cient&iacute;ficas existentes; utilizar las diversas tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n manejando, a nivel de usuario, el software de uso m&aacute;s frecuente en la pr&aacute;ctica profesional y en la investigaci&oacute;n cient&iacute;fica; planificar y realizar b&uacute;squedas bibliogr&aacute;ficas o de referencias tanto en bases de datos informatizadas como en bibliotecas, hemerotecas o docimotecas.</p>\r\n<br />\r\n<p>c.2) Sobre recursos propios y manejo del contexto. Tendr&aacute; capacidad de: detectar necesidades, limitaciones y recursos en grupos humanos; plantearse metas y actuar en consonancia con las mismas; argumentar de forma verbal y/o escrita las propias actuaciones; modificar pautas generales de actuaci&oacute;n en funci&oacute;n de condiciones personales y/o contextuales; optimizar los recursos con los que se cuenta; valorar las consecuencias de la propia actuaci&oacute;n y adoptar las modificaciones pertinentes; generar ideas originales y soluciones nuevas; adaptarse a un entorno cambiante, afrontando nuevas tareas y responsabilidades, y generando procesos de cambio; valorar cr&iacute;ticamente la exactitud y adecuaci&oacute;n de los resultados alcanzados.</p>\r\n<p>Del mismo modo deben haber desarrollado habilidades de aprendizaje necesarias para continuar aprendiendo a lo largo de toda la vida con un alto grado de autonom&iacute;a, y tomar conciencia de los propios conocimientos y limitaciones, as&iacute; como desarrollar procedimientos y estrategias para compensar o superar las limitaciones propias.</p>\r\n<br />\r\n<p>c.3) Sobre capacidades comunicativas y de trabajo en equipo. Deben ser capaces de: transmitir informaci&oacute;n, ideas, problemas y soluciones propias de su &aacute;mbito acad&eacute;mico y profesional a un p&uacute;blico tanto especializado como no especializado; usar con precisi&oacute;n y correcci&oacute;n el lenguaje oral y escrito; percibir similitudes y diferencias entre puntos de vista; buscar conclusiones de consenso superadoras; comprender del punto de vista ajeno, aunque no sea compartido; extraer conclusiones personales a partir de discusiones de grupo; aceptar la diferencia de puntos de vista en un grupo; valorar aportaciones de otras disciplinas y profesionales afines y ser capaz de trabajar en equipos interdisciplinares; desarrollar capacidades de liderazgo e iniciativa; perseguir la excelencia en las actuaciones profesionales e investigadoras.</p>\r\n</li>\r\n</ol><br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Criterios generales de admisi&oacute;n:</h4>\r\n<p>Los aspirantes deber&aacute;n cumplir los requisitos establecidos en el art. 6 del RD 99/2011 y por la normativa de la Universidad de Sevilla para el acceso a los estudios de doctorado. Para ello deber&aacute;n estar en posesi&oacute;n de los t&iacute;tulos oficiales de Grado, o equivalente, y de M&aacute;ster Universitario o, en su caso, haber cursado 60 cr&eacute;ditos de M&aacute;ster Unversitario, tal como establece el RD 99/2011, de 28 de enero, por el que se regulan las ense&ntilde;anzas oficiales de doctorado. En concreto, dependiendo de la titulaci&oacute;n previa, los requisitos para el acceso son:</p>\r\n<ul>\r\n<li>Candidatos/as con t&iacute;tulo de licenciatura o grados de 240 ECTS: deber&aacute;n haber cursado 60 cr&eacute;ditos de un m&aacute;ster universitario que incluya, al menos, 10 cr&eacute;ditos ECTS metodol&oacute;gicos y de formaci&oacute;n en investigaci&oacute;n y haber realizado un trabajo de fin de m&aacute;ster con car&aacute;cter investigador, con un valor equivalente a 10 ECTS.</li>\r\n<li>Candidatos/as con t&iacute;tulo de licenciatura, o grados de 240 ECTS que hayan cursado 60 cr&eacute;ditos de un m&aacute;ster que no incluya formaci&oacute;n investigadora: deber&aacute;n haber cursado complementos de formaci&oacute;n de estudios de Doctorado constituidos por 10 cr&eacute;ditos ECTS metodol&oacute;gicos y de formaci&oacute;n en investigaci&oacute;n y un trabajo de investigaci&oacute;n equivalente a 10 ECTS</li>\r\n<li>Graduados/as cuyos estudios, conforme a las normas de derecho comunitario, tengan como m&iacute;nimo 300 ECTS: deber&aacute;n haber cursado complementos de formaci&oacute;n de estudios de Doctorado constituidos por 10 cr&eacute;ditos ECTS metodol&oacute;gicos y de formaci&oacute;n en investigaci&oacute;n y un trabajo de investigaci&oacute;n equivalente a 10 ECTS.</li>\r\n<li>Titulados/as universitarios que, previa obtenci&oacute;n de plaza en formaci&oacute;n en la correspondiente prueba de acceso a plazas de formaci&oacute;n sanitaria especializada, hayan superado con evaluaci&oacute;n positiva al menos dos a&ntilde;os de formaci&oacute;n de un programa para la obtenci&oacute;n del t&iacute;tulo oficial de alguna de las especialidades en Ciencias de la Salud.</li>\r\n<li>Candidatos/as que hayan obtenido el t&iacute;tulo de Doctor o Doctora conforme a anteriores ordenaciones universitarias o que est&eacute;n en posesi&oacute;n del Diploma de Estudios Avanzados (RD 778/1998, de 30 de abril), o hubieran alcanzado la suficiencia investigadora (RD 185/1985, de 23 de enero): podr&aacute;n ser admitidos directamente o deber&aacute;n cursar los complementos de formaci&oacute;n de estudios de Doctorado que establezca la Comisi&oacute;n Acad&eacute;mica.</li>\r\n<li>Candidatos/as en posesi&oacute;n de un t&iacute;tulo universitario de M&aacute;ster obtenido conforme a sistemas educativos extranjeros. Podr&aacute;n ser admitidas a los estudios de Doctorado sin necesidad de la homologaci&oacute;n del t&iacute;tulo y previa comprobaci&oacute;n por parte de la Universidad de Sevilla de que acreditan un nivel de formaci&oacute;n equivalente a los correspondientes t&iacute;tulos espa&ntilde;oles de M&aacute;ster universitario.</li>\r\n</ul>\r\n<br />\r\n<h4>Requisitos espec&iacute;ficos del programa de doctorado:</h4>\r\n<p>Los requisitos establecidos son:</p>\r\n<ul>\r\n<li>Estar en posesi&oacute;n del t&iacute;tulo oficial de M&aacute;ster correspondiente a las &aacute;reas de Ciencias de la Salud o de Ciencias Sociales y Jur&iacute;dicas, expedido en Espa&ntilde;a u otro expedido por una instituci&oacute;n oficial perteneciente al Espacio Europeo de Educaci&oacute;n Superior (EEES) que faculte en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a ense&ntilde;anzas de Doctorado o, en su caso, haber cursado 60 cr&eacute;ditos de un t&iacute;tulo oficial de M&aacute;ster de las &aacute;reas anteriores, tal como establece el RD 99/2011, de 28 de enero, por el que se regulan las ense&ntilde;anzas oficiales de doctorado.</li>\r\n<li>Los Titulados de M&aacute;steres de Ciencias de la Salud o de Ciencias Sociales y Jur&iacute;dicas realizados conforme a sistemas educativos ajenos al EEES podr&aacute;n acceder al Programa de Doctorado sin necesidad de homologar sus t&iacute;tulos. Previamente, la Universidad deber&aacute; comprobar que acreditan un nivel de formaci&oacute;n equivalente a los correspondientes t&iacute;tulos universitarios oficiales espa&ntilde;oles y que la titulaci&oacute;n obtenida faculta, en el pa&iacute;s expedidor del t&iacute;tulo, para el acceso a ense&ntilde;anzas de Doctorado. El acceso por esta v&iacute;a no implicar&aacute; en ning&uacute;n caso la homologaci&oacute;n del t&iacute;tulo previo de que est&eacute; en posesi&oacute;n el interesado, ni su reconocimiento a otros efectos que el de cursar las ense&ntilde;anzas de Doctorado.</li>\r\n<li>Para el acceso a los estudios de Doctorado en Psicolog&iacute;a desde titulaciones de M&aacute;ster correspondientes a &aacute;reas diferentes a las Ciencias de la Salud o a las Ciencias Sociales y Jur&iacute;dicas, la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado decidir&aacute; tras la comprobaci&oacute;n de una serie de capacidades y conocimientos previos exigidos a todo estudiante del programa de Doctorado, y que se detallan en el siguiente apartado.</li>\r\n</ul>\r\n<br />\r\n<h4>Baremo para la selecci&oacute;n de candidatos/as</h4>\r\n<p>El baremo que aplicar&aacute; la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado en Psicolog&iacute;a incluye los siguientes apartados:</p>\r\n<ol>\r\n<li>Competencias de investigaci&oacute;n y profesionales relevantes para el Doctorado en Psicolog&iacute;a (60%). Para evaluar este apartado se tienen en cuenta los siguientes aspectos<ol type=\"a\">\r\n<li>Competencias para la realizaci&oacute;n y difusi&oacute;n de los resultados de los trabajos de investigaci&oacute;n.</li>\r\n<li>Experiencia profesional relevante.</li>\r\n<li>Inserci&oacute;n en l&iacute;neas de investigaci&oacute;n del Programa de Doctorado en Psicolog&iacute;a.</li>\r\n<li>Competencias relacionadas con las metodolog&iacute;as y t&eacute;cnicas de investigaci&oacute;n</li>\r\n</ol></li>\r\n<li>Otros m&eacute;ritos y competencias relevantes para el Doctorado en Psicolog&iacute;a (40%). Para evaluar este apartado se tienen en cuenta los siguientes aspectos<ol type=\"a\">\r\n<li>Conocimientos de idiomas.</li>\r\n<li>Otra formaci&oacute;n espec&iacute;fica para el Doctorado en Psicolog&iacute;a.</li>\r\n<li>Motivaci&oacute;n, inter&eacute;s y disponibilidad para el Doctorado en Psicolog&iacute;a.</li>\r\n<li>Movilidad.</li>\r\n</ol></li>\r\n</ol><br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato, con acreditaci&oacute;n de los m&eacute;ritos presentados.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito..</li>\r\n<li>Copia de alg&uacute;n trabajo de investigaci&oacute;n realizado por el/la candidata/a: publicaciones, Trabajo Fin de M&aacute;ster o equivalente.</li>\r\n<li>Carta de recomendaci&oacute;n firmada por alg&uacute;n/a profesor/a del Programa de Doctorado o por alg&uacute;n miembro de otra instituci&oacute;n (acad&eacute;mica) nacional o internacional.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Los/as estudiantes de doctorado que procedan de programas en los que la Comisi&oacute;n acad&eacute;mica entienda que no hay suficiente formaci&oacute;n metodol&oacute;gica deber&aacute;n de cursar durante el primer a&ntilde;o de su formaci&oacute;n doctoral uno o varios m&oacute;dulos de metodolog&iacute;a (seg&uacute;n proceda) en los M&aacute;steres Universitarios Oficiales ofertados en la Facultad de Psicolog&iacute;a (incluidos, por tanto, dentro de la oferta de la Universidad de Sevilla). La formaci&oacute;n metodol&oacute;gica m&iacute;nima ser&aacute; de 32 cr&eacute;ditos ECTS, entre los cu&aacute;les se computar&aacute;n los cr&eacute;ditos cursados en grado y m&aacute;ster. Esto implica que un alumno que haya cursado el Grado en Psicolog&iacute;a de la Universidad de Sevilla y un m&aacute;ster de la misma facultad deber&aacute; realizar en torno a 100 horas de formaci&oacute;n metodol&oacute;gica adicional (4 ECTS). Los m&oacute;dulos que se podr&aacute;n cursar en el &aacute;mbito de la formaci&oacute;n reglada que ya ofrece la Facultad de Psicolog&iacute;a son los siguientes:</p>\r\n<ul>\r\n<li>An&aacute;lisis Exploratorio de Datos (M&aacute;ster Estudios Avanzados en Cerebro y Conducta) (5 ECTS)</li>\r\n<li>Construcci&oacute;n y an&aacute;lisis de &iacute;tems para pruebas psicol&oacute;gicas (M&aacute;ster Estudios Avanzados en Cerebro y Conducta) (5)</li>\r\n<li>M&eacute;todos cuantitativos y Deterioro Cognitivo (M&aacute;ster Estudios Avanzados en Cerebro y Conducta) (5)</li>\r\n<li>An&aacute;lisis de Datos e Investigaci&oacute;n en Contextos Familiares (M&aacute;ster en Intervenci&oacute;n y Mediaci&oacute;n Familiar) (5)</li>\r\n<li>Herramientas Metodol&oacute;gicas para la Investigaci&oacute;n e Intervenci&oacute;n Psicoeducativas (M&aacute;ster en Psicolog&iacute;a de la Educaci&oacute;n) (4)</li>\r\n<li>Metodolog&iacute;a de la investigaci&oacute;n comunitaria (M&aacute;ster en Psicolog&iacute;a de la Intervenci&oacute;n Social y Comunitaria) (4)</li>\r\n<li>Dise&ntilde;o y Medici&oacute;n de la Intervenci&oacute;n y la Evaluaci&oacute;n Cl&iacute;nica y de la Salud (4)</li>\r\n<li>Herramientas Metodol&oacute;gicas Avanzadas en la Intervenci&oacute;n y la Evaluaci&oacute;n (4)Cl&iacute;nica y de la Salud (M&aacute;ster Universitario en Psicolog&iacute;a de la Salud (4)</li>\r\n<li>Herramientas Metodol&oacute;gicas Avanzadas en la Intervenci&oacute;n y la Evaluaci&oacute;n (4)Cl&iacute;nica y de la Salud (M&aacute;ster Universitario en Psicolog&iacute;a de la Salud (4)</li>\r\n</ul>\r\n<p>El m&aacute;ximo de formaci&oacute;n complementaria metodol&oacute;gica que podr&aacute; ser asignada a un alumno ser&aacute;n 18 ECTS.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\" Decanato. Despacho 5 . Facultad de Psicología\",\"telefono\":\"954556216-954557819\",\"nombre\":\"Manuel L. de la Mata Benítez y Estrella Díaz Argandoña\",\"email\":\"doctorado_psicologia@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\" Decanato. Despacho 5 . Facultad de Psicología\",\"telefono\":\"954556216-954557819\",\"nombre\":\"Manuel L. de la Mata Benítez y Estrella Díaz Argandoña\",\"email\":\"doctorado_psicologia@us.es\"}\r\n	]}}'),(26,'2014-04-09 09:23:06','3024','doctoradorrhh@us.es','http://www.doctorado.us.es/oferta-estudios-doctorado/oferta-plan-2011/psicologia-de-los-recursos-humanos-plan-2011','Psicología de los Recursos Humanos','2011','PSICOLOGÍA','CIENCIAS SOCIALES Y DEL COMPORTAMIENTO','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El perfil de ingreso recomendado es el de un graduado que haya cursado alguno de los m&aacute;steres que dan acceso prioritario al programa: M&aacute;ster Universitario en Psicolog&iacute;a de las Organizaciones y del Trabajo (Universidad de Sevilla), M&aacute;ster Universitario de Psicolog&iacute;a de la Intervenci&oacute;n Social y Comunitaria (Universidad de Sevilla), M&aacute;ster Universitario en Gesti&oacute;n y Desarrollo de Recursos Humanos (perfil investigador) ( Universidad de Sevilla), M&aacute;ster oficial de Psicolog&iacute;a del Trabajo, de las Organizaciones y de los Recursos Humanos (Universidad de Valencia), y M&aacute;ster oficial Erasmus Mundus de Psicolog&iacute;a del Trabajo, de las Organizaciones y de los Recursos Humanos (Universidad de Valencia).</p>\r\n<br />\r\n<p>Adem&aacute;s, se requiere un nivel de ingl&eacute;s m&iacute;nimo de B1 y una formaci&oacute;n s&oacute;lida en metodolog&iacute;a de investigaci&oacute;n en Ciencias del Comportamiento y Sociales con dominio de t&eacute;cnicas de an&aacute;lisis estad&iacute;stico multivariado.</p>\r\n<br />\r\n<p>Finalmente, se recomienda presencia en el centro de investigaci&oacute;n en el que se ha admitido al doctorando y dedicaci&oacute;n a tiempo completo. Tambi&eacute;n se espera del doctorando disponibilidad para realizar una estancia de una duraci&oacute;n m&iacute;nima de tres meses. Desde el comienzo, el doctorando estar&aacute; incluido en un equipo de investigaci&oacute;n, dispondr&aacute; de un espacio de trabajo y cumplir&aacute; una jornada de trabajo a tiempo completo. No obstante, el programa tambi&eacute;n ofertar&aacute; plazas para doctorandos a tiempo parcial, cuyos requisitos de ingreso ser&aacute;n los mismos, s&oacute;lo cambiar&aacute; su tiempo de dedicaci&oacute;n al programa que tendr&aacute; que ser al menos de 20 horas semanales.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Seg&uacute;n se establece en el art&iacute;culo 6 del Real Decreto 99/2011, de 28 de enero son requisitos de acceso al doctorado los siguientes:</p>\r\n<ul>\r\n<li>Con car&aacute;cter general, para el acceso a un programa oficial de doctorado ser&aacute; necesario estar en posesi&oacute;n de los t&iacute;tulos oficiales espa&ntilde;oles de Grado, o equivalente, y de M&aacute;ster Universitario.</li>\r\n<li>Asimismo podr&aacute;n acceder quienes se encuentren en alguno de los siguientes supuestos:<ol type=\"a\">\r\n<li>Estar en posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol, o de otro pa&iacute;s integrante del EEES, que habilite para el acceso a M&aacute;ster de acuerdo con lo establecido en el art&iacute;culo 16 del Real Decreto 1393/2007, de 29 de octubre y haber superado un m&iacute;nimo de 300 cr&eacute;ditos ECTS en el conjunto de estudios universitarios oficiales, de los que, al menos 60, habr&aacute;n de ser de nivel de M&aacute;ster.</li>\r\n<li>Estar en posesi&oacute;n de un t&iacute;tulo oficial espa&ntilde;ol de Graduado o Graduada, cuya duraci&oacute;n, conforme a normas de derecho comunitario, sea de al menos 300 cr&eacute;ditos ECTS. Dichos titulados deber&aacute;n cursar con car&aacute;cter obligatorio los complementos de formaci&oacute;n a que se refiere el art&iacute;culo 7.2 de esta norma, salvo que el plan de estudios del correspondiente t&iacute;tulo de grado incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n, equivalentes en valor formativo a los cr&eacute;ditos en investigaci&oacute;n procedentes de estudios de M&aacute;ster.</li>\r\n<li>Los titulados universitarios que, previa obtenci&oacute;n de plaza en formaci&oacute;n en la correspondiente prueba de acceso a plazas de formaci&oacute;n sanitaria especializada, hayan superado con evaluaci&oacute;n positiva al menos dos a&ntilde;os de formaci&oacute;n de un programa para la obtenci&oacute;n del t&iacute;tulo oficial de alguna de las especialidades en Ciencias de la Salud.</li>\r\n<li>Estar en posesi&oacute;n de un t&iacute;tulo obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologaci&oacute;n, previa comprobaci&oacute;n por la universidad de que &eacute;ste acredita un nivel de formaci&oacute;n equivalente a la del t&iacute;tulo oficial espa&ntilde;ol de M&aacute;ster Universitario y que faculta en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a estudios de doctorado. Esta admisi&oacute;n no implicar&aacute;, en ning&uacute;n caso, la homologaci&oacute;n del t&iacute;tulo previo del que est&eacute; en posesi&oacute;n el interesado ni su reconocimiento a otros efectos que el del acceso a ense&ntilde;anzas de Doctorado.</li>\r\n<li>Estar en posesi&oacute;n de otro t&iacute;tulo espa&ntilde;ol de Doctor obtenido conforme a anteriores ordenaciones universitarias.</li>\r\n</ol></li>\r\n</ul>\r\n<br />\r\n<p>Adem&aacute;s, de acuerdo con lo que se establece en el art&iacute;culo 7 del citado real Decreto, en el programa de Doctorado de Psicolog&iacute;a de los Recursos Humanos, se establecen los siguientes requisitos espec&iacute;ficos del programa</p>\r\n<ol>\r\n<li>Haber cursado y superado 60 cr&eacute;ditos ECTS de los siguientes Master, que constituyen el periodo de formaci&oacute;n preferente del presente programa de doctorado. M&aacute;ster Universitario en Psicolog&iacute;a de las Organizaciones y del Trabajo (Universidad de Sevilla), M&aacute;ster Universitario de Psicolog&iacute;a de la Intervenci&oacute;n Social y Comunitaria (Universidad de Sevilla), M&aacute;ster Universitario en Gesti&oacute;n y Desarrollo de Recursos Humanos (perfil investigador) ( Universidad de Sevilla), M&aacute;ster oficial de Psicolog&iacute;a del Trabajo, de las Organizaciones y de los Recursos Humanos (Universidad de Valencia), y M&aacute;ster oficial Erasmus Mundus de Psicolog&iacute;a del Trabajo, de las Organizaciones y de los Recursos Humanos (Universidad de Valencia). Cuando la procedencia sea de estos Masters, la actividad en el periodo de investigaci&oacute;n se centrar&aacute; en la elaboraci&oacute;n de la tesis doctoral.</li>\r\n<li>Haber cursado y superado un m&iacute;nimo de 60 cr&eacute;ditos ECTS en otros m&aacute;steres afines tales como los relacionados con la gesti&oacute;n y direcci&oacute;n de recursos humanos o los de prevenci&oacute;n de riesgos laborales. En este supuesto, los estudiantes tendr&aacute;n que realizar durante su primer a&ntilde;o del per&iacute;odo de investigaci&oacute;n 24 cr&eacute;ditos ECTS en los m&oacute;dulos que se detallar&aacute;n en el apartado de Complementos Formativos.</li>\r\n</ol><br />\r\n<p>El &oacute;rgano encargado de la admisi&oacute;n del doctorando ser&aacute; la Comisi&oacute;n Acad&eacute;mica del programa.</p>\r\n<br />\r\n<p>Los procedimientos de selecci&oacute;n de los estudiantes se orientan a la calidad y al logro de un buen desempe&ntilde;o en el doctorado. Desde el inicio, se ha de orientar al doctorando hacia la producci&oacute;n cient&iacute;fica, la adquisici&oacute;n de las competencias necesarias para lograrlo y la comunicaci&oacute;n de resultados en congresos internacionales y revistas de calidad con &iacute;ndice de impacto. Por ello, la selecci&oacute;n de los doctorandos implica una valoraci&oacute;n de los conocimientos, habilidades y aspectos motivacionales que constituyen su punto de partida y que tendr&aacute; que desarrollar.</p>\r\n<br />\r\n<p>Los m&eacute;ritos que se considerar&aacute;n relevantes y su ponderaci&oacute;n son:</p>\r\n<ol type=\"a\">\r\n<li>Expediente acad&eacute;mico de la licenciatura o grado y del m&aacute;ster (25%). Puesto que les favorece el acceso a becas que le financian el doctorado.</li>\r\n<li>Experiencia investigadora y resultados de investigaciones (p.e., publicaciones, informes, congresos...) (25%)</li>\r\n<li>Conocimientos en metodolog&iacute;a de investigaci&oacute;n (25%)</li>\r\n<li>Nivel de ingl&eacute;s oral y escrito (20%)</li>\r\n<li>Otros m&eacute;ritos relevantes donde se valoran aspectos como las becas de investigaci&oacute;n recibidas, becas de colaboraci&oacute;n en departamentos, cursos realizados relacionados con la adquisici&oacute;n de competencias investigadoras (metodolog&iacute;a, c&oacute;mo redactar informes de investigaci&oacute;n, etc.), y certificados de participaci&oacute;n en investigaciones (5%)</li>\r\n</ol><br />\r\n<p>Adem&aacute;s de la valoraci&oacute;n realizada por la Comisi&oacute;n para determinar los criterios y m&eacute;ritos de los candidatos con el fin de determinar su admisi&oacute;n o no en el programa, se realiza una entrevista de selecci&oacute;n que permite, en los principales apartados de la misma evaluar la preparaci&oacute;n de los candidatos en diversos criterios relevantes para su selecci&oacute;n. Esta entrevista se realiza en el caso de que los candidatos no hayan seguido el perfil de ingreso recomendado a trav&eacute;s de la realizaci&oacute;n de los m&aacute;steres que constituyen el per&iacute;odo formativo del programa. Si han seguido uno de esos m&aacute;steres se dispone de informaci&oacute;n suficiente para valorar su preparaci&oacute;n y cualificaci&oacute;n en los diferentes aspectos relevantes para su selecci&oacute;n.</p>\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato. Se deben aportar los documentos que ampl&iacute;en el curr&iacute;culum (calificaciones acad&eacute;micas, comunicaciones a congresos, publicaciones, tesis de m&aacute;ster, etc).</li>\r\n<li>Carta de referencia y motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>En el Programa de Doctorado en Psicolog&iacute;a de los Recursos Humanos existen b&aacute;sicamente dos perfiles de acceso en funci&oacute;n de la formaci&oacute;n previa del candidato, que son relevantes para el establecimiento de los complementos de formaci&oacute;n::</p>\r\n<br /><ol type=\"a\">\r\n<li>Los candidatos que han cursado la formaci&oacute;n requerida en los programas de m&aacute;ster afines al Programa de Doctorado</li>\r\n<li>Los candidatos que no han cursado esos programas sino otros relacionados menos directamente con las tem&aacute;ticas de la disciplina o con las metodolog&iacute;as de investigaci&oacute;n en Psicolog&iacute;a del Trabajo, las Organizaciones o los RRHH</li>\r\n</ol><br />\r\n<p>Los complementos de formaci&oacute;n que se describen a continuaci&oacute;n se aplican al perfil b) que acabamos de describir. Esos complementos corresponden a los cr&eacute;ditos que en los m&aacute;sters afines al programa est&aacute;n dedicados a la realizaci&oacute;n de la investigaci&oacute;n, porque esas actividades formativas proporcionan un proceso sistem&aacute;tico y estructurado de aprendizaje que se fundamenta en la realizaci&oacute;n de un trabajo de investigaci&oacute;n sobre una cuesti&oacute;n de la disciplina.</p>\r\n<br />\r\n<h4>Contenidos de los complementos de formaci&oacute;n.</h4>\r\n<p>An&aacute;lisis multivariante en Psicolog&iacute;a de las Organizaciones y del Trabajo (8 ECTS). Curso pr&aacute;ctico de metodolog&iacute;a multivariada que va a ser utilizada en la propia investigaci&oacute;n o en la de los compa&ntilde;eros que est&aacute;n llevando a cabo un trabajo similar.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Departamento de Psicología Social,  despacho P-108 y Secretaria del Departamento de Psicología Social. Facultad de Psicología\",\"telefono\":\"\",\"nombre\":\"Nuria Gamero\",\"email\":\"ngamero@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Lourdes Munduate\",\"email\":\"munduate@us.es\"}\r\n	]}}'),(27,'2014-04-09 09:23:16','3025','doctorado_quimica@us.es','http://www.fquim.us.es/posgrado/Z339/portada/inicio','Química','2011','CIENCIAS FÍSICAS, QUÍMICAS, GEOLÓGICAS','QUÍMICA','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El Programa de Doctorado est&aacute; dirigido principalmente a alumnos con una formaci&oacute;n acad&eacute;mica superior a nivel del M&aacute;ster Universitario en Estudios Avanzados en Qu&iacute;mica, u otros t&iacute;tulos con una formaci&oacute;n equivalente o af&iacute;n a la l&iacute;nea de investigaci&oacute;n en la que se realizar&aacute; la tesis doctoral, y que den acceso a estudios de doctorado de acuerdo al RD 99/2011.</p>\r\n<br />\r\n<p>El idioma ingl&eacute;s ser&aacute; de uso habitual en el Programa de Doctorado, principalmente a nivel de bibliograf&iacute;a recomendada y b&uacute;squeda de informaci&oacute;n.</p>\r\n<br />\r\n<p>Asimismo, se utilizar&aacute; el ingl&eacute;s en las conferencias y seminarios espec&iacute;ficos organizados en el contexto del Programa. En este sentido, es recomendable que el alumno posea como m&iacute;nimo un nivel de competencias ling&uuml;&iacute;sticas respecto al idioma ingl&eacute;s equivalente al B1 del Marco Com&uacute;n Europeo de Referencia para las Lenguas.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Se establecen los siguientes perfiles de ingreso al Doctorado en Qu&iacute;mica por la Universidad de Sevilla:</p>\r\n<ol>\r\n<li>Estar en posesi&oacute;n del t&iacute;tulo de M&aacute;ster en &lsquo;Estudios Avanzados en Qu&iacute;mica&rsquo; por la Universidad de Sevilla</li>\r\n<li>Estar en posesi&oacute;n de un t&iacute;tulo de M&aacute;ster del EEES, o de otros sistemas universitarios que den acceso a la formaci&oacute;n doctoral en el pa&iacute;s de origen, con una formaci&oacute;n equivalente al M&aacute;ster en &lsquo;Estudios Avanzados en Qu&iacute;mica&rsquo; por la Universidad de Sevilla.</li>\r\n<li>Estar en posesi&oacute;n de un t&iacute;tulo en &aacute;reas afines que de acceso al programa de doctorado, que incluya cr&eacute;ditos de formaci&oacute;n en investigaci&oacute;n o equivalente y haber realizado un trabajo fin de m&aacute;ster, grado o equivalente con orientaci&oacute;n investigadora.</li>\r\n<li>Estar en posesi&oacute;n de un t&iacute;tulo en &aacute;reas afines que de acceso al programa de doctorado que no est&eacute; contemplado en el punto 3.</li>\r\n</ol><br />\r\n<p>La comisi&oacute;n acad&eacute;mica del programa de doctorado ser&aacute; la encargada de establecer los t&iacute;tulos que se consideran dentro de los apartados 2, 3 y 4.</p>\r\n<br />\r\n<p>No se establece la realizaci&oacute;n de pruebas de acceso espec&iacute;ficas. En el caso de que el n&uacute;mero de solicitantes supere al de plazas ofertadas, la comisi&oacute;n acad&eacute;mica del programa de doctorado utilizar&aacute; los siguientes criterios para la selecci&oacute;n:</p>\r\n<br />\r\n<ul>\r\n<li>Adecuaci&oacute;n del t&iacute;tulo de acceso al programa de doctorado, de acuerdo a los perfiles de ingreso establecidos. (40%)</li>\r\n<li>Expediente acad&eacute;mico global del t&iacute;tulo que de acceso al programa de doctorado. (40%)</li>\r\n<li>Experiencia profesional e investigadora. (20%)</li>\r\n</ul>\r\n<p>La comisi&oacute;n acad&eacute;mica del programa de doctorado detallar&aacute; el baremo utilizado en el proceso de admisi&oacute;n, que estar&aacute; publicado en la p&aacute;gina web del programa. En caso de rechazo de la admisi&oacute;n, este ser&aacute; motivado y la comisi&oacute;n acad&eacute;mica enviar&aacute; a la persona afectada un informe escrito justificando su decisi&oacute;n.</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n<li>Escrito explicativo que contenga\r\n<ul>\r\n<li>T&iacute;tulo del proyecto de tesis y l&iacute;nea de investigaci&oacute;n en la que se integra.</li>\r\n<li>Breve descripci&oacute;n del proyecto a desarrollar (m&aacute;ximo un folio).</li>\r\n<li>Aceptaci&oacute;n por parte del director propuesto, que informar&aacute; y avalar&aacute; el proyecto presentado.</li>\r\n<li>Propuesta de tutor, en su caso, con el visto bueno del mismo y del director.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Seg&uacute;n los perfiles de ingreso se establecen los siguientes complementos de formaci&oacute;n:</p>\r\n<br />\r\n<ul>\r\n<li>Los estudiantes con perfiles de ingreso 1 y 2 acceden directamente al programa sin complementos de formaci&oacute;n.</li>\r\n<li>Para aquellos estudiantes con perfil de ingreso 3, la comisi&oacute;n acad&eacute;mica del programa de doctorado analizar&aacute; la formaci&oacute;n previa del alumno y establecer&aacute; si es necesario que realice complementos de formaci&oacute;n, que consistir&aacute;n en cursar una o varias asignaturas del M&aacute;ster en &lsquo;Estudios Avanzados en Qu&iacute;mica&rsquo; u otros m&aacute;steres ofertados por la Universidad de Sevilla, con un m&aacute;ximo de 18 ECTS y relacionadas con la l&iacute;nea de investigaci&oacute;n a la que se adscribir&aacute; el estudiante.</li>\r\n<li>Los estudiantes con perfil de ingreso 4 tendr&aacute;n que cursar un m&aacute;ximo de 18 ECTS de asignaturas del M&aacute;ster en &lsquo;Estudios Avanzados en Qu&iacute;mica&rsquo; u otros m&aacute;steres ofertados por la Universidad de Sevilla, adem&aacute;s deber&aacute;n realizar un trabajo de iniciaci&oacute;n a la investigaci&oacute;n equivalente, como m&iacute;nimo, a 6 ECTS.</li>\r\n</ul>\r\n<br />\r\n<p>El total de complementos de formaci&oacute;n no podr&aacute; superar los 24 ECTS y estar&aacute;n siempre relacionados con la l&iacute;nea de investigaci&oacute;n a la que se adscribir&aacute; el estudiante, siendo la comisi&oacute;n acad&eacute;mica del programa la que establezca que complementos formativos son necesarios una vez analizada la formaci&oacute;n previa del alumno.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de la Facultad de Química\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"\",\"nombre\":\"Antonio Miguel Gil Serrano\",\"email\":\"agil@us.es\"}\r\n	]}}'),(29,'2014-04-09 09:23:35','3026','cristal2@us.es','http://institucional.us.es/docrecnatma/','Recursos Naturales y Medioambiente','2011','CIENCIAS FÍSICAS, QUÍMICAS, GEOLÓGICAS','CIENCIAS FÍSICAS, QUÍMICAS, GEOLÓGICAS','no','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El programa de doctorado, ir&aacute; dirigido a Graduados/Licenciados e Ingenieros que hayan cursado las Licenciaturas/Grados en: Qu&iacute;mica, Geograf&iacute;a, Geolog&iacute;a, Biolog&iacute;a, Farmacia, Ciencias del Mar, F&iacute;sica, Ciencias Ambientales, Bioqu&iacute;mica, Biotecnolog&iacute;a, o las Ingenier&iacute;as en: Qu&iacute;mica, Minas, Agr&oacute;nomos, Forestal, Civil, Geolog&iacute;a, Materiales, Industriales, y Arquitectura.</p>\r\n<br />\r\n<p>Se recomienda que el perfil del estudiante ser&iacute;a aquel que tuviera, e inclusive hubiera demostrado, un inter&eacute;s particular por los temas relacionados con la biotecnolog&iacute;a, los recursos naturales y el medio ambiente, sea sensible a los problemas de contaminaci&oacute;n, a la conservaci&oacute;n de los recursos naturales y a su uso sostenible, a los efectos del cambio clim&aacute;tico, a la biodiversidad y su conservaci&oacute;n, etc., y que si es posible tenga alguna experiencia laboral, o en la investigaci&oacute;n y docencia, relacionada con los recursos naturales y el medio ambiente o la educaci&oacute;n ambiental.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Para acceder a las ense&ntilde;anzas del Programa de doctorado ser&aacute; necesario estar en posesi&oacute;n de un t&iacute;tulo universitario oficial espa&ntilde;ol u otro expedido por una instituci&oacute;n de educaci&oacute;n superior del Espacio Europeo de Educaci&oacute;n Superior que facultan en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a ense&ntilde;anzas de doctorado.</p>\r\n<br />\r\n<p>Ser&aacute; necesario estar en posici&oacute;n del T&iacute;tulo de Grado u otro declarado expresamente equivalente (diplomado, licenciado, ingeniero t&eacute;cnico o superior, arquitecto t&eacute;cnico o superior), adem&aacute;s de un t&iacute;tulo de m&aacute;ster.</p>\r\n<br />\r\n<p>En cualquier caso, y en especial con las titulaciones de otros pa&iacute;ses, habr&aacute; que valorar la formaci&oacute;n adquirida por el estudiante en los estudios realizados previos al doctorado.</p>\r\n<br />\r\n<p>Asimismo, podr&aacute;n acceder los titulados conforme a sistemas educativos ajenos al Espacio Europeo de Educaci&oacute;n Superior sin necesidad de la homologaci&oacute;n de sus t&iacute;tulos, previa comprobaci&oacute;n por la Universidad de que aquellos acreditan un nivel de formaci&oacute;n equivalente a los correspondientes t&iacute;tulos universitario oficiales espa&ntilde;oles y que facultan en el pa&iacute;s expedidor del t&iacute;tulo para el acceso a ense&ntilde;anzas de posgrado.</p>\r\n<br />\r\n<p>La lengua oficial del programa ser&aacute; castellano, aunque es necesario un nivel de ingl&eacute;s medio alto por parte de los doctorandos.</p>\r\n<br />\r\n<p>A continuaci&oacute;n, se indican los criterios de valoraci&oacute;n y peso para el acceso y admisi&oacute;n al programa:</p>\r\n<br />\r\n<h4>Criterios de valoraci&oacute;n y peso</h4>\r\n<ul>\r\n<li>Nota media del expediente acad&eacute;mico: 60%</li>\r\n<li>Proyecto de Tesis / plan de investigaci&oacute;n :10%</li>\r\n<li>Conocimiento de idiomas: 5%</li>\r\n<li>Formaci&oacute;n complementaria af&iacute;n :5%</li>\r\n<li>Experiencia profesional en Recursos Naturales y/o Medio Ambiente: 5 %</li>\r\n<li>Experiencia docente y/o investigadora en Recursos Naturales y/o Medio Ambiente :10 %</li>\r\n<li>Otros M&eacute;ritos: 5%</li>\r\n</ul>\r\n<p>Total: 100%</p>\r\n<br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n<li>Proyecto de tesis / plan de investigaci&oacute;n, avalado por el Director, y Tutor en su caso, cuya extensi&oacute;n m&aacute;xima ser&aacute; de 15 p&aacute;ginas, incluyendo los siguientes apartados: t&iacute;tulo, introducci&oacute;n, objetivos, metodolog&iacute;a y plan de trabajo.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>Si la formaci&oacute;n y experiencia del candidato se aparta de los temas y el enfoque del programa de doctorado, se podr&aacute; admitir al candidato con la obligatoriedad de cursar los complementos de formaci&oacute;n que se le indiquen, y que le permitan adquirir las competencias necesarias para realizar su investigaci&oacute;n.</p>\r\n<br />\r\n<p>La Comisi&oacute;n Acad&eacute;mica valorar&aacute; &ldquo;ad casum&rdquo; la necesidad de realizaci&oacute;n de esos complementos formativos, as&iacute; como el tipo de cursos que se pueden considerar equivalentes a esas Materias Fundamentales y Metodol&oacute;gicas.</p>\r\n<br />\r\n<p>En base al perfil de ingreso recomendado, los complementos de formaci&oacute;n se realizar&aacute;n en los siguientes m&aacute;steres de la Universidad de Sevilla:</p>\r\n<ul>\r\n<li>M&aacute;ster Oficial de Estudios Avanzados en Qu&iacute;mica.</li>\r\n<li>M&aacute;ster Oficial en Ingenier&iacute;a Ambiental.</li>\r\n<li>M&aacute;ster Oficial en Ciencia y Tecnolog&iacute;a de Materiales.</li>\r\n<li>M&aacute;ster Oficial en Dise&ntilde;o y Desarrollo de Productos e Instalaciones Industriales.</li>\r\n<li>M&aacute;ster Oficial en Seguridad Integral en la Industria y Prevenci&oacute;n de Riesgos Laborales.</li>\r\n<li>Otros m&aacute;steres de la Universidad de Sevilla que puedan implantarse en el futuro de contenido similar a los descritos.</li>\r\n</ul>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954.556.318\",\"nombre\":\"Dra. Isabel González Díez (Coordinadora del Programa de Doctorado)\",\"email\":\"igonza@us.es\"}\r\n	,{\"direccion\":\"Secretaría del Departamento\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"cristal2@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954.556.318\",\"nombre\":\"Dra. Isabel González Díez (Coordinadora del Programa de Doctorado)\",\"email\":\"igonza@us.es\"}\r\n	]}}'),(30,'2014-04-09 09:23:54','3027','doctorado_see@us.es','http://doctoradosee.us.es/','Sistemas de Energía Eléctrica','2011','ELECTRICIDAD Y ENERGÍA','INGENIERÍA Y PROFESIONES AFINES','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El perfil de ingreso recomendado, que no requiere realizar complementos de formaci&oacute;n, es el correspondiente a las capacidades y conocimientos adquiridos por aquellos que presenten como perfil de acceso una de las siguientes titulaciones:</p>\r\n<ul>\r\n<li>&ldquo;M&aacute;ster Universitario en Sistemas de Energ&iacute;a El&eacute;ctrica&rdquo; (impartido en US).</li>\r\n<li>&ldquo;M&aacute;ster en Integraci&oacute;n de las Energ&iacute;as Renovables en el Sistema El&eacute;ctrico&rdquo; (impartido por la UPV/EHU).</li>\r\n<li>&ldquo;M&aacute;ster Ingeniero Industrial&rdquo; a impartir a partir de 2015-2016 (UMA).</li>\r\n<li>&ldquo;M&aacute;ster Universitario en Ingenier&iacute;a en Energ&iacute;a&rdquo; (impartido en UPC).</li>\r\n</ul>\r\n<p>A nivel de idiomas, el perfil de ingreso recomendado debe incluir el dominio alto (al menos a nivel t&eacute;cnico) del castellano y de otro idioma (preferentemente el ingl&eacute;s). Asimismo, la Comisi&oacute;n Acad&eacute;mica tendr&aacute; en cuenta la pol&iacute;tica ling&uuml;&iacute;stica que pueda ser definida por cada universidad participante en el programa.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Tal como establece el convenio firmado por las universidades participantes en el programa, los requisitos de admisi&oacute;n ser&aacute;n &uacute;nicos en todas las universidades. La Comisi&oacute;n Acad&eacute;mica tendr&aacute; en cuenta los requisitos de acceso y criterios de admisi&oacute;n que a nivel general definen los art&iacute;culos 6 y 7 del RD 99/2011, as&iacute; como los requisitos y criterios adicionales definidos para este Programa y que son se&ntilde;alados a continuaci&oacute;n</p>\r\n<br />\r\n<p>El estudiante deber&aacute; cumplir con el perfil de ingreso recomendado.</p>\r\n<br />\r\n<p>En el caso de los solicitantes que no se ajusten al perfil de ingreso recomendado pero que s&iacute; cumplan lo se&ntilde;alado en los art&iacute;culos 6 y 7 del RD 99/2011, la Comisi&oacute;n Acad&eacute;mica estudiar&aacute; individualmente cada caso y lo clasificar&aacute; en una de estas tres categor&iacute;as:</p>\r\n<br /><ol>\r\n<li>Perfil af&iacute;n de primer orden: Correspondiente a aquellos que por su formaci&oacute;n acad&eacute;mica y/o experiencia profesional acreditan tener unas capacidades y conocimientos equiparables a los del perfil de acceso recomendado. Los clasificados en este perfil no requerir&aacute;n de la realizaci&oacute;n de complementos de formaci&oacute;n.</li>\r\n<li>Perfil af&iacute;n de segundo orden: Correspondiente a aquellos que deber&aacute;n realizar complementos de formaci&oacute;n para adquirir capacidades y conocimientos equiparables a los del perfil de acceso recomendado y, en consecuencia, poder tener acceso al Programa de Doctorado.</li>\r\n<li>Perfil no af&iacute;n: Correspondiente a aquellos que no pueden tener acceso al Programa de Doctorado debido a que el perfil que presentan no es adecuado para la tem&aacute;tica objeto de las l&iacute;neas de investigaci&oacute;n que lo componen.</li>\r\n</ol><br />\r\n<p>Los aspectos a valorar para realizar la selecci&oacute;n ser&aacute;n: La titulaci&oacute;n de acceso presentada y el expediente acad&eacute;mico correspondiente, adecuaci&oacute;n del el curr&iacute;culum vitae a la tem&aacute;tica de las l&iacute;neas de investigaci&oacute;n del programa (experiencia profesional, publicaciones, participaci&oacute;n en congresos, etc), conocimiento de idiomas y otros m&eacute;ritos.</p>\r\n<br />\r\n<p>Como parte de la valoraci&oacute;n, la Comisi&oacute;n Acad&eacute;mica podr&aacute; realizar entrevistas personales en los casos en que lo considere necesario para poder valorar adecuadamente a cada solicitante. La selecci&oacute;n se llevar&aacute; a cabo teniendo en cuenta el n&uacute;mero de plazas ofertadas en cada universidad. La Comisi&oacute;n Acad&eacute;mica tendr&aacute; potestad para, de manera justificada, dejar plazas vacantes o establecer una lista de suplentes en cada universidad.</p>\r\n<br />\r\n<h4>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h4>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h4>Complementos de Formaci&oacute;n</h4>\r\n<p>Estos complementos de formaci&oacute;n espec&iacute;ficos se referir&aacute;n a la obligatoriedad de que el doctorando curse una o m&aacute;s materias en el plazo establecido por la Comisi&oacute;n Acad&eacute;mica. En cualquier caso, el doctorando deber&aacute; haber cursado y superado estas materias con anterioridad a la presentaci&oacute;n de su Tesis Doctoral.</p>\r\n<br />\r\n<p>En cuanto a la tipolog&iacute;a de los complementos formativos, estos podr&aacute;n ser:</p>\r\n<ul>\r\n<li>Asignaturas regladas de los m&aacute;steres de las instituciones participantes en este programa de doctorado.</li>\r\n<li>Seminarios cient&iacute;fico-t&eacute;cnicos.</li>\r\n<li>Seminarios metodol&oacute;gicos.</li>\r\n</ul>\r\n<br />\r\n<p>Las materias se&ntilde;aladas corresponder&aacute;n a asignaturas ofertadas por las universidades participantes en el programa de doctorado y deber&aacute;n formar parte de la oferta docente de los M&aacute;ster que dan acceso directo (sin necesidad de formaci&oacute;n complementaria) al programa de doctorado &ldquo;Sistemas de Energ&iacute;a El&eacute;ctrica&rdquo;.</p>\r\n<br />\r\n<p>La definici&oacute;n concreta de cada una de estas asignaturas, as&iacute; como de los M&aacute;ster a los que pertenecen, puede ser consultada en los siguientes enlaces:</p>\r\n<div class=\"table table-condensed\">\r\n<table class=\"table table-reflow\">\r\n<tbody>\r\n<tr>\r\n<td>UNIVERSIDAD DE SEVILLA</td>\r\n<td>&ldquo;M&aacute;ster Universitario en Sistemas de Energ&iacute;a El&eacute;ctrica&rdquo;</td>\r\n<td><a href=\"http://www.us.es/estudios/master/master_M109\">Enlace</a></td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>UNIVERSIDAD DEL PA&Iacute;S VASCO / EUSKAL HERRIKO UNIBERTSITATEA (UPV/EHU)</td>\r\n<td>&ldquo;M&aacute;ster en Integraci&oacute;n de las Energ&iacute;as Renovables en el Sistema El&eacute;ctrico&rdquo;</td>\r\n<td><a href=\"http://www.integracionenergiasrenovables.ehu.es/p151-1999/es\">Enlace</a></td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>UNIVERSIDAD POLIT&Eacute;CNICA DE CATALU&Ntilde;A</td>\r\n<td>M&aacute;ster universitario en &ldquo;Ingenier&iacute;a en Energ&iacute;a&rdquo;</td>\r\n<td><a href=\"http://energia.masters.upc.edu/info-general?set_language=ca\">Enlace</a></td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<br />\r\n<p>Asimismo, salvo casos justificados, la Comisi&oacute;n Acad&eacute;mica definir&aacute; los complementos de formaci&oacute;n, a realizar por cada doctorando, entre las asignaturas ofertadas en la universidad en la que &eacute;ste se matricule de doctorado.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de la E.T.S.I\",\"telefono\":\" 954 48 61 18\",\"nombre\":\"\",\"email\":\"secre_ie@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"95.448.72.87\",\"nombre\":\"Antonio Gómez Expósito\",\"email\":\"age@us.es\"}\r\n	]}}'),(31,'2014-04-09 09:24:04','3028','doctorado_turismo@us.es','http://doctoradoturismo.es/','Turismo','2011','CIENCIAS SOCIALES Y DEL COMPORTAMIENTO','VIAJES, TURISMO Y OCIO','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>El perfil acad&eacute;mico recomendado para los estudiantes que quieran acceder a este Programa deDoctorado es el de Graduados en estudios afinescon el conocimiento del Turismo, desde el &aacute;mbito de laeconom&iacute;a, la empresa, la sociolog&iacute;a y la geograf&iacute;a. En particular, se orienta a los Grados enTurismo,Econom&iacute;a, Administraci&oacute;n y Direcci&oacute;n de Empresas, Geograf&iacute;a ySociolog&iacute;a y t&iacute;tulos afines encompetencias a los enumerados. Respectoa los estudios de M&aacute;ster Oficial, el Programa se dirigeespecialmente a los titulados en el M&aacute;ster Oficial en Direcci&oacute;n y Planificaci&oacute;n del Turismo, oequivalentes, impartido por las universidades que forman la Red Intur.</p>\r\n<br />\r\n<p>Los alumnos que no cumplan con el perfil de acceso, proveniente de m&aacute;steres de las ramas de &ldquo;Cienciassociales y jur&iacute;dicas&rdquo; y Artes y humanidades, ajeno a la formaci&oacute;n en turismo, habr&aacute;n de cursarnecesariamente complementos espec&iacute;ficos de formaci&oacute;n. Para aquellos estudiantes que hayan cursadom&aacute;steres de la rama de &ldquo;Ingenier&iacute;a y arquitectura&rdquo; laComisi&oacute;n acad&eacute;mica del doctorado dictaminar&aacute;sobre los complementos de formaci&oacute;n que ser&aacute; necesario cursar.</p>\r\n<br />\r\n<p>En cuanto a capacidades, el perfil de ingreso recomendado remite a alumnado con capacidad adquirida para entender y solucionar problemas en el &aacute;mbito de las empresas, organismos y destinos tur&iacute;sticos as&iacute; como capacidad para evaluar el comportamiento de los agentes econ&oacute;micos de este sector de actividad. Asimismo, para la realizaci&oacute;n del programa tendr&aacute;n gran utilidad los conocimientos en an&aacute;lisis de datos y de herramientas y t&eacute;cnicas de planificaci&oacute;n.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<h4>Requisitos de acceso</h4>\r\n<p>Para acceder al Programa de Doctorado ser&aacute; necesario estar en posesi&oacute;n de los t&iacute;tulos oficiales espa&ntilde;oles de Grado, o equivalente, y de M&aacute;ster Universitario. Asimismo podr&aacute;n acceder quienes se encuentren en alguno de los supuestos establecidos en el art. 6.2 (apartados a, b, d, y e) del RD99/2011.</p>\r\n<br />\r\n<h4>Criterios de admisi&oacute;n</h4>\r\n<p>Se establece como criterio general de admisi&oacute;n la presentaci&oacute;n de una propuesta de Proyecto de Tesis doctoral relacionada con alguno de los equipos de investigaci&oacute;n existentes en el Programa de Doctorado, en la que se describan los objetivos, justificaci&oacute;n de la adscripci&oacute;n a una l&iacute;nea de investigaci&oacute;n, meto dolog&iacute;a, resultados previstos y recursos necesarios para su elaboraci&oacute;n, tutor y director de tesis propuestos, e informe del director de tesis propuesto. La Comisi&oacute;n valorar&aacute; la afinidad de la propuesta con el Programa de Doctorado, la viabilidad e inter&eacute;s cient&iacute;fico, y la disponibilidad de personal investigador con vinculaci&oacute;n permanente a la Universidad solicitada y experiencia investigadora acreditada, para tutorizar la tesis en la l&iacute;nea de investigaci&oacute;n seleccionada por el aspirante.</p>\r\n<br />\r\n<p>Los criterios de a dmisi&oacute;n espec&iacute;ficos ser&aacute;n establecidos por la Comisi&oacute;n Acad&eacute;mica del Programa de Doctorado, d&aacute;ndose publicidad a los mismos a trav&eacute;s de los sistemas de informaci&oacute;n previos al acceso y a la admisi&oacute;n de estudiantes. Los requisitos de admisi&oacute;n y la posterior baremaci&oacute;n quedar&aacute;n recogidos en la p&aacute;gina web del Programa de Doctorado.</p>\r\n<br />\r\n<p>Los criterios de admisi&oacute;n objetivos estar&aacute;n ligados a requisitos acad&eacute;micos, otros m&eacute;ritos relacionados con la investigaci&oacute;n y al conocimiento acreditado de idioma extranjero de uso habitual en la comunidad cient&iacute;fica a la que pertenece el programa de doctorado. En definitiva los criterios se basar&aacute;n en el m&eacute;rito y capacidad de los solicitantes, de acuerdo a sus certificados acad&eacute;micos del Grado y del M&aacute;ster cursado y el Curriculum vitae.</p>\r\n<br />\r\n<p>A estos efectos, la admisi&oacute;n estar&aacute; regida por los criterios ponderados del siguiente modo:.</p>\r\n<ul>\r\n<li>Expediente acad&eacute;mico del grado de acceso al programa de doctorado 30%</li>\r\n<li>Expediente acad&eacute;mico del m&aacute;ster de acceso al programa de doctorado 40%</li>\r\n<li>La existenciade cartas de presentaci&oacute;n por parte de profesores de Universidad o de otras Instituciones de investigaci&oacute;n, que tengan conocimiento directo de la capacidad y competencia del aspirante (5%)</li>\r\n<li>Experiencia investigadora u otros m&eacute;ritos relacionados con la investigaci&oacute;n (20%)</li>\r\n<li>Conocimiento acreditado de idioma extranjero de uso habitual en la comunidad cient&iacute;fica a laque pertenezca el programa dedoctorado. (5%). De acuerdo con el Marco de referenciaeuropeo de las lenguas, el nivel m&iacute;nimo exigido ser&aacute; el B1</li>\r\n</ul>\r\n<br />\r\n<p>En el caso de que la demanda de plazas en el programa fuese superior a la oferta, la Comisi&oacute;n Acad&eacute;mica realizar&aacute; una entrevista personal con los distintos solicitantes. Los criterios de evaluaci&oacute;n de dicha entrevista ser&aacute;n:.</p>\r\n<ul>\r\n<li>Conocimiento del programa (25%)</li>\r\n<li>Inter&eacute;s del candidato/a por sus l&iacute;neas de investigaci&oacute;n y la coherencia de la entrevista con la carta o cartas de presentaci&oacute;n entregada. (50%)</li>\r\n</ul>\r\n<p>Predisposici&oacute;n, motivaci&oacute;n y compromiso personal del candidato por llevar a t&eacute;rmino su proyecto de tesis. (25%)</p>\r\n<br />\r\n<h4>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h4>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Propuesta de proyecto de tesis, relacionado con alguno de los equipos de investigaci&oacute;n existentes en el Programa de Doctorado, en la que se describan los objetivos, justificaci&oacute;n de la adscripci&oacute;n a una l&iacute;nea de investigaci&oacute;n, metodolog&iacute;a, resultados previstos y recursos necesarios para su elaboraci&oacute;n, tutor y director de tesis propuestos, e informe del director de tesis propuesto.</li>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por l a realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h4>Complementos de Formaci&oacute;n</h4>\r\n<p>Los estudiantes que accedan al programa de doctorado desde los m&aacute;steres que dan acceso directo (no ser&aacute; preciso que hagan ning&uacute;n tipo de complementos de formaci&oacute;n, a menos que quieran cursarlos de modo voluntario</p>\r\n<br />\r\n<p>En el caso de que el alumnado carezca de la formaci&oacute;n previa completa exigida en el programa, tras la admisi&oacute;n y matriculaci&oacute;n, ser&aacute; preciso que cursen complementos de formaci&oacute;n espec&iacute;ficos. De este modo, la Comisi&oacute;n Acad&eacute;mica del programa, en atenci&oacute;n a la titulaci&oacute;n de acceso, debe decidir, previo informe del tutor, qu&eacute; complementos formativos son los adecuados a cada alumno, para lo cual se podr&aacute;n utilizar asignaturas del Grado en Turismo y/o de los M&aacute;steres Oficiales que dan acceso directo a este Programa de Doctorado. En todo caso, dichos complementos tendr&aacute;n car&aacute;cter obligatorio para aquellos estudiantes que acceden al programa estando en pose si&oacute;n &uacute;nicamente de un t&iacute;tulo de graduado o graduada de 300 ECTS o m&aacute;s, que no incluye cr&eacute;ditos de investigaci&oacute;n en su plan de estudios</p>\r\n<br />\r\n<p>Con la finalidad de que los complementos de formaci&oacute;n sean adecuados y coherentes con el perfil de ingreso, el &aacute;mbito cient&iacute;fico y los objetivos del programa, la oferta de asignaturas a cursar como complementos debe atender a las necesidades del programa y corresponder&aacute; a los siguientes &aacute;mbitos espec&iacute;ficos de conocimiento:</p>\r\n<br />\r\n<ul>\r\n<li>Econom&iacute;a del turismo</li>\r\n<li>Direcci&oacute;n estrat&eacute;gica de empresas tur&iacute;sticas</li>\r\n<li>Sociolog&iacute;a del turismo</li>\r\n<li>M&eacute;todos y t&eacute;cnicas de investigaci&oacute;n en turismo</li>\r\n<li>An&aacute;lisis y planificaci&oacute;n territorial del turismo</li>\r\n<li>Tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n aplicadas al turismo</li>\r\n<li>Derecho y legislaci&oacute;n tur&iacute;stica</li>\r\n<li>Valorizaci&oacute;n tur&iacute;stica del patrimonio cultural</li>\r\n</ul>\r\n<br />\r\n<p>Al tratarse en cada universidad de una oferta de asignaturas concretas dentro de dichos &aacute;mbitos, los contenidos, competencias, objetivos y evaluaci&oacute;n ser&aacute;n los que aparecen en la gu&iacute;a docente de la asignatura correspondiente.</p>\r\n<br />\r\n<p>La realizaci&oacute;n de estos complementos ser&aacute; simult&aacute;nea a la matr&iacute;cula en tutela acad&eacute;mica en el programa. En este caso, el alumnado deber&aacute; matricularse de estos complementos y, adem&aacute;s, formalizar la matr&iacute;cula de tutela acad&eacute;mica en el programa. No obstante, los complementos de formaci&oacute;n deber&aacute;n superarse en el plazo m&aacute;ximo de tres cuatrimestres consecutivos para alumnos a tiempo completo y cinco para alumnos a tiempo parcial. De no hacerlo as&iacute;, el alumnado causar&aacute; baja en el programa.</p>\r\n<br />\r\n<p>A efectos de proporcionar dichos complementos, las universidades del programa ofertar&aacute;n las asignaturas con arreglo a los contenidos indicados (hasta 18 cr&eacute;ditos), a partir de las materias de grado y de m&aacute;steres oficiales, para cubrir los aspectos de formaci&oacute;n que permitan a los alumnos el seguimiento del programa.</p>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría de la Facultad de Turismo y Finanzas\",\"telefono\":\"\",\"nombre\":\"José Luis Jiménez Caballero\",\"email\":\"jjimenez@us.es  /  doctorado_turismo@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954.551.601 / 954.559.533\",\"nombre\":\"José Luis Jiménez Caballero\",\"email\":\"jjimenez@us.es\"}\r\n	]}}'),(12,'2014-04-09 09:32:04','3011','doctorado_ecyt@us.es','https://sites.google.com/site/ecytdoct/home','Electroquímica. Ciencia y Tecnología','2011','CIENCIAS FÍSICAS, QUÍMICAS, GEOLÓGICAS','','si','<h3>Perfil de Ingreso Recomendado</h3>\r\n<p>Tendr&aacute;n acceso al programa de doctorado de &ldquo;Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a&rdquo; todos los solicitantes que, cumpliendo los requisitos para la admisi&oacute;n a los programas de doctorado de marcados en el RD 99/2011, tengan un t&iacute;tulo de m&aacute;ster obtenido en las &aacute;reas de ciencias, ingenier&iacute;a o afines. No obstante, el perfil recomendado de acceso es estar en posesi&oacute;n de un t&iacute;tulo de grado en Ciencias o Ingenier&iacute;a y haber realizado un m&aacute;ster en estas &aacute;reas en las que haya recibido formaci&oacute;n avanzada en Electroqu&iacute;mica.</p>\r\n<p>En este sentido, el m&aacute;ster m&aacute;s indicado es el de Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a. Adem&aacute;s, el estudiante debe poseer un conocimiento m&iacute;nimo de ingl&eacute;s que le permita entender perfectamente las ideas expresadas en art&iacute;culos cient&iacute;ficos, relacionarse con hablantes nativos con un grado suficiente de fluidez y naturalidad, y producir textos claros cient&iacute;ficos, aunque tambi&eacute;n ser&iacute;a razonable que su dominio solo le permitiese entender textos cient&iacute;ficos.</p>\r\n<br />\r\n<p>Se establecen los siguientes perfiles de ingreso al Doctorado:</p>\r\n<ol>\r\n<li>\r\n<p>Estar en posesi&oacute;n del t&iacute;tulo de M&aacute;ster en Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a, tener la suficiencia investigadora en el Doctorado de Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a regulado por el real decreto 778/1998 o haber realizado el periodo formativo del programa de doctorado en Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a regulado por el real decreto 1393/2007.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido de m&aacute;ster del EEES con una formaci&oacute;n equivalente al M&aacute;ster en Electroqu&iacute;mica: Ciencia y Tecnolog&iacute;a.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo que d&eacute; acceso al programa de doctorado en &aacute;reas de Ciencias, Ingenier&iacute;a o &aacute;reas afines que incluya, al menos, 16 cr&eacute;ditos ECTS metodol&oacute;gicos y de formaci&oacute;n en investigaci&oacute;n o equivalente y haber realizado el trabajo de fin de m&aacute;ster, grado o equivalente con car&aacute;cter investigador.</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo que d&eacute; acceso al programa de doctorado en &aacute;reas de Ciencias, Ingenier&iacute;a o &aacute;reas afines que no entre dentro del punto 3.</p>\r\n</li>\r\n</ol><br />\r\n<p>La comisi&oacute;n acad&eacute;mica del programa de doctorado ser&aacute; la encargada de establecer los t&iacute;tulos que se consideran dentro de los puntos 2, 3 y 4 de esta normativa de admisi&oacute;n.</p>\r\n<br />\r\n<h3>Requisitos y Criterios de Admisi&oacute;n</h3>\r\n<p>Criterios de admisi&oacute;n:</p>\r\n<br /><ol type=\"a\">\r\n<li>\r\n<p>T&iacute;tulo de acceso al programa de doctorado: Hasta 5 puntos. Este apartado se punt&uacute;a de la siguiente forma</p>\r\n<ol type=\"i\">\r\n<li>\r\n<p>Estar en posesi&oacute;n del t&iacute;tulo de M&aacute;ster en Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a o tener el diploma de estudios avanzados en el Doctorado de Electroqu&iacute;mica: Ciencia y Tecnolog&iacute;a regulado por el real decreto 778/1998: 5 puntos</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo obtenido de m&aacute;ster del EEES con una formaci&oacute;n en Electroqu&iacute;mica equivalente al M&aacute;ster en Electroqu&iacute;mica: Ciencia y Tecnolog&iacute;a. 4,5 puntos</p>\r\n</li>\r\n<li>\r\n<p>Estar en posesi&oacute;n de un t&iacute;tulo que d&eacute; acceso al programa de doctorado en &aacute;reas de Ciencias, Ingenier&iacute;a o &aacute;reas afines que incluya, al menos, 16 cr&eacute;ditos ECTS metodol&oacute;gicos y de formaci&oacute;n en investigaci&oacute;n o equivalentes y haber realizado el trabajo de fin de m&aacute;ster/grado o equivalente con car&aacute;cter investigador: 3 puntos.</p>\r\n</li>\r\n</ol></li>\r\n<li>\r\n<p>Expediente acad&eacute;mico global del t&iacute;tulo que d&eacute; acceso al programa de doctorado: hasta 2 puntos. Se valorar&aacute; tanto el expediente del t&iacute;tulo de grado (hasta 1,6 puntos) como el de m&aacute;ster (hasta 0,4) puntos. En ambos casos, el expediente que tenga un promedio de 4 puntos en la escala 1-4 tendr&aacute; la m&aacute;xima puntuaci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<p>Resultados acad&eacute;micos en asignaturas afines al programa de doctorado: hasta 2 puntos. Se sumar&aacute; el n&uacute;mero de cr&eacute;ditos de cada asignatura relacionada con la Electroqu&iacute;mica por la calificaci&oacute;n num&eacute;rica en la escala 1-4. Al estudiante con mejor puntuaci&oacute;n se le dar&aacute;n 2 puntos y al resto la parte proporcional</p>\r\n</li>\r\n<li>\r\n<p>Experiencia profesional: hasta 1 puntos. Se puntuar&aacute; 0,2 puntos por cada a&ntilde;o de experiencia profesional relacionada con la electroqu&iacute;mica</p>\r\n</li>\r\n</ol><br />\r\n<h3>Documentaci&oacute;n Espec&iacute;fica para la Admisi&oacute;n</h3>\r\n<p>Junto a la solicitud de admisi&oacute;n y la documentaci&oacute;n general se debe adjuntar para la admisi&oacute;n al programa de doctorado:</p>\r\n<ul>\r\n<li>Curr&iacute;culum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato..</li>\r\n<li>Carta motivada en la que se exprese el inter&eacute;s del candidato por cursar el programa de doctorado y por la realizaci&oacute;n de la tesis doctoral en este &aacute;mbito.</li>\r\n</ul>\r\n<br />\r\n<h3>Complementos de Formaci&oacute;n</h3>\r\n<p>De acuerdo con los perfiles de ingreso se establecen los siguientes complementos de formaci&oacute;n.</p>\r\n<ol type=\"a\">\r\n<li>\r\n<p>Los alumnos con perfil de ingreso 1 o 2 aceden directamente al programa sin complementos de formaci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<p>Para los alumnos con perfil de ingreso 3, la comisi&oacute;n acad&eacute;mica del programa de doctorado establecer&aacute;, en funci&oacute;n de la formaci&oacute;n previa en electroqu&iacute;mica, la necesidad de realizaci&oacute;n de complementos de formaci&oacute;n. Dichos complementos de formaci&oacute;n consistir&aacute;n en cursar una o varias asignaturas de las materias &ldquo;Fundamentos de la Electroqu&iacute;mica&rdquo; y/o &ldquo;Aplicaciones de la Electroqu&iacute;mica&rdquo; con un m&aacute;ximo de 20 cr&eacute;ditos pertenecientes al M&aacute;ster de &ldquo;Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a&rdquo;.</p>\r\n</li>\r\n<li>\r\n<p>Los alumnos con perfil de ingreso 4, la comisi&oacute;n acad&eacute;mica del doctorado establecer&aacute; en funci&oacute;n de la formaci&oacute;n previa en electroqu&iacute;mica, la necesidad de cursar una o varias asignaturas de las materias &ldquo;Fundamentos de la Electroqu&iacute;mica&rdquo; y/o &ldquo;Aplicaciones de la Electroqu&iacute;mica&rdquo; con un m&aacute;ximo de 20 cr&eacute;ditos pertenecientes al M&aacute;ster de &ldquo;Electroqu&iacute;mica. Ciencia y Tecnolog&iacute;a&rdquo; y/o un trabajo de investigaci&oacute;n equivalente de 6 cr&eacute;ditos ECTS. El trabajo se realizar&aacute; dentro de los 3 primeros meses del periodo de investigaci&oacute;n y estar&aacute; dirigido por su director de tesis o, en su defecto, por el tutor. Con el trabajo se pretende que el alumno alcance las destrezas y competencias m&iacute;nimas en la investigaci&oacute;n en Electroqu&iacute;mica. Tras la realizaci&oacute;n del periodo, el doctorando presentar&aacute; un informe que ser&aacute; evaluado por su tutor e incorporado al Documento de Actividades del Doctorando.</p>\r\n</li>\r\n</ol>','{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Secretaría del Departamento de Química Física. Facultad de Química, planta 4.  C/ Profesor García González,1\",\"telefono\":\"954556734\",\"nombre\":\"Juan José Calvente Pacheco \",\"email\":\"doctorado_ecyt@us.es\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"Secretaría del Departamento de Química Física. Facultad de Química, planta 4.  C/ Profesor García González,1\",\"telefono\":\"954556734\",\"nombre\":\"Juan José Calvente Pacheco\",\"email\":\"doctorado_ecyt@us.es\"}\r\n	]}}'),(28,'2014-04-09 09:23:16','3031','doctorado_qtymc@us.es','http://www.doctorado.us.es/oferta-estudios-doctorado/oferta-plan-2011/quimica-teorica-y-modelizacion-computacional-plan-2011','Química Teórica y Modelización Computacional','2011','QUÍMICA','','si',NULL,'{\"administrativo\":\r\n{\"contactos\":[\r\n	{\"direccion\":\"Facultad de Química, Dpto. de Química Física\",\"telefono\":\"\",\"nombre\":\"\",\"email\":\"\"}\r\n	]},\r\n\r\n\"academico\":{\"contactos\":[\r\n	{\"direccion\":\"\",\"telefono\":\"954557175\",\"nombre\":\"Enrique Sánchez Marcos\",\"email\":\"doctorado_qtymc@us.es\"}\r\n	]}}'),(32,NULL,NULL,NULL,NULL,'Análisis Económico Aplicado e Historia Económica','2007',NULL,NULL,NULL,NULL,NULL),(33,NULL,NULL,NULL,NULL,'Análisis Sociológico de las Sociedades Avanzadas','2007'